(1, 255, 'Isaline Alleyne-Cope', '', '', '', '2014-01-06 11:43:39', '2014-01-06 11:43:39', '<h3>Algidex Paste removal</h3>My chronic wound has now had ten dressings using Algidex Paste (approx. at 3 day intervals) and although there is some healing, on the last occasion my nurse said that she found it difficult to remove the previous application of the paste, and the wound may need surgical debridement.\r\n\r\nMy hospital doctors (two surgical interventions) are completely unforthcoming, they do not seem to know even about the simple instructions given with the paste.\r\n\r\nAny advice would be appreciated, or can you recommend a different product?', 0, '0', '', '', 0, 80),
(2, 1086, 'root', 'adrianjonmiller@gmail.com', '', '', '2014-12-30 05:01:46', '2014-12-30 05:01:46', 'Authorize.net AIM Payment Failed (2: "Error Code: 2 - This transaction has been declined." Transaction id 6795762498) Order status changed from Pending Payment to Failed.', 0, '1', 'WooCommerce', 'order_note', 0, 0),
(3, 1086, 'root', 'adrianjonmiller@gmail.com', '', '', '2014-12-30 05:04:22', '2014-12-30 05:04:22', 'Authorize.net AIM  Charge Approved: Visa ending in 4729 (expires 01/18) (Transaction ID 6795765891)', 0, '1', 'WooCommerce', 'order_note', 0, 0),
(4, 1086, 'root', 'adrianjonmiller@gmail.com', '', '', '2014-12-30 05:04:22', '2014-12-30 05:04:22', 'Order status changed from Pending Payment to Processing.', 0, '1', 'WooCommerce', 'order_note', 0, 0),
(5, 1086, 'root', 'adrianjonmiller@gmail.com', '', '', '2014-12-30 05:04:22', '2014-12-30 05:04:22', 'Item #16 stock reduced from 0 to -1.', 0, '1', 'WooCommerce', 'order_note', 0, 0),
(6, 1086, 'root', 'adrianjonmiller@gmail.com', '', '', '2014-12-30 05:04:22', '2014-12-30 05:04:22', 'Order item stock reduced successfully.', 0, '1', 'WooCommerce', 'order_note', 0, 0) ;
