(5, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>', 'Delivery', '', 'publish', 'open', 'open', '', 'delivery', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=5', 0, 'post', '', 0),
(6, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Web site was created using <a href="http://www.prestashop.com">PrestaShop</a>&trade; open-source software.</p>', 'Legal Notice', '', 'publish', 'open', 'open', '', 'legal-notice', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=6', 1, 'post', '', 0),
(7, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<h4>Are you under a doctor\'s care for an open wound?</h4> <p>Please be advised that many products shown on this site are covered by Medicare B or private insurance policies. To find out about what your insurance will cover, please call Wound Care Resources at (888) 287-9797 or go to our <a href="http://www.woundcareresources.net/" target="new"><strong>website</strong></a>. If Wound Care Resources bills your insurance for wound care dressings, anything purchased on this site will be packed along with covered items and shipped for a reduced shipping charge of $5.00. </p> <h4>Shipping and Handling</h4> <p><strong>We specialize in getting your products to you quickly</strong>.<br />Once an order is received it is processed within 24 to 36 hours during our business hours Monday-Friday 8:00-5:00 CST. Orders placed on Saturday or Sunday will be shipped on the following business day.</p> <p>Advanced Medical Resources routinely ships by UPS or FedEx. The United States Postal Service may be utilized for very small orders.  Most orders should be received in 2-5 business days after processing.</p> <p>The following holidays will be observed by our office when standard shipping service is not available: Memorial Day, Independence Day, Labor Day, Thanksgiving Day, day after Thanksgiving, Christmas Day, New Year’s Eve, New Years Day.</p> <h4><strong>Returns and Exchange Policy</strong></h4> <p> </p> <p align="center">• Only unopened, unused packages purchased from us and in perfect resale condition<br />  may be returned. <br />• A restocking fee of 15% will apply.<br />• Products special ordered or not routinely carried by Advanced Medical Resources <br />  may not be returned for credit. <br />• All returns must be mailed back to us within 30 days of purchase.</p> <p><strong>Please use the following procedure</strong>:<br />Call the office to obtain an RMA number or use our <a href="http://www.admedonline.com/returns.asp"><strong>return form</strong></a>.</p> <ol> <li>pack items carefully</li> <li>Call us at (866) 755-2677 to obtain an RMA number or use our return form. This number must be clearly placed outside the box.  Packages received without an RMA number will not be accepted and will be returned to you</li> <li>Insure your package for the cost of your items</li> <li>Send returns to: <br />Advanced Medical Resources<br />4 Newbern Highway <br />Yorkville, TN 38389</li> </ol> <p> </p> <p><strong>Returned products will be inspected.</strong><br />Once your products have been considered to be in perfect resalable condition, your credit card will be credited for the returned items less the restocking fee.  All shipping charges are at the customer’s expense and are not refundable.</p> <p><strong>Returns due to product defect or incorrect products sent</strong><br />If products were sent in error or are defective, Advanced Medical Resources must be contacted within two days of delivery for an adjustment to be made.  We will issue you a Return Merchandise Authorization number to ship the product back to our office, and resend the correct items at no extra cost for shipping and handling.  Please follow these steps:</p> <p>To request a return please use our <a href="http://www.admedonline.com/returns.asp"><strong>return form</strong></a> or call our toll free number (866) 755-2677 with the following information:</p> <ol> <li>Customer name</li> <li>Date of purchase</li> <li>Original invoice number</li> <li>Product item number</li> <li>Product name</li> <li>Reason for return.</li> </ol> <p> </p> <p>Upon verification of the above information, our returns department will assign a return authorization number and process a request for a UPS pickup.</p> <p><strong>Returns due to shipping damage<br /></strong>Damaged boxes should not be accepted upon delivery.  However, if you do accept or receive a damaged box and the contents have been damaged, please use our <a href="http://www.admedonline.com/contact.asp"><strong>contact form</strong></a> or call our toll free number at (866) 755-2677.</p> <p align="center"> </p> <h4>General Policies</h4> <p> </p> <p><strong>Patients who have Medicare or commercial insurance </strong>should contact Wound Care Resources at (888) 287-9797 to determine if their insurance will cover the cost of wound care supplies.  You may also visit the website at<strong> <a href="http://www.woundcareresources.net/" target="new">www.woundcareresources.net</a></strong>.</p> <p><strong>Product Availability:</strong><br />Advanced Medical Resources cannot be liable for delays caused by a shortage of raw materials, manufacturing difficulties, delivery delays, labor disputes or any other issues beyond our control.</p> <p><strong>Backorders:</strong><br />Advanced Medical works hard to prevent back orders.  However, if a backorder occurs, the shipping cost will be adjusted for the cost of the order actually shipped, and your backorder shipping will be sent to you at a nominal charge.</p> <p><strong>Substitutions:</strong><br />Brand name products that have a chemical or biological effect on healing (primary dressings) will not be substituted without contacting the customer by phone or email.</p> <p>All stock dressings that are used to hold other dressings in place (secondary dressings like gauze, gauze sponges, gauze rolls, ABD pads, etc.) have been chosen by Advanced Medical for quality. Substitutions of these types of products will not affect the healing outcome of the wound, and in some rare cases a comparable product with a different brand name may be sent to fill the entire order in a timely manner.</p> <p><strong>Sales tax will be applied in accordance with state and federal laws</strong>.</p> <p><strong>Privacy Policy</strong><br />You may be confident that your personal information will be protected.<br />No personal information will be provided or sold to any other marketing organizations. </p> <p><strong>Volume Discounts Available</strong><br />Please call our office for questions regarding volume discounting. AMR routinely offers volume discounts to medical facilities ordering products in larger quantities.  Valid tax IDs and additional information is required. </p> <p><strong>Special orders, contract orders and business to business orders are non-returnable.</strong></p> <p>Please call our office at <strong>(866) 755-2677</strong> with questions regarding volume discounting, and ask for Jackie Scott.  You may also contact her at<strong> <a href="mailto:jscott@admedonline.com">jscott@admedonline.com</a></strong>.</p>', 'Terms and conditions of use', '', 'publish', 'open', 'open', '', 'terms-and-conditions-of-use', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=7', 2, 'post', '', 0),
(8, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<h2>About us</h2> <h3>Our company</h3><p>Our company</p> <h3>Our team</h3><p>Our team</p> <h3>Informations</h3><p>Informations</p>', 'About us', '', 'publish', 'open', 'open', '', 'about-us', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=8', 3, 'post', '', 0),
(9, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<h2>Secure payment</h2> <h3>Our secure payment</h3><p>With SSL</p> <h3>Using Visa/Mastercard/Paypal</h3><p>About this services</p>', 'Secure payment', '', 'publish', 'open', 'open', '', 'secure-payment', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=9', 4, 'post', '', 0),
(10, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<p class="bodytxt"><strong>Amorphous –</strong><strong> </strong>Without a clear shape as in a wound dressing in gel form</p> <p class="bodytxt"><strong>Antimicrobial –</strong><strong> </strong>An agent that inhibits the growth of bacteria</p> <p class="bodytxt"><strong>Arterial Ulcer</strong> – Related to the presence of arterial occlusive disease.  Presenting symptoms mainly involve pain and tissue loss.</p> <p class="bodytxt"><strong>Autolytic Debridement</strong> - Removal of devitalized tissue through normal wound exudate or through the use of any topical dressing or preparation that encourages moisture retention or by the body’s own mechanisms</p> <p class="bodytxt"><strong>Bedsore</strong> – The traditional name for a pressure ulcer. Also called a decubitus ulcer.</p> <p class="bodytxt"><strong>Beefy Red</strong> – A term used to describe a healthy looking wound with good blood supply</p> <p class="bodytxt"><strong>Blanching</strong> – To become white with pressure</p> <p class="bodytxt"><strong>Biocompatible</strong> – refers to the ability of a product to perform its desired function without eliciting any undesirable effects</p> <p class="bodytxt"><strong>Cellulitis</strong> – Inflammation of tissue characterized by redness.  Signifies a spreading infection.</p> <p class="bodytxt"><strong>Chemical Debridement</strong> – The removal of dead or devitalized tissue by using enzymatic debriding agents.</p> <p class="bodytxt"><strong>Chronic Wound</strong> – A wound that takes longer than normal to heal due to underlying conditions such as pressure, diabetes, poor circulation, immune deficiencies or infection.</p> <p class="bodytxt"><strong>Contraction</strong> – The pulling together of wound edges/margins in the healing process.</p> <p class="bodytxt"><strong>CWOCN</strong> – Same as “ET Nurse” (Certified wound, ostomy, continence nurse).</p> <p class="bodytxt"><strong>CWS</strong> – Certified Wound Specialist</p> <p class="bodytxt"><strong>Debride</strong> – to remove dead or devitalized tissue</p> <p class="bodytxt"><strong>Debridement</strong> – Removal of dead or devitalized tissue.</p> <p class="bodytxt"><strong>Decubitus Ulcer</strong> – The Latin term for a pressure ulcer. (Sometimes referred to as a “decub.”)</p> <p class="bodytxt"><strong>Dehisced</strong> – Describes a surgical wound which has broken open or is not healing properly</p> <p class="bodytxt"><strong>Denuded</strong> – Loss of epidermis.</p> <p class="bodytxt"><strong>Depth</strong> – Distance from the wound’s surface downward. The last measurement in wound description in centimeters.</p> <p class="bodytxt"><strong>Dermis</strong> – The second layer of skin that contains hair follicles, sweat glands, sebaceous glands, blood vessels and lymph vessels: involved in stage 2, 3, and 4 pressure ulcers as well as partial and full thickness wounds.</p> <p class="bodytxt"><strong>Edema</strong> – Observable swelling from fluid accumulation in body tissues</p> <p class="bodytxt"><strong>Enterostomal Therapy Nurse or Certified Wound, Ostomy, Continence Nurse</strong> – <br /> Often referred to as “ET nurse.”  Nurse who provides Care expertise to patients with abdominal stomas, draining  wounds and fistulas, incontinence and general wound care.</p> <p class="bodytxt"><strong>Epidermis</strong> – The outer cellular layer of the skin</p> <p class="bodytxt"><strong>Epiboly</strong> – edges of the top layer of the epidermis roll down to cover lower edge of epidermis, causing the inability of epithelial cells to migrate from wound edges. Wound healing cannot take place in this circumstance.</p> <p class="bodytxt"><strong>Epithelialization –</strong><strong> </strong>Regeneration of the epidermis across a wound surface</p> <p class="bodytxt"><strong>Erythema</strong> – Redness of the skin surface produced by widening of the blood vessels.</p> <p class="bodytxt"><strong>Eschar</strong> – Thick, leathery dead or devitalized tissue.</p> <p class="bodytxt"><strong>Etiology</strong> – The science and study of the causes of diseases and their mode of operation.</p> <p class="bodytxt"><strong>ET nurse</strong> – Commonly used term for an Enterostomal Therapy Nurse.</p> <p class="bodytxt"><strong>Excoriation</strong> – Linear scratches on the skin.</p> <p class="bodytxt"><strong>Exudate</strong> – Accumulation of fluids in a wound. </p> <p class="bodytxt"><strong>Fenestrated –</strong><strong> </strong>sliced or cut open</p> <p class="bodytxt"><strong>Fibrous Tissue</strong> – Tightly bound yellow film found on the granulation tissue surface composed of or containing fibroblasts</p> <p class="bodytxt"><strong>Friable</strong> – refers to a delicate wound that may bleed easily</p> <p class="bodytxt"><strong>Friction</strong> – Surface damage caused by skin rubbing against another surface.</p> <p class="bodytxt"><strong>Full Thickness Wound</strong> – Tissue destruction extending through the dermis to involve subcutaneous tissue and possibly muscle/bone.</p> <p class="bodytxt"><strong>Granulation Tissue</strong> – The formation or growth of small blood vessels and connective tissue in a full thickness wound and a stage 3 and 4 pressure ulcer: beefy red, shiny, granular tissue which generally indicates healing.</p> <p class="bodytxt"><strong>Growth Factors -</strong><strong> </strong>refers to naturally occurring substances capable of stimulating cellular growth and proliferation</p> <p class="bodytxt"><strong>Hydrophilic</strong> – Attracting moisture</p> <p class="bodytxt"><strong>Hydroactive –</strong><strong> </strong>Activated by moisture</p> <p class="bodytxt"><strong>Hypertonic –</strong><strong> </strong>movement of water from a high H2O concentration inside the cell, to a low H2O concentration outside the cell. Hypertonic wound dressings pull water or exudate out of an area and create a moist environment that is more conducive to wound healing.</p> <p class="bodytxt"><strong>Hypergranulation –</strong><strong> </strong>Increased thickness in the granular layer of the epidermis.</p> <p class="bodytxt"><strong>Ionic exchange</strong><strong> </strong><strong>–</strong><strong> </strong>Denotes the processes of purification, separation, and decontamination.</p> <p class="bodytxt"><strong>Infection</strong> – Overgrowth of microorganisms capable of tissue destruction and invasion, accompanied by local or systemic symptoms </p> <p class="bodytxt"><strong>Inflammation</strong> – Defensive reaction to tissue injury: involves increased blood flow and capillary permeability Signs and symptoms include heat, redness, swelling and pain of the affected area.</p> <p class="bodytxt"><strong>Inflammatory Phase</strong> – The first phase in the normal wound healing process that lasts approximately from time of the initial injury to four days post injury.</p> <p class="bodytxt"><strong>Ischemia</strong> – A deficiency of blood supply due to functional constriction or obstruction of a blood vessel.</p> <p class="bodytxt"><strong>Maceration</strong> – A “waterlogged” appearance of the area surrounding a wound which is an indication of excessive moisture or an inappropriate dressing or dressing application.   </p> <p class="bodytxt"><strong>Macrophage</strong> – “Giant Eater:” eats up unwanted dead tissue, cleans the wound and releases chemicals.</p> <p class="bodytxt"><strong>Mechanical Debridement</strong> – The removal of dead or devitalized tissue, for example by the use of wet-to-dry dressings, whirlpool or surgical debridement.</p> <p class="bodytxt"><strong>Moisture Retentive Dressings</strong> – Dressings that allow wounds to remain moist.</p> <p class="bodytxt"><strong>MMP’s –</strong><strong> </strong>Enzymes in chronic wounds which when imbalanced with their natural inhibitors can become destructive and delay the healing process.</p> <p class="bodytxt"><strong>Necrotic</strong> – Dead</p> <p class="bodytxt"><strong>Negative pressure</strong> – a vacuum-action that is used to reduce pressure around a wound, drawing out excess fluids and cellular wastes.</p> <p class="bodytxt"><strong>Non-occlusive –</strong><strong> </strong>Allowing the passage of moisture and air</p> <p class="bodytxt"><strong>Occlusive</strong> - A dressing that prevent the passage of air that can dry out a wound bed or to prevent unwanted or unneeded moisture from going into or out of an area. </p> <p class="bodytxt"><strong>Osmotic</strong> – relating to osmosis: a physical process in which a solvent moves, without input of energy, across a semi-permeable membrane. This term relates to movement of wound fluid from one place to another.</p> <p class="bodytxt"><strong>Osteomyelitis</strong> – Inflammation of the bone marrow and adjacent bone.</p> <p class="bodytxt"><strong>Partial Thickness Wound</strong> – Tissue destruction through the epidermis extending into but not through the dermis.</p> <p class="bodytxt"><strong>Periwound</strong> – Around the wound</p> <p class="bodytxt"><strong>Permeability</strong> -  Ability to pass through</p> <p class="bodytxt"><strong>Pressure Ulcer</strong> – An area of localized damage caused by ischemia due to pressure.</p> <p class="bodytxt"><strong>Serous</strong> – Producting a serous secretion or containing serum</p> <p class="bodytxt"><strong>Sinus tract</strong> – A pathway which can extend in any direction from the wound surface resulting in dead space</p> <p class="bodytxt"><strong>Sodium Hypochlorite</strong> – a chemical compound frequently used as a disinfecting agent</p> <p class="bodytxt"><strong>Slough –</strong> Necrotic tissue that is usually loose, stringy, yellow, tan, white or gray in color.</p> <p class="bodytxt"><strong>Shear</strong> – Trauma caused by tissue layers sliding against each other.</p> <p class="bodytxt"><strong>Stasis</strong> – Stagnation of blood caused by venous congestion.</p> <p class="bodytxt"><strong>Staging</strong> – An anatomical description of depth used to describe pressure ulcers.</p> <p class="bodytxt"><strong>Surgical Debridement</strong> – The removal of dead or devitalized tissue by a physician or trained healthcare professional at the bedside or in the operating room.</p> <p class="bodytxt"><strong>Tunneling</strong> – Tissue destruction underlying intact skin along wound margins.</p> <p class="bodytxt"><strong>Ulcer</strong><strong> </strong>– An open lesion or sore</p> <p class="bodytxt"><strong>Undermining</strong> – Another term used to describe tunneling: tissue destruction underlying intact skin along wound margins</p> <p class="bodytxt"><strong>Vasoconstriction</strong>- Dilation of blood vessels</p> <p class="bodytxt"><strong>Vasodilation</strong> – Dilation of blood vessels</p> <p class="bodytxt"><strong>Venous</strong> – pertaining to the veins.</p> <p class="bodytxt"><strong>Venous Ulcer</strong> – Local losses of epidermis and variable levels of dermis and subcutaneous tissue occuring over or near the ankle and/or lateral lower leg.</p> <p class="bodytxt"><strong>WOCN</strong> – An acronym for Wound, Ostomy, Continence Nurse<br /> </p> <p> </p>', 'Wound Terminology', '', 'publish', 'open', 'open', '', 'wound-terminology', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=10', 5, 'post', '', 0),
(11, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<p><strong><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">GAUZE ROLLS &amp; GAUZE SPONGES</a></strong></p> <p><strong>ANTIMICROBIAL GAUZE WRAP – ANTIMICROBIAL GAUZE SPONGE</strong><br /><br />Roll gauze impregnated with an <a href="http://www.admedonline.com/education.asp#antimicrobial"><span style="text-decoration: underline;">antimicrobial</span></a> substance to prevent contamination of a wound site.</p> <p><strong>Examples: <br />Bioguard roll gauze<br />Bioguard gauze sponge <br />Kerlix AMD </strong><br /><br /><strong>Indicated for</strong> <br />Use on any wound site to prevent infection from entering the wound site from the outside <br /><br /><strong>Action</strong> <br />Prevents infection by eliminating bacteria <br /><br /><strong>Contraindications</strong> <br />None known</p> <hr /> <p> </p> <p><strong><a id="anasept" name="anasept"></a><a href="http://www.admedonline.com/proddetail.asp?prod=antimicrobial%5Fanasept%5Fspray">ANASEPT SPRAY</a></strong><br /><br />Anasept is an extremely safe and gentle antimicrobial skin and wound cleanser with exceptionally rapid broad-spectrum bactericidal, fungicidal and virucidal properties.  It is a pure, colorless, isotonic, tissue-compatible solution and has a two-year shelf life.</p> <p>Anasept will eliminate bacteria and fungi within 2 minutes or less including resistant strains such as MRSA, VRE, Pseudomonas, Candida albicans and Aspergillus niger.  There is no known microbial resistance to Anasept.</p> <p>This product may be used as a wound cleanser and to prepare sites for IV fluids, dialysis, central lines and more.</p> <hr /> <p><br /><a name="alginate"></a><strong><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">CALCIUM ALGINATE DRESSINGS</a></strong><br /><strong>Secondary dressing should be used to cover </strong><br /><br /><a href="http://www.admedonline.com/education.asp#hydrophilic"><span style="text-decoration: underline;">Hydrophilic</span></a>, non-woven fiber dressings that are derived from seaweed and when contacted by wound <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a> form a gel mass in the wound.  These come in a sheet or rope form and are absorbent.</p> <p><strong>Examples: <br />Algicel <br />Melgisorb <br />Reliamed </strong><br /><br /><strong>Indicated for</strong> <br /><a href="http://www.admedonline.com/education.asp#partial_thkns"><span style="text-decoration: underline;">Partial thickness</span></a> and <a href="http://www.admedonline.com/education.asp#full_thkns"><span style="text-decoration: underline;">full thickness</span></a> wounds having moderate to heavy <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a>, Infected wounds, Filling cavities, tracts and<a href="http://www.admedonline.com/education.asp#undermining"><span style="text-decoration: underline;">undermining</span></a>, <a href="http://www.admedonline.com/education.asp#partial_thkns"><span style="text-decoration: underline;">Partial thickness</span></a> and <a href="http://www.admedonline.com/education.asp#full_thkns"><span style="text-decoration: underline;">full thickness</span></a> wounds <br /><br /><strong>Action</strong> <br />Absorbs excess <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a> while maintaining a moist wound environment Facilitates <a href="http://www.admedonline.com/education.asp#autolytic"><span style="text-decoration: underline;">autolytic debridement</span></a> of loose, <a href="http://www.admedonline.com/education.asp#necrotic"><span style="text-decoration: underline;">necrotic</span></a> tissue <br /><br /><strong>Contraindications</strong> <br />Dry wounds </p> <hr /> <p><br /><a name="alginatesilver"></a><strong><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">CALCIUM ALGINATE WITH SILVER</a></strong><br /><strong>Secondary dressing should be used to cover </strong><br /><br />Same composition and indications as calcium alginate with silver added for <a href="http://www.admedonline.com/education.asp#antimicrobial"><span style="text-decoration: underline;">antimicrobial</span></a> benefits.</p> <p><strong>Examples:<br />Silverlon CA <br />Algicel AG<br />Reliamed AG-CMC (hydrofiber)</strong></p> <p><strong>Indicated for</strong> <br />Draining wounds with signs of infection Filling cavities, tracts and <a href="http://www.admedonline.com/education.asp#undermining"><span style="text-decoration: underline;">undermining</span></a> <br /><br /><strong>Action</strong> <br />Absorbs excess <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a> while maintaining a moist wound environment Facilitates <a href="http://www.admedonline.com/education.asp#autolytic"><span style="text-decoration: underline;">autolytic debridement</span></a> of loose, <a href="http://www.admedonline.com/education.asp#necrotic"><span style="text-decoration: underline;">necrotic</span></a> tissue Decreases or eliminates bacterial load in an infected wound <br /><br /><strong>Contraindications:</strong> <br />Do not use with hydrogels <br />Should not be used with products that create an ionic exchange in the wound site <br />Cannot be used with enzymes (ie Santyl Collagenase) <br /><br /></p> <hr /> <p><br /><strong><a name="alginatehoney"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">CALCIUM ALGINATE WITH HONEY</a></strong><br /><strong>Secondary dressing should be used to cover</strong> <br /><br />Active Leptospermum Honey impregnated into a calcium alginate pad.  As wound <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a> is absorbed, the alginate forms a gel to assist in maintaining a moist wound environment for optimal wound healing.  Alginate is removable in one piece.</p> <p><strong>Example:     <br />Medihoney </strong><br /><br /><strong>Indicated for</strong> diabetic foot ulcers, leg ulcers, pressure ulcers <br />1st and 2nd degree <a href="http://www.admedonline.com/education.asp#partial_thkns"><span style="text-decoration: underline;">partial thickness</span></a> burns <br />donor sites <br />traumatic and surgical wounds <br /><br /><strong>Action</strong> Cleanses and debrides lowers overall wound pH promotes a moisture-balanced environment eliminates bacteria and multi-resistant bacteria with natural honey</p> <hr /> <p><br /><strong><a name="collagen"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">COLLAGEN DRESSINGS</a></strong><br /><br />These dressings come in pads, gels or particles and promote the deposit of newly formed collagen in the wound bed. They can be used on any type of wound with any type of drainage. Some specific brands require the wound to be free of <a href="http://www.admedonline.com/education.asp#necrotic"><span style="text-decoration: underline;">necrotic</span></a> tissue.</p> <p><strong>Examples: <br />pads – Promogran Prisma, Promogran Matrix (collagen with silver), BioPad, Fibracol Plus (alginate/collagen combination) <br />gel – Stimulen Gel <br />powder – Stimulen </strong><br /><br /><strong></strong><strong>Indicated for</strong> <br />Any type of wound with minimal, moderate or heavy drainage Some specific brands require the wound to be free of <a href="http://www.admedonline.com/education.asp#necrotic"><span style="text-decoration: underline;">necrotic</span></a> tissue <br /><br /><strong>Action</strong> <br />Provides a moist healing environment <br />Some brands reduce destructive elements in wound fluid to “kick-start” healing while allowing the patient’s <a href="http://www.admedonline.com/education.asp#growth"><span style="text-decoration: underline;">growth factors</span></a> to effectively heal the wound Promotes tissue <a href="http://www.admedonline.com/education.asp#granulation"><span style="text-decoration: underline;">granulation</span></a> and <a href="http://www.admedonline.com/education.asp#epithelialization"><span style="text-decoration: underline;">epithelialization</span></a> Burns Grafts <br /><br /><strong></strong><strong>Contraindications</strong> <br />none known </p> <hr /> <p><br /><strong><a id="hydro" name="hydro"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">HYDROCOLLOID DRESSINGS</a></strong><br /><strong>Can be either a primary or a secondary dressing </strong><br /><br />Wafer-type dressings that contain <a href="http://www.admedonline.com/education.asp#hydroactive"><span style="text-decoration: underline;">hydroactive</span></a> particles which, when in contact with wound <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a>, form a fluid/gel environment over the wound bed.  They can be self-adhering  with a surface that repells water, bacteria and other outside contaminants.  They are considered <a href="http://www.admedonline.com/education.asp#occlusive"><span style="text-decoration: underline;">occlusive</span></a> or semi-<a href="http://www.admedonline.com/education.asp#occlusive"><span style="text-decoration: underline;">occlusive</span></a>.</p> <p><strong>Examples: <br />Tegaderm Thin <br />Reliamed border sacral <br />Reliamed beveled <br />Flexicol bordered <br />Medihoney sheet (hydrocolloid with honey) <br />Medihoney tube  </strong> <br /><br /><strong>Indicated for</strong> <br /><a href="http://www.admedonline.com/education.asp#partial_thkns"><span style="text-decoration: underline;">partial thickness</span></a> to shallow <a href="http://www.admedonline.com/education.asp#full_thkns"><span style="text-decoration: underline;">full thickness</span></a> wounds <br /><br /><strong>Action</strong> <br />maintains a moist wound environment provides protection and insulation to a healing wound facilitates <a href="http://www.admedonline.com/education.asp#autolytic"><span style="text-decoration: underline;">autolytic debridement</span></a> <br /><br /><strong>Contraindications for use</strong> <br />infected wounds <br />wounds with heavy <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a>, deep cavities, sinus tracts (unless used as a secondary dressing over packing) <br />Burns <br />Grafts </p> <hr /> <p><br /><strong><a name="hydrofera"></a><a href="http://www.admedonline.com/proddetail.asp?prod=foam%5Fhydrofera">HYDROFERA BLUE</a></strong> <br />Foam impregnated with Methylene Blue and Gentian Violet <br /><br /><strong></strong><strong>Indicated for</strong> <br />Wounds containing bacteria, yeast and fungus <br /><br /><strong></strong><strong>Action</strong> <br />Provides a protective, bacteriostatic cover which may help prevent infection <br /><br />When used under an <a href="http://www.admedonline.com/education.asp#occlusive">occlusive</a> dressing, product will create a mild <a href="http://www.admedonline.com/education.asp#negative">negative pressure</a> that will reduce an <a href="http://www.admedonline.com/education.asp#epiboly">epiboly</a> (rolled edge). <br /><br /><strong>Contraindications</strong> <br />None known </p> <hr /> <p><br /><strong><a name="hydrogel"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">HYDROGEL DRESSINGS</a></strong><br /><strong>Must be covered with a secondary cover dressing</strong> <br /><br />Vary in composition but most are <a href="http://www.admedonline.com/education.asp#nonocclusive">non-occlusive</a> and water or glycerin based, depending on manufacturer.  This product comes in sheets, impregnated in gauze and in gel form.</p> <p><strong>Examples: <br />hydrogel sheets – Spand-Gel, Avogel <br />amorphous hydrogel – Normlgel </strong><br /><br /><strong>Indicated for</strong> <br />Any type of wound needing additional moisture <br />Burns <br />Grafts <br />Sheet form can be used for quicker healing of cosmetic procedures and/or scar reduction <br /><br /><strong>Action</strong> <br />Adds moisture to dry wounds <br />Maintains a moist wound environment <br />Facilitates <a href="http://www.admedonline.com/education.asp#autolytic"><span style="text-decoration: underline;">autolytic debridement</span></a>. <br />Avogel sheets provide a barrier to prevent heat and water loss through the skin which aids in scar reduction <br /><br /><strong>Contraindications</strong> <br />Because of the moist nature of these dressings, care must be taken to observe the wound edges and protect from <a href="http://www.admedonline.com/education.asp#maceration"><span style="text-decoration: underline;">maceration</span></a>. </p> <hr /> <p><br /><strong><a name="hydrogelanti"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">HYDROGEL</a> - <a href="http://www.admedonline.com/education.asp#antimicrobial">ANTIMICROBIAL</a></strong><br /><br /><a href="http://www.admedonline.com/education.asp#amorphous"><span style="text-decoration: underline;">Amorphous</span></a> hydrogel combined with <a href="http://www.admedonline.com/education.asp#sodium"><span style="text-decoration: underline;">sodium hypochlorite</span></a> for elimination of bacteria, multi-resistant bacteria, viruses and fungi.</p> <p><strong>Example: <br />Anasept</strong><br /><br /><strong>Indicated for</strong> <br />Any wound needing additional moisture and infection protection <br />Dry wounds with signs of infection <br />Burns <br />Grafts <br /><br /><strong>Action</strong> <br />Provides moisture to a wound site while eliminating or preventing infection <a href="http://www.admedonline.com/education.asp#biocompatible"><span style="text-decoration: underline;">Biocompatible</span></a> with other dressings <br /><br /><strong>Contraindications</strong> <br />None known </p> <hr /> <p><br /><strong><a name="hydrogelsilver"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">HYDROGEL WITH SILVER</a></strong><br /><br />Hydrogel with silver added for <a href="http://www.admedonline.com/education.asp#antimicrobial"><span style="text-decoration: underline;">antimicrobial</span></a> benefits</p> <p><strong>Examples: <br />SilverSept <br />Elta silver hydrogel </strong><br /><br /><strong>Indicated for</strong> <br />Wounds needing additional moisture and infection protection <br />Dry wounds with evidence of infection <br /><br /><strong>Action</strong> <br />Provides moisture in a wound site while eliminating or preventing infection <br />Absorbs a small amount of wound <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a> <br /><br /><strong>Contraindications:</strong> <br />Should not be utilized in conjuction with Tegaderm Matrix as deactivation of both dressings will result </p> <hr /> <p><br /><strong><a name="tape"></a>HYPERTONIC DRESSINGS</strong><br /><br />Available in impregnated gauze and gel form, these dressings provide a high sodium chloride level to eliminate <a href="http://www.admedonline.com/education.asp#necrotic">necrotic</a> tissue.</p> <p><strong>Examples: <br />Hypergel – gel used to break down eschar of <a href="http://www.admedonline.com/education.asp#necrotic"><span style="text-decoration: underline;">necrotic</span></a> tissue <br />Mesalt– dry sheet or strip (used to wick infection out of tunneling areas) <br />Curasalt <span class="tablehd">– </span>moist hypertonic tape</strong><br /><br /><strong>Indicated for</strong> <br /><a href="http://www.admedonline.com/education.asp#autolytic"><span style="text-decoration: underline;">autolytic debridement</span></a> of <a href="http://www.admedonline.com/education.asp#necrotic"><span style="text-decoration: underline;">necrotic</span></a> tissue fills wound space to wick drainage out of a tunnel or <a href="http://www.admedonline.com/education.asp#undermining"><span style="text-decoration: underline;">undermining</span></a> provides or encourages a moist environment <br /><br /><strong>Action</strong> <br />creates <a href="http://www.admedonline.com/education.asp#osmotic"><span style="text-decoration: underline;">osmotic</span></a> changes in the wound environment to encourage debridement <br /><br /><strong></strong><strong>Contraindications:</strong> <br />cannot apply to <a href="http://www.admedonline.com/education.asp#granulation"><span style="text-decoration: underline;">granulation</span></a> tissue as it can cause a burning sensation </p> <hr /> <p><br /><strong><a name="foam"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">FOAM DRESSINGS, BORDERED FOAM DRESSINGS, FOAM DRESSINGS WITH SILVER</a></strong><br /><strong>May be used as a primary or secondary dressing</strong><br /><br />Available as self-adhering or non-adherent (though some may have adhesive border). Polyurethane foam dressings which have an absorbent wound contact surface and most have a moisture-repellant outer surface which is <a href="http://www.admedonline.com/education.asp#nonocclusive"><span style="text-decoration: underline;">non-occlusive</span></a>.  Ability to absorb<a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a> is dependant upon thickness and density of the dressing.</p> <p><strong>Examples: <br />Mepilex (with Safetac technology) <br />Mepilex Border (water resistant with Safetac technology) <br />Polymem <br />Polymem Dot (with silver) <br />Reliamed</strong><br /><br /><strong>Indicated for</strong> <br />Partial and <a href="http://www.admedonline.com/education.asp#full_thkns">full thickness</a> wounds <br />To cover wounds containing packing material <br /><br /><strong></strong><strong>Action</strong> <br />Absorbs excess <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a> to prevent <a href="http://www.admedonline.com/education.asp#maceration"><span style="text-decoration: underline;">maceration</span></a> <br />Provides a moist wound environment <br />Insulation and protection <br /><br /><strong></strong><strong>Contraindications</strong> <br />Wounds with dry eschar <br />No or minimal <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudate</span></a></p> <hr /> <p><br /><strong><a name="moisture"></a>MOISTURE REGULATION</strong><br /><strong>Requires a secondary dressing to cover it</strong> <br /><br />An inert breathable polymer combined with a nonwoven medium which provides fluid balance at the wound surface instead of within the dressing.</p> <p><strong>Example: <br />TheraGauze </strong><br /><br /><strong>Indicated for:</strong> <br /><a href="http://www.admedonline.com/education.asp#partial_thkns"><span style="text-decoration: underline;">partial</span></a> and <a href="http://www.admedonline.com/education.asp#full_thkns"><span style="text-decoration: underline;">full thickness</span></a> wounds of any type <br />grafts <br />burns <br /><br /><strong>Action:</strong> <br />Controls moisture and facilitates healing by releasing or absorbing moisture based on wound conditions <br />Prevents <a href="http://www.admedonline.com/education.asp#maceration"><span style="text-decoration: underline;">maceration</span></a> <br />High oxygen <a href="http://www.admedonline.com/education.asp#permeability"><span style="text-decoration: underline;">permeability</span></a> <br />Compatible with most other medications <br />One-piece removal <br /><br /><strong>Contraindications:</strong> <br />Wet wounds unless <a href="http://www.admedonline.com/education.asp#fenestrated"><span style="text-decoration: underline;">fenestrated</span></a></p> <hr /> <p><br /><strong><a name="mmpred"></a><a href="http://www.admedonline.com/education.asp#mmps">MMP</a> REDUCTION</strong><br /><strong>Requires a secondary dressing to cover it</strong> <br /><br />Cellulose impregnated with potassium, zinc, calcium and rubidium. </p> <p><strong>Examples <br />Tegaderm Matrix <br />EpiMax</strong><br /><br /><strong>Indicated for</strong> <br />All types of wounds including burns, grafts and incisions <br />“Kick-starting” stalled wounds <br /><br /><strong>Action</strong> <br />Corrects the MMP balance in the wound site enabling the patient’s <a href="http://www.admedonline.com/education.asp#growth"><span style="text-decoration: underline;">growth factors</span></a> to heal the wound <br />Creates a moist wound environment while preventing <a href="http://www.admedonline.com/education.asp#maceration"><span style="text-decoration: underline;">maceration</span></a> <br /><br /><strong>Contraindications</strong> <br />Use with silver products will cause deactivation of both products. </p> <hr /> <p><br /><strong><a name="transparent"></a><a href="http://www.admedonline.com/wound-care-products.asp?cat=13&amp;id=woundcare">TRANSPARENT FILM DRESSINGS</a></strong><br /><br />Semipermeable membranes which are self-adhering, thin and waterproof. They allow gaseous exchange between the wound bed and the environment, but water, bacteria or other contaminants cannot penetrate the dressing</p> <p><strong>Examples: <br />Mepore <br />ReliaMed Transparent Thin film dressings</strong><br /><br /><strong>Indicated for:</strong> <br /><a href="http://www.admedonline.com/education.asp#partial_thkns"><span style="text-decoration: underline;">partial thickness</span></a> wounds <br />stage II ulcers <br />dry, <a href="http://www.admedonline.com/education.asp#necrotic"><span style="text-decoration: underline;">necrotic</span></a> wounds requiring debridement <br /><br /><strong>Action</strong> <br />helps to maintain a moist wound surface <br />facilitates <a href="http://www.admedonline.com/education.asp#autolytic"><span style="text-decoration: underline;">autolytic debridement</span></a>.  <br /><br /><strong>Contraindications for use:</strong> <br />heavy <a href="http://www.admedonline.com/education.asp#exudate"><span style="text-decoration: underline;">exudating</span> </a>wounds <br />deep cavities, sinus tracts or <a href="http://www.admedonline.com/education.asp#undermining"><span style="text-decoration: underline;">undermining</span></a> (unless used as a secondary dressing) or wounds with <a href="http://www.admedonline.com/education.asp#friable"><span style="text-decoration: underline;">friable</span></a> skin in the <a href="http://www.admedonline.com/education.asp#periwound"><span style="text-decoration: underline;">periwound</span></a> area.</p>', 'Product Terminology', '', 'publish', 'open', 'open', '', 'product-terminology', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=11', 6, 'post', '', 0),
(12, 1, '2013-04-10 17:10:03', '2013-04-10 17:10:03', '<p>We are happy to annouce with the grand opening of our new site we are having an Amazon giftcard giveaway. no purchase necessary just use the widget below to enter. At the end of the contest we will post the winner to facebook. </p>', 'Amazon Giftcard Contest', '', 'publish', 'open', 'open', '', 'amazon-giftcard-contest', '', '', '2013-04-10 17:10:03', '2013-04-10 17:10:03', '', 0, 'http://admedonline.com/wordpress/?p=12', 7, 'post', '', 0),
(13, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ABD Pad- Abdominal Pad-150', '', 'inherit', 'open', 'open', '', 'abd-pad-abdominal-pad-150', '', '', '2014-12-20 22:51:06', '2014-12-20 22:51:06', '', 14, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_5_0_150.jpg', 0, 'attachment', 'image/jpeg', 0),
(14, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration. The backing is constructed of a hydrophobic material which prevents strike-through. All edges are sealed to prevent linting. Latex Free.</p>', 'ABD Pad- Abdominal Pad', '<p>Dupad abdominal pads are filled with cellulose fibers making them super-absorbent. The fibers quickly absorb and disperse fluids laterally to prevent pooling and maceration.</p>', 'publish', 'open', 'open', '', 'dupad-abdominal-pad', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=dupad-abdominal-pad', 0, 'product', '', 0),
(15, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Multipad Non-Adherent Wound Dressing-28', '', 'inherit', 'open', 'open', '', 'multipad-non-adherent-wound-dressing-28', '', '', '2014-12-20 22:51:06', '2014-12-20 22:51:06', '', 16, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_2_8_28.jpg', 0, 'attachment', 'image/jpeg', 0),
(16, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A multi-layered, highly absorbent wound dressing. Gentle non-woven rayon pad between two non-adhering polypropylene contact layers. Will not stick to wound site, damage fragile granulation tissue or traumatize wound upon removal. Absorbs significantly more drainage than similar dressings resulting in fewer dressing changes. Use in place of gauze and tape when more absorbency is needed.</p> <p>Use as a primary or secondary dressing.</p>', 'Multipad Non-Adherent Wound Dressing', '<p>A multi-layered and highly absorbent wound dressing. Will not stick to wound site, damage fragile granulation tissue or traumatize wound upon removal.</p>', 'publish', 'open', 'open', '', 'multipad-non-adherent-wound-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=multipad-non-adherent-wound-dressing', 0, 'product', '', 0),
(17, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Sofsorb Absorbent Wound Dressing-29', '', 'inherit', 'open', 'open', '', 'sofsorb-absorbent-wound-dressing-29', '', '', '2014-12-20 22:51:07', '2014-12-20 22:51:07', '', 18, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_2_9_29.jpg', 0, 'attachment', 'image/jpeg', 0),
(18, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A highly absorbent, multi-layered one-piece dressing. Five layer construction  permits passage of wound drainage to keep periwound skin dry and prevent maceration at the wound site.  Drainage is wicked horizontally along the pad to icrease dressing absorption capacity. Conforms to hard-to-dress areas without unnecessary bulk. Ideal for protecting wound sites from further trauma. Soft pliability allows for range of motion exercises during recovery.</p>', 'Sofsorb Absorbent Wound Dressing', '<p>A highly absorbent, multi-layered one-piece dressing. Five layer construction  permits passage of wound drainage to keep periwound skin dry and prevent maceration at wound site.</p>', 'publish', 'open', 'open', '', 'sofsorb-absorbent-wound-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=sofsorb-absorbent-wound-dressing', 0, 'product', '', 0),
(19, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Sorbion Sachet S -30', '', 'inherit', 'open', 'open', '', 'sorbion-sachet-s-30', '', '', '2014-12-20 22:51:07', '2014-12-20 22:51:07', '', 20, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_0_30.jpg', 0, 'attachment', 'image/jpeg', 0) ;
INSERT INTO `admedonline_posts` ( `ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(20, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>The unique Hydration Response Technology of Sorbion Sachet S combines physically modified cellulose fibers with gel-forming components. The close interaction of both features in Sorbion Sachet S guarantees effective preparation for the wound bed and regulation of the wound conditions. This is what makes Sorbion Sachet S so effective at accelerating healing. Sorbion Sachet S is particularly suitable as a primary dressing for moderately to heavily exudating wounds and is especially useful in combination with the Carolon Multi-layer Stocking System and other compression modalities for management of exudate caused by venous insufficiency. The strong osmotic effect of Sorbion Sachet S guarantees rapid absorption of wound exudate with tremendous absorption capacity without drying out the wound. Microorganisms and cell debris are flushed from the depths of the wound and captured in Sorbion Sachet S. Sorbion Sachet S is very effective for moderately to heavily exudating wounds.</p> <p><span style="font-size: 12px; line-height: 1.5em;">A secondary dressing is required to hold this dressing in place.</span></p>', 'Sorbion Sachet S', '<p>Very effective for moderate to very heavily draining wounds.</p>', 'publish', 'open', 'open', '', 'sorbion-sachet-s', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=sorbion-sachet-s', 0, 'product', '', 0),
(21, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'XTRASORB Classic-31', '', 'inherit', 'open', 'open', '', 'xtrasorb-classic-31', '', '', '2014-12-20 22:51:07', '2014-12-20 22:51:07', '', 22, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_1_31.jpg', 0, 'attachment', 'image/jpeg', 0),
(22, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>XTRASORB is a novel super-absorbent wound dressing. At its core is a super-absorbent polymer that allows the dressing to help re-define the category of highly absorbent. Many other absorbent dressings rely on spaces within the dressings to fill with fluid: XTRASORB\'s super-absorbent polymer binds to fluid and converts to a gel.</p> <p>Distinct advantages XTRASORB offers over traditional dressings: XTRASORB dressings are able to hold AND LOCK more fluid inside the dressing, helping to decrease the risk of maceration. The dressings come in a variety of sizes and can be used on an assortment of chronic and acute wounds including Pressure Ulcers, Diabetic Foot Ulcers, Fistulas,Venous Leg Ulcers, Post-Operative Wounds, Oncologic Wounds, Arterial Ulcers, Laparotomy Wounds</p> <p>May be used as a primary or secondary dressing.</p>', 'XTRASORB Classic', '<p>XTRASORB is a novel super-absorbent wound dressing for very heavily draining wounds. At its core is a super-absorbent polymer that allows the dressing to help re-define the category of highly absorbent.</p>', 'publish', 'open', 'open', '', 'xtrasorb-classic', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=xtrasorb-classic', 0, 'product', '', 0),
(23, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ALGICELL Ag-32', '', 'inherit', 'open', 'open', '', 'algicell-ag-32', '', '', '2014-12-20 22:51:07', '2014-12-20 22:51:07', '', 24, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_2_32.jpg', 0, 'attachment', 'image/jpeg', 0),
(24, 1, '2013-04-10 17:42:24', '0000-00-00 00:00:00', '<p>Algicell Ag is a high-gelling alginate with superior absorption capacity reducing the risk of maceration. Algicell Ag is removable in one piece, leaves no residue in the open wound amd provides superior bactericidal action that goes to work almost immediately</p> <p>Algicell Ag provides an effective barrier to bacterial penetration <span style="font-size: 12px; line-height: 1.5em;">and protects wound dressings against bacterial colonization. Reduces the risk of infection in moderately to heavily exuding wounds including diabetic foot ulcers, leg ulcers, pressure ulcers, donor sites and traumatic or surgical wounds.</span></p> <p><strong><span style="font-size: 12px; line-height: 1.5em;">Should be used only for wounds that have moderate to heavy drainage.</span></strong></p> <p><span style="font-size: 12px; line-height: 1.5em;">Secondary dressings required to hold in place</span></p>', 'ALGICELL Ag', '<p>Algicell Ag is a high-gelling alginate with superior absorption capacity reducing the risk of maceration. Algicell Ag is removable in one piece and leaves no residue in the open wound.</p>', 'draft', 'open', 'open', '', 'algicell-ag', '', '', '2013-04-10 17:42:24', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?post_type=product&p=24', 0, 'product', '', 0),
(25, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Algidex Ag Packing Gauze-161', '', 'inherit', 'open', 'open', '', 'algidex-ag-packing-gauze-161', '', '', '2014-12-20 22:51:07', '2014-12-20 22:51:07', '', 27, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_6_1_161.jpg', 0, 'attachment', 'image/jpeg', 0),
(26, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Algidex Ag Packing Gauze-33', '', 'inherit', 'open', 'open', '', 'algidex-ag-packing-gauze-33', '', '', '2014-12-20 22:51:07', '2014-12-20 22:51:07', '', 27, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_3_33.jpg', 0, 'attachment', 'image/jpeg', 0),
(27, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Reduces bacterial colonization, absorbs wound exudate and decreases wound odor. Specially woven gauze will not ravel or lint or fray. Provided in 5 yd. strips. Can be cut to desired length. Releases active ionic silver for broad antimicrobial effectiveness. Convenient reclosable bottle.</p> <p>Must be covered with a secondary dressing to hold in place.</p>', 'Algidex Ag Packing Gauze', '<p>Reduces bacterial colonization, absorbs wound exudate, decreases wound odor. Specially woven gauze will not ravel or lint or fray. Provided in 5 yd. strips and can be cut to desired length.</p>', 'publish', 'open', 'open', '', 'algidex-ag-packing-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=algidex-ag-packing-gauze', 0, 'product', '', 0),
(28, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'AQUACEL Ag Hydrofiber-163', '', 'inherit', 'open', 'open', '', 'aquacel-ag-hydrofiber-163', '', '', '2014-12-20 22:51:08', '2014-12-20 22:51:08', '', 30, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_6_3_163.jpg', 0, 'attachment', 'image/jpeg', 0),
(29, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'AQUACEL Ag Hydrofiber-151', '', 'inherit', 'open', 'open', '', 'aquacel-ag-hydrofiber-151', '', '', '2014-12-20 22:51:08', '2014-12-20 22:51:08', '', 30, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_5_1_151.jpg', 0, 'attachment', 'image/jpeg', 0),
(30, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>AQUACEL Ag Hydrofiber Wound Dressing with lonic Silver does more than just provide antimicrobial activity. AQUACEL Ag Hydrofiber Wound Dressing with lonic Silver is indicated for  <strong>moderate to highly  exudating wounds</strong> which are infected or at risk of infection.</p>', 'AQUACEL Ag Hydrofiber', '<p>AQUACEL Ag Hydrofiber Wound Dressing with lonic Silver is indicated for <strong>moderate to highly- exudating</strong> <strong>wounds</strong> which are infected or at risk of infection. </p>', 'publish', 'open', 'open', '', 'aquacel-ag-hydrofiber', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=aquacel-ag-hydrofiber', 0, 'product', '', 0),
(31, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed AG-CMC-35', '', 'inherit', 'open', 'open', '', 'reliamed-ag-cmc-35', '', '', '2014-12-20 22:51:08', '2014-12-20 22:51:08', '', 32, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_5_35.jpg', 0, 'attachment', 'image/jpeg', 0),
(32, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p><span style="font-size: 12px; line-height: 1.5em;">Controlled silver ion release provides a broad spectrum of antimicrobial protection for up to three days. Effective in controlling wound bleeding. Absorbency and wet strength are key performance indicators. Blend of calcium alginate and carboxymethyl cellulose (CMC) provides excellent gelling and wet strength for one-piece and non-traumatic removal. Highly absorbent fluid wicks vertically into the dressing which minimizes the possibility of periwound skin maceration and reduces odor primarily caused by bacteria. Can be used for postoperative wounds, trauma wounds,leg ulcers, pressure ulcers,diabetic ulcers,graft and donor sites. Contraindicated for use on third-degree burns, dry or lightly exuding wounds and forindividuals with a known sensitivity to silver and/or calcium alginate.</span></p> <p><span style="font-size: 12px; line-height: 1.5em;"><strong>Should only be used for wounds that have moderate to high amounts of drainage.</strong></span></p> <p><span style="font-size: 12px; line-height: 1.5em;">www.reliamedproducts.com</span></p> <p><span style="font-size: 12px; line-height: 1.5em;">Requires a secondary dressing</span></p>', 'ReliaMed AG-CMC', '<p>Controlled silver ion release provides a broad spectrum of antimicrobial protection for up to three days. Effective in controlling wound bleeding. Excellent absorbency and wet strength. </p>\r\n<p><strong>Should only be used for wounds that have moderate to high amounts of drainage.</strong></p>', 'publish', 'open', 'open', '', 'reliamed-ag-cmc', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-ag-cmc', 0, 'product', '', 0),
(33, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Silverlon CA-36', '', 'inherit', 'open', 'open', '', 'silverlon-ca-36', '', '', '2014-12-20 22:51:08', '2014-12-20 22:51:08', '', 34, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_6_36.jpg', 0, 'attachment', 'image/jpeg', 0),
(34, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Advanced antimicrobial calcium alginate dressing is a sterile and non-woven pad composed of a High M (manuronic acid) alginate and a silver nylon contact layer. The silver ions provide an antimicrobial barrier which protects the dressing from bacterial contamination including MRSA Bacteria. The dressing absorbs exudates, maintains a moist wound environment and allows for intact removal.</p> <p><strong>Should only be used for wounds having moderate to heavy drainage.</strong></p> <p>www.silverlon.com</p> <p>Secondary dressing required to hold n place.</p>', 'Silverlon CA', '<p>Advanced Antimicrobial Calcium Alginate Dressing is a sterile and non-woven pad composed of a High M (manuronic acid) alginate and a silver nylon contact layer. The silver ions provide an antimicrobial barrier.</p>\r\n<p><strong>Should only be used for wounds having moderate to heavy drainage.</strong></p>', 'publish', 'open', 'open', '', 'silverlon-ca', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=silverlon-ca', 0, 'product', '', 0),
(35, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'MEDIHONEY Alginate-37', '', 'inherit', 'open', 'open', '', 'medihoney-alginate-37', '', '', '2014-12-20 22:51:09', '2014-12-20 22:51:09', '', 36, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_7_37.jpg', 0, 'attachment', 'image/jpeg', 0),
(36, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>MEDIHONEY dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY dressings are able to work in the presence of wound fluid or blood or tissue and promotes an optimal healing environment. As wound exudate is absorbed, the alginate forms a gel enabling easy removal without disrupting the wound bed. Medihoney dressings are indicated for the management of moderate to heavily exuding wounds such as diabetic foot ulcers,venous stasis leg ulcers, arterial leg ulcers, ulcers of mixed etiology, pressure ulcers (I-IV), 1st and 2nd degree burns, donor sites,traumatic and surgical wounds</p> <p><strong>Should only be used for wounds with moderate to heavy drainage.</strong> www.dermasciences.com</p> <p>Secondary dressing required to hold in place.</p>', 'MEDIHONEY Alginate', '<p>MEDIHONEY dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns.</p>\r\n<p><strong>Should only be used for wounds with moderate to heavy drainage.</strong></p>', 'publish', 'open', 'open', '', 'medihoney-alginate', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=medihoney-alginate', 0, 'product', '', 0),
(37, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Algicell-38', '', 'inherit', 'open', 'open', '', 'algicell-38', '', '', '2014-12-20 22:51:09', '2014-12-20 22:51:09', '', 38, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_8_38.jpg', 0, 'attachment', 'image/jpeg', 0),
(38, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Algicell alginate are sterile dressings used to absorb moderate to large amounts of wound drainage and may help control minor bleeding. Algicell alginate rope dressings can be used to fill or pack the dead space in a wound. This product is designed to keep its form to allow for easy and trauma-free removal while still maintaining a moist wound environment. Algicell dressings are conducive to wound healing through its ability to gel upon contact with wound fluids.</p> <p><strong>Should be used only with wounds having moderate to heavy drainage.</strong></p> <p>www.dermasciences.com</p> <p>Secondary dressings required to hold in place.</p>', 'Algicell', '<p>Algicell alginate dressings are soft, white, sterile dressings used to absorb moderate to large amounts of wound drainage and may help control minor bleeding. Algicell alginate rope dressings can be used to fill or pack the dead space in a wound.</p>\r\n<p><strong>Should be used only with wounds having moderate to heavy drainage.</strong></p>', 'publish', 'open', 'open', '', 'algicell', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=algicell', 0, 'product', '', 0),
(39, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'AQUACEL Hydrofiber-39', '', 'inherit', 'open', 'open', '', 'aquacel-hydrofiber-39', '', '', '2014-12-20 22:51:09', '2014-12-20 22:51:09', '', 40, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_3_9_39.jpg', 0, 'attachment', 'image/jpeg', 0),
(40, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>AQUACEL Dressing offers the unique gelling action of Hydrofiber Technology that absorbs and locks in exudate and bacteria. Hydrofiber Technology drives the outstanding capabilities of AQUACEL Dressing.</p> <p>Secondary dressing required to hold in place.</p>', 'AQUACEL Hydrofiber', '<p>AQUACEL Dressing offers the unique gelling action of Hydrofiber Technology that absorbs and locks in exudate and bacteria. Hydrofiber Technology drives the outstanding capabilities of AQUACEL Dressing.</p>', 'publish', 'open', 'open', '', 'aquacel-hydrofiber', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=aquacel-hydrofiber', 0, 'product', '', 0),
(41, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Kalginate Calcium Alginate Wound Dressing-40', '', 'inherit', 'open', 'open', '', 'kalginate-calcium-alginate-wound-dressing-40', '', '', '2014-12-20 22:51:09', '2014-12-20 22:51:09', '', 42, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_0_40.jpg', 0, 'attachment', 'image/jpeg', 0),
(42, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Sterile, non-woven calcium alginate dressing of heavier that absorbs twice the exudate of other calcium alginate dressings. Thick and effective. Changes to a fibrous gel when in contact with wound exudate. Available as pad or rope. Primary dressing.</p> <p><strong>Should only be used with wounds that have moderate to heavy drainage.</strong></p>', 'Kalginate Calcium Alginate Wound Dressing', '<p>Sterile, non-woven calcium alginate dressing that absorbs twice the exudate of other calcium alginate dressings. Thick and effective. Changes to a fibrous gel when in contact with wound exudate.</p>\r\n<p><strong>Should only be used with wounds that have moderate to heavy drainage.</strong></p>', 'publish', 'open', 'open', '', 'kalginate-calcium-alginate-wound-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=kalginate-calcium-alginate-wound-dressing', 0, 'product', '', 0),
(43, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed CA-CMC-41', '', 'inherit', 'open', 'open', '', 'reliamed-ca-cmc-41', '', '', '2014-12-20 22:51:09', '2014-12-20 22:51:09', '', 44, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_1_41.jpg', 0, 'attachment', 'image/jpeg', 0),
(44, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Soft, comfortable, highly highly absorbent dressing for exudating wounds.. Fluid wicks vertically into the dressing which minimizes the possibility of periwound skin maceration. Longer wearing times allow patients to resume their normal activities. Reliamed CA-CMC is a blend of calcium alginate and carboxymethyl cellulose (CMC) which provides excellent gelling and wet strength for one-piece and non-traumatic removal. Reliamed CA-CMC is latex-free.</p> <p><strong>Shoiuld only be used for wounds that have moderate to heavy drainage.</strong></p> <p>www.reliamedproducts.com</p> <p>Secondary dressing necessary to keep in place.</p> <p>Secondary dressing required to hold in place.</p>', 'ReliaMed CA-CMC', '<p>Soft, conrformable, highly absorbent dressing for exudating wounds. Fluid wicks vertically into the dressing which minimizes the possibility of periwound skin maceration. Latrex-free. <strong>Shoiuld only be used for wounds that have moderate to heavy drainage.</strong></p>', 'publish', 'open', 'open', '', 'reliamed-ca-cmc', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-ca-cmc', 0, 'product', '', 0),
(45, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'SkinSafe-154', '', 'inherit', 'open', 'open', '', 'skinsafe-154', '', '', '2014-12-20 22:51:09', '2014-12-20 22:51:09', '', 46, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_5_4_154.jpg', 0, 'attachment', 'image/jpeg', 0),
(46, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>SkinSafe Calcium Alginate Dressings absorb<strong> moderate to heavy amounts of wound exudate</strong> and create and maintain a warm and moist wound environment. Made from needled High M fibers. Skinsafe Calcium Alginate Dressings are fast gelling and soft and comfortable. They have high wet and dry tensile strength and are easy to remove. Sorry no image available.</p> <p><strong>Should only be used for wounds having moderate to heavy exudate.</strong></p>', 'SkinSafe', '<p>SkinSafe Calcium Alginate Dressings absorb <strong>moderate to heavy amounts of wound exudate</strong> and create and maintain a warm and moist wound environment. Skinsafe Calcium Alginate Dressings are fast gelling and soft and comfortable.</p>\r\n<p><strong>Should only be used for wounds having moderate to heavy exudate.</strong></p>', 'publish', 'open', 'open', '', 'skinsafe', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=skinsafe', 0, 'product', '', 0),
(47, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Tegaderm Alginate Dressing-42', '', 'inherit', 'open', 'open', '', 'tegaderm-alginate-dressing-42', '', '', '2014-12-20 22:51:09', '2014-12-20 22:51:09', '', 48, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_2_42.jpg', 0, 'attachment', 'image/jpeg', 0),
(48, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Tegaderm Alginate Dressings are sterile, highly conformable and absorbent primary wound dressings <strong>for use on moderately to heavily exudating wounds.</strong> <span style="font-size: 12px; line-height: 1.5em;">3M Tegaderm alginate dressings have a gel-like consistency as they absorb exudate which provides a moist wound healing environment with easy removal. 3M Tegaderm Alginate dressings are ideally suited for the management of moderately to heavily exudating partial and full thickness wounds.</span></p> <p><span style="font-size: 12px; line-height: 1.5em;">Secondary dressing required to hold in place. </span></p>', 'Tegaderm Alginate Dressing', '<p>Tegaderm Alginate Dressings are sterile, highly conformable and absorbent primary wound dressings <strong>for use on moderately to heavily exudating wounds</strong>. Gel-like consistency provides a moist healing environment with easy removal.</p>', 'publish', 'open', 'open', '', 'tegaderm-alginate-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=tegaderm-alginate-dressing', 0, 'product', '', 0),
(49, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Anasept Antimicrobial Skin and Wound Cleanser-43', '', 'inherit', 'open', 'open', '', 'anasept-antimicrobial-skin-and-wound-cleanser-43', '', '', '2014-12-20 22:51:10', '2014-12-20 22:51:10', '', 50, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_3_43.jpg', 0, 'attachment', 'image/jpeg', 0),
(50, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>BEST PRICE and FREE SHIP!  </p> <p>Anasept® Antimicrobial Cleanser is an extremely safe and gentle wound cleanser that eliminates all bacteria, fungi and viruses including MRSA, VRE, C Difficile, Acinetobacter and more in 30-60 seconds without harm to healthy tissue.  It should be used when there is any break in the skin,  skin irritation or a chronic wound. It is also used for preparation for dialysis and central line, IV fluid and infusion sites. Anasept Antimircrobial Skin and Wound Cleanser is a colorless isotonic-tissue compatible solution.  Anasept  is stable for two-years and is free of necrotizing chemicals found in other antiseptic products. Anasept Spray will not stain the skin.</p> <p><strong>FDA approved as an antimicrobial solution.</strong>  </p> <p>Learn more about this product at <span style="text-decoration: underline;">www.anacapa-tech.net</span></p>', 'Anasept Antimicrobial Skin and Wound Cleanser', '<p>Anasept® Antimicrobial Cleanser is an extremely safe, gentle wound cleanser that eliminates all bacteria, fungus and viruses including MRSA and VRE and more in 30-60 seconds without harm to healthy tissue. Use to clean wounds of any kind.</p>', 'publish', 'open', 'open', '', 'anasept-antimicrobial-skin-and-wound-cleanser', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=anasept-antimicrobial-skin-and-wound-cleanser', 0, 'product', '', 0),
(51, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Medi-Soothe Therapy Lotion-44', '', 'inherit', 'open', 'open', '', 'medi-soothe-therapy-lotion-44', '', '', '2014-12-20 22:51:10', '2014-12-20 22:51:10', '', 52, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_4_44.jpg', 0, 'attachment', 'image/jpeg', 0),
(52, 1, '2013-04-10 17:42:24', '0000-00-00 00:00:00', '<p>Medi-Soothe is Indicated for the management of radiation burns (radiation-induced dermatitis) , thermal burns, 1st &amp; 2nd degree burns, sunburn, and rashes. Replenishes lost moisture to the skin and encourages production of collagen. </p> <p><span style="font-size: 12px; line-height: 1.5em;">Medi-Soothe is a moisturizing lotion that contains 80% "diamond pure" Aloe Vera as well as Vitamins E, B-5 and Allantoin. It is alcohol free and non-greasy. The non-prescription formula does not contain any waxes or metals.</span></p> <p><strong style="font-size: 12px; line-height: 1.5em;">Medi-Soothe</strong><span style="font-size: 12px; line-height: 1.5em;">™ lotion provides an effective barrier to heat buildup, replenishes lost moisture, encourages production of collagen fibration, speeds cell regeneration and overall promotes healing.</span></p> <p><span style="font-size: 12px; line-height: 1.5em;">www.medi-techintl.com</span></p>', 'Medi-Soothe Therapy Lotion', '<p>Medi-Soothe is Indicated for the management of radiation burns (radiation-induced dermatitis), thermal burns, 1st &amp; 2nd degree burns,sunburn, and rashes. Replenishes lost moisture to the skin and encourages production of collagen. </p>', 'draft', 'open', 'open', '', 'medi-soothe-therapy-lotion', '', '', '2013-04-10 17:42:24', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?post_type=product&p=52', 0, 'product', '', 0),
(53, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>a 100% pure native type I collagen wound dressing for topical use.  Assists in the closure of skin ulcers or lesions and controls minor bleeding. <span style="font-size: 12px; line-height: 1.5em;">BIOPAD is a sponge shaped device that is constituted exclusively by lyophilized type I native heterologous equine collagen which transforms in a soft gel allowing contact with the entire wound bed. When applied to a wound BIOPAD constitutes a barrier for wound management against exogenous infective agents. </span></p> <p><span style="font-size: 12px; line-height: 1.5em;">Requires a secondary dressing to hold in place.</span></p>', 'BIOPAD Collagen Dressing', '<p>A 100% pure native type I collagen wound dressing  for topical use.  Assists in the closure of skin ulcers or lesions and controls minor bleeding..</p>', 'publish', 'open', 'open', '', 'biopad-collagen-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=biopad-collagen-dressing', 0, 'product', '', 0),
(54, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Fibracol Plus-158', '', 'inherit', 'open', 'open', '', 'fibracol-plus-158', '', '', '2014-12-20 22:51:26', '2014-12-20 22:51:26', '', 55, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_5_8_158.jpg', 0, 'attachment', 'image/jpeg', 0),
(55, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p> FIBRACOL PLUS Dressing combines the structural support of collagen with the exudate management of alginate. FIBRACOL PLUS Dressing is made up of 90% collagen and 10% alginate. This combination provides the versatility you need when addressing a variety of wound types and a wide range of exudate levels (from low to high). FIBRACOL PLUS maintains a moist wound environment which is conducive to granulation tissue formation and epithelialization that enables healing to proceed optimally. Indicated for the management of exuding wounds including: Full-thickness and partial-thickness wounds, Pressure ulcers, Venous ulcers,  Ulcers caused by mixed vascular etiologies, Diabetic ulcers, Second-degree burns,  Donor sites and other bleeding surface wounds, Abrasions, Traumatic wounds, Dehisced surgical incisions</p> <p>Requires a secondary dressing to hold in place.</p>', 'Fibracol Plus', '<p>FIBRACOL PLUS Dressing combines the structural support of collagen with the exudate management of alginate. FIBRACOL PLUS provides the versatility you need when addressing a variety of wound types and exudate levels.</p>', 'publish', 'open', 'open', '', 'fibracol-plus', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=fibracol-plus', 0, 'product', '', 0),
(56, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Promogran Matrix-47', '', 'inherit', 'open', 'open', '', 'promogran-matrix-47', '', '', '2014-12-20 22:51:26', '2014-12-20 22:51:26', '', 57, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_7_47.jpg', 0, 'attachment', 'image/jpeg', 0),
(57, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>PROMOGRAN Matrix collagen dressing promotes granulation tissue formulation, epithelialization and optimal wound healing.  May be used under compression therapy with healthcare professional supervision. PROMOGRAN Matrix is intended for the management of wounds including <span style="font-size: 12px; line-height: 1.5em;">diabetic ulcers, Venous ulcers, Pressure ulcers, Ulcers caused by mixed vascular etiologies, Full-thickness &amp; partial-thickness wounds, Donor sites and other bleeding surface wounds, Abrasions,Traumatic wounds healing by secondary intention, Dehisced surgical wounds</span></p> <p>Requires a secondary dressing to hold in place.</p>', 'Promogran Matrix', '<p>PROMOGRAN Matrix collagen dressing promotes granulation tissue formulation, epithelialization and optimal wound healing. </p>', 'publish', 'open', 'open', '', 'promogran-matrix', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=promogran-matrix', 0, 'product', '', 0),
(58, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Promogran Prisma-48', '', 'inherit', 'open', 'open', '', 'promogran-prisma-48', '', '', '2014-12-20 22:51:26', '2014-12-20 22:51:26', '', 59, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_8_48.jpg', 0, 'attachment', 'image/jpeg', 0),
(59, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Promogran Prisma is a collagen sheet combinedwith silver to control bacteria in the wound site .  Promotes healthy tissue growth, epithelialization and optimal wound healing while reducing bacterial growth. Promogran PRISMA Matrix collagen sheet is intended for the management of exuding wounds. Under the supervision of a healthcare professional PRISMA Matrix collagen sheet may be used for the management of:Diabetic ulcers, Venous ulcers, Pressure Ulcers, Ulcers caused by mixed vascular etiologies, Full-thickness and partial-thickness wounds, Donor sites and other bleeding surface wounds, Abrasions, Traumatic wounds healing by secondary intention, Dehisced surgical wounds.  PRISMA Matrix collagen may be used under compression therapy with healthcare professional supervision.</p> <p>Requires a secondary dressing to hold in place.</p>', 'Promogran Prisma', '<p>Promogran Prisma is a collagen sheet combined with silver to control bacteria in the wound site. Promotes healthy tissue growth, epithelialization and optimal wound healing while reducing bacterial growth.</p>', 'publish', 'open', 'open', '', 'promogran-prisma', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=promogran-prisma', 0, 'product', '', 0),
(60, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Stimulen-49', '', 'inherit', 'open', 'open', '', 'stimulen-49', '', '', '2014-12-20 22:51:26', '2014-12-20 22:51:26', '', 61, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_4_9_49.jpg', 0, 'attachment', 'image/jpeg', 0),
(61, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Modified collagen particles provide a moist environment for rapid healing.  The powder will dissolve in the wound fluid to give a protective gel for supporting the growth of granulation tissue and skin. Sprinkle it on the wound to give it a covering up to about 1/8" thick.</p> <p>Secondary dressing required.</p>', 'Stimulen', '<p>Modified collagen particles provide a moist environment for rapid healing.  The powder will dissolve in the wound fluid to give a protective gel for supporting the growth of granulation tissue and skin.</p>', 'publish', 'open', 'open', '', 'stimulen', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=stimulen', 0, 'product', '', 0),
(62, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Alldress Composite Dressing-50', '', 'inherit', 'open', 'open', '', 'alldress-composite-dressing-50', '', '', '2014-12-20 22:51:26', '2014-12-20 22:51:26', '', 63, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_0_50.jpg', 0, 'attachment', 'image/jpeg', 0),
(63, 1, '2013-04-10 17:42:24', '0000-00-00 00:00:00', '<p>Alldress composite dressing is an all-in-one self-adherent absorbent dressing ideal for a wide variety of low to moderately exuding wounds as either primary or secondary dressing. The Alldress backing film provides a moist wound environment and protects the wound from water and contamination. Benefits of Alldress: Alldress has an easy-to-remove protection paper for convenient and aseptic application. Alldress has a breathable film that provides a moist wound environment along with a viiral and bacteria-proof backing film for safety and protection. Alldress features a liquid-proof barrier for protection from strike-through of wound fluids and outside contamination and a low-adherent wound contact netting that minimizes disturbance to the wound. Alldress composite dressing has a skin-friendly polyacrylate adhesive for gentle and secure fixation. The Alldress highly absorbent wound pad provides excellent exudate management.</p>', 'Alldress Composite Dressing', '<p>Alldress composite dressing is an all-in-one self-adherent absorbent dressing ideal for a wide variety of low to moderately exuding wounds as either primary or secondary dressing.  The Alldress backing film provides a moist wound environment and protects the wound from water and contamination.</p>', 'draft', 'open', 'open', '', 'alldress-composite-dressing', '', '', '2013-04-10 17:42:24', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?post_type=product&p=63', 0, 'product', '', 0),
(64, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepore Pro-51', '', 'inherit', 'open', 'open', '', 'mepore-pro-51', '', '', '2014-12-20 22:51:26', '2014-12-20 22:51:26', '', 65, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_1_51.jpg', 0, 'attachment', 'image/jpeg', 0),
(65, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>The Mepore Pro surgcal dressing is a waterproof bacteria-proof absorbent breathable dressing with a skin-friendly water-based adhesive. The backing film allows showering and protects the wound from water and contamination. Benefits of Mepore Pro: Mepore Pro has an absorbent wound pad with a low adherent wound contact layer for better patient comfort and longer wear time. Easy-to-remove protection paper for ease of use. Gentle and secure fixation on a wound site is accomplished with the skin-friendly and waterbased and solvent-free adhesive. Product is soft elastic and nonwoven for better patient comfort. Viral and bacteria-proof backing film protects the wound from outer contamination. Mepore Pro wound pad has a breathable and showerproof film for better patient comfort and longer wear time.</p>', 'Mepore Pro', '<p>The Mepore Pro dressing is a waterproof and bacteria-proof absorbent breathable dressing with a skin-friendly water-based adhesive. The backing film allows showering and protects the wound from water and contamination.</p>', 'publish', 'open', 'open', '', 'mepore-pro', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepore-pro', 0, 'product', '', 0),
(66, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Non-Adherent Composite Barrier Dressing-52', '', 'inherit', 'open', 'open', '', 'non-adherent-composite-barrier-dressing-52', '', '', '2014-12-20 22:51:27', '2014-12-20 22:51:27', '', 67, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_2_52.jpg', 0, 'attachment', 'image/jpeg', 0),
(67, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Sterile individually sealed 100% cotton nonadherent island pad absorbs exudate for a cleaner wound bed. Nonwoven adhesive cover has rounded edges to prevent detachment. <strong>Waterproof</strong> top film layer prevents fluid from passing through the dressing but is breathable to allow for moisture vapor transmission. Wide adhesive border ensures excellent adhesion. Latex- free.</p> <p>Can be used as a primary or secondary dressing.</p>', 'Non-Adherent Composite Barrier Dressing', '<p>Sterile individually sealed 100% cotton nonadherent island pad absorbs exudate for a cleaner wound bed. <strong>Waterproof</strong> top film later with rounded edges to prevent detachment with wide adhesive border.</p>', 'publish', 'open', 'open', '', 'reliamed-composite-barrier-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-composite-barrier-dressing', 0, 'product', '', 0),
(68, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', '3M Coban 2 Layer Compression System-53', '', 'inherit', 'open', 'open', '', '3m-coban-2-layer-compression-system-53', '', '', '2014-12-20 22:51:27', '2014-12-20 22:51:27', '', 69, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_3_53.jpg', 0, 'attachment', 'image/jpeg', 0),
(69, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Coban 2 Layer is a unique compression system that is engineered with Intelligent Compression Dynamics to stay in place and deliver comfortable/effective and therapeutic compression for venous leg ulcers and other conditions requiring compression. 3M Coban 2 Layer Compression System is clinically proven to significantly reduce slippage and improve patients\' daily living activities and physical symptoms. Latex-free Coban 2 Layer System consists of an inner comfort layer and an outer compression layer that is fast and easy to apply. Because it is thin and lightweight Coban 2 Layer allows patients to wear normal footwear. The 3M Coban 2 Layer Compression System is latex-free and is ideal for the majority of patients with venous leg ulcers and lymphedema and other conditions where compression therapy is appropriate including those with an ABPI greater than or equal to 0.8.</p> <p>FOR PROFESSIONAL USE ONLY.</p>', '3M Coban 2 Layer Compression System', '<p>Coban 2 Layer is a unique compression system that is engineered with Intelligent Compression Dynamics to stay in place and deliver comfortable/effective and therapeutic compression for venous leg ulcers and other conditions requiring compression. FOR PROFESSIONAL USE ONLY.</p>', 'publish', 'open', 'open', '', '3m-coban-2-layer-compression-system', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=3m-coban-2-layer-compression-system', 0, 'product', '', 0),
(70, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', '3M Coban 2 Layer Lite Compression System-54', '', 'inherit', 'open', 'open', '', '3m-coban-2-layer-lite-compression-system-54', '', '', '2014-12-20 22:51:27', '2014-12-20 22:51:27', '', 71, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_4_54.jpg', 0, 'attachment', 'image/jpeg', 0),
(71, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>3M Coban 2 Layer Lite is engineered with Intelligent Compression Dynamics to stay in place on the leg and deliver comfortable, effective and therapeutic compression for venous leg ulcers and other conditions. The Coban 2 Layer Lite Compression System is designed for patients whose physical condition makes them less tolerant of traditional compression therapy. 3M Coban 2 Layer Compression System is clinically proven to significantly reduce slippage and improve patients\' daily living activities and physical symptoms. The latex-free Coban 2 Layer System consists of an inner comfort layer and an outer compression layer that is fast and easy to apply. Because it is thin and lightweight it allows patients to wear normal footwear. 3M Coban 2 Layer Lite Compression System is specifically designed for patients less tolerant of compression therapy. This includies those who have mixed etiology with an APBI greater than or equal to 0.5. Also those who are new to compression where tolerance is not known or who are frail or less mobile. Coban 2 Layer Lite System provides the same effective compression as Coban 2 Layer Compression system with a 25% reduced resting pressure.</p> <p>FOR PROFESSIONAL USE ONLY.</p>', '3M Coban 2 Layer Lite Compression System', '<p>3M Coban 2 Layer Lite is engineered for patients who are less tolerant of traditional compression therapy.  It is made to stay in place on the leg and deliver comfortable, effective and therapeutic compression.  FOR PROFESSIONAL USE ONLY.</p>', 'publish', 'open', 'open', '', '3m-coban-2-layer-lite-compression-system', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=3m-coban-2-layer-lite-compression-system', 0, 'product', '', 0),
(72, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Carolon Multilayer Compression System-55', '', 'inherit', 'open', 'open', '', 'carolon-multilayer-compression-system-55', '', '', '2014-12-20 22:51:27', '2014-12-20 22:51:27', '', 73, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_5_55.jpg', 0, 'attachment', 'image/jpeg', 0),
(73, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p><strong>FREE SHIPPING  and Best Price!</strong></p> <p><strong>Carolon MLS </strong>is a unique compression product for the treatment of venous insufficiency and to prevent or heal ulcers caused by this condition. The Carolon Multilayer Compression System is designed to fit over a wound care dressing if the patient has an open wound associated with venous insufficiency.</p> <p>Class II (30-40 mmHg) - Includes <strong>TWO</strong> underlayers and <strong>TWO</strong> stockings/socks per box.</p> <p>Class III (40-50 mmHg) - includes <strong>TWO</strong> underlayers and <strong>TWO</strong> stockings/socks per box.</p> <p>The Carolon Multilayer <span style="line-height: 1.5em;">Multilayer Compression System provides therapeutic support, improved circulation and prevention of varicosities and chronic insufficiencies. Because the product is applied in two layers, it is easier to don than other compression stockings having therapeutic compression levels. T</span><span style="line-height: 1.5em;">he Carolon Multilayer Compression System is also recommended for endovenous ablation and phlebectomy procedures.</span></p> <p>The Carolon Multilayer Compression System is available in knee length. :: Choice of colors: nude stocking or black dress sock :: Washable/dryable-safe in a mesh bag for delicates:: Latex-free</p> <p> </p> <p><strong>PLEASE USE THE SIZE CHART BELOW TO DETERMINE CORRECT SIZE</strong>: Stockings that do not fit correctly will not provide adequate therapeutic results.</p> <p style="text-align: left;"><strong style="line-height: 1.5em;">1) Use measuring tape to determine smallest ankle circumference and largest calf circumference.</strong></p> <p style="text-align: left;"><strong>2) Determine correct  length by measuring from heel to bend in knee.</strong></p> <table style="border: 1px solid #666666 !important; float: left;" border="1" cellspacing="20"> <tbody> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important;"><span style="background-color: #ffffff; font-size: 12pt;"><strong>Ankle Circumference</strong></span></td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important;"><span style="background-color: #ffffff; font-size: 12pt;"><strong>Calf Circumference</strong></span></td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"><span style="background-color: #ffffff; font-size: 12pt;"><strong><br /></strong></span></p> <p style="text-align: center;"><span style="background-color: #ffffff; font-size: 12pt;"><strong>Length</strong></span></p> <p style="text-align: left;"><span style="font-size: 12pt;"> </span></p> </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"><span style="background-color: #ffffff; font-size: 12pt;"><strong>Size</strong></span></td> </tr> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">7" - 8"</td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">10" - 13" </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"> Over 15" -  Regular</p> <p style="text-align: center;"> Under 15" -  Short</p> </td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;"><strong>A</strong></td> </tr> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">8" - 9"</td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">12" - 15" </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"> Over 16" -  Regular</p> <p style="text-align: center;">Under 16 "-  Short</p> </td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;"><strong>B</strong></td> </tr> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">9" - 10"</td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">14" - 17" </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"> Over 17" - Regular</p> <p style="text-align: center;">Under 17" -Short</p> </td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;"><strong>C</strong></td> </tr> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">10" - 11"</td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">16" - 19" </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"> Over 18" - Regular</p> <p style="text-align: center;">Under 18" - Short</p> </td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;"><strong>D</strong></td> </tr> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">11" - 12"</td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">18" - 21" </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"> Over 18" -Regular</p> <p style="text-align: center;">Under 18" -Short</p> </td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;"><strong>E</strong></td> </tr> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">12" - 13"</td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">20" - 23" </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"> Over 18" - Regular</p> <p style="text-align: center;">Under 18" - Short</p> </td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;"><strong>F</strong></td> </tr> <tr> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">13" - 14"</td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;">22" - 26" </td> <td style="border: 1px solid #666!important; padding-right: 20px!important; padding-left: 20px!important;"> <p style="text-align: center;"> Over 18" - Regular</p> <p style="text-align: center;">Under 18" - Short</p> </td> <td style="border: 1px solid #666666 !important; padding-right: 20px !important; padding-left: 20px !important; text-align: center;"><strong>G</strong></td> </tr> </tbody> </table> <p><strong><br /></strong></p>', 'Carolon Multilayer Compression System', '<p><strong>FREE SHIPPING, Best Price! </strong> Carolon"s Multi-Layer Compression System is an easy-to-apply two-layer knee-length compression stocking for the treatment of venous insufficiency and to prevent or heal ulcers. This product is designed to fit over a wound care dressing if the patient has an open wound associated with venous insufficiency.</p>', 'publish', 'open', 'open', '', 'carolon-multilayer-compression-system', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=carolon-multilayer-compression-system', 0, 'product', '', 0) ;
