(74, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'DEWRAP Three-Layer Compression System-56', '', 'inherit', 'open', 'open', '', 'dewrap-three-layer-compression-system-56', '', '', '2014-12-20 22:51:27', '2014-12-20 22:51:27', '', 75, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_6_56.jpg', 0, 'attachment', 'image/jpeg', 0),
(75, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>DEWRAP Three-Layer Compression System Delivers sustained and graduated compression for lower extremities to improve calf pump function. Contains absorptive, elastic and cohesive layers. Seven-day wear time. Layered compression wraps are indicated for the treatment of lower extremity edema and ulcerations associated with venous insufficiency. Venous malfunction results in a series of events including increased hydrostatic pressure and venous hypertension and eventually skin ulceration.</p> <p>FOR CLINICAL USE ONLY</p>', 'DEWRAP Three-Layer Compression System', '<p>DEWRAP Three-Layer Compression System delivers sustained and graduated compression for lower extremities to improve calf pump function. Contains absorptive, elastic and cohesive layers. Seven-day wear time. FOR CLINICAL USE ONLY</p>', 'publish', 'open', 'open', '', 'dewrap-three-layer-compression-system', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=dewrap-three-layer-compression-system', 0, 'product', '', 0),
(76, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'EXCILON AMD Drain Sponge-57', '', 'inherit', 'open', 'open', '', 'excilon-amd-drain-sponge-57', '', '', '2014-12-20 22:51:27', '2014-12-20 22:51:27', '', 77, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_7_57.jpg', 0, 'attachment', 'image/jpeg', 0),
(77, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Excilon AMD Antimicrobial Sponges are impregnated with PHMB (Polyhexamethylene Biguanide) which is a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA. These sponges resist bacterial colonization within the dressing.</p>', 'EXCILON AMD Drain Sponge', '<p>Excilon AMD Antimicrobial Sponges are impregnated with PHMB (Polyhexamethylene Biguanide) which is a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA.</p>', 'publish', 'open', 'open', '', 'excilon-amd-drain-sponge', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=excilon-amd-drain-sponge', 0, 'product', '', 0),
(78, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Non-Woven Gauze Sponge - Sterile-58', '', 'inherit', 'open', 'open', '', 'reliamed-non-woven-gauze-sponge-sterile-58', '', '', '2014-12-20 22:51:28', '2014-12-20 22:51:28', '', 79, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_8_58.jpg', 0, 'attachment', 'image/jpeg', 0),
(79, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Sterile Latex-free sponges made from 100% USP cotton. Ideal for wound cleansing and as secondary dressings for added absorbency. Highly absorbent rayon/polyester blend provides fast wicking properties and minimizes skin maceration. Suitable for debriding and covering and packing wounds or general use. Sterile and latex-free.</p>', 'ReliaMed Non-Woven Gauze Sponge - Sterile', '<p>Sterile Latex-free sponges made from 100% USP cotton. Ideal for wound cleansing and as secondary dressings for added absorbency. Provides fast wicking properties and minimizes skin maceration.</p>', 'publish', 'open', 'open', '', 'reliamed-non-woven-gauze-sponge-sterile', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-non-woven-gauze-sponge-sterile', 0, 'product', '', 0),
(80, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepilex Border-59', '', 'inherit', 'open', 'open', '', 'mepilex-border-59', '', '', '2014-12-20 22:51:28', '2014-12-20 22:51:28', '', 81, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_5_9_59.jpg', 0, 'attachment', 'image/jpeg', 0),
(81, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mepilex Border is an all-in-one foam dressing that effectively absorbs and retains exudate and maintains a moist wound environment. The Safetac layer seals the wound edges and prevents the exudate from leaking onto the surrounding skin. This minimizes the risk for maceration. The Safetac layer ensures that the dressing can be changed without damaging the wound or surrounding skin or exposing the patient to additional pain.</p> <p>minimizes pain and trauma at dressing changes, <span style="font-size: 12px; line-height: 1.5em;">self-adherent - no secondary fixation needed, moisture proof and bacteria proof film backing, may be used under compression bandages, promotes patient comfort during wear, designed for ease of use, may remain in place for several days, may be lifted and adjusted without losing its adherent properties, low potential for skin irritation and allergy. </span></p> <p><span style="font-size: 12px; line-height: 1.5em;">www.molnlycke.com</span></p>', 'Mepilex Border', '<p>Mepilex Border is an all-in-one foam dressing that effectively absorbs and retains exudate and maintains a moist wound environment. The Safetac adhesive prevents tearing of fragile skin, seals the wound edges and prevents the exudate from leaking onto the surrounding skin.  </p>', 'publish', 'open', 'open', '', 'mepilex-border', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepilex-border', 0, 'product', '', 0),
(82, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepilex Border Lite-60', '', 'inherit', 'open', 'open', '', 'mepilex-border-lite-60', '', '', '2014-12-20 22:51:28', '2014-12-20 22:51:28', '', 83, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_0_60.jpg', 0, 'attachment', 'image/jpeg', 0),
(83, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mepilex Border Lite thin foam, adhesive dressing minimizes trauma to the wound and provides painless dressing changes. The Safetac technology prevents Mepilex Border Lite from sticking to the wound bed yet adheres gently to the surrounding skin. Mepilex Border Lite is ideal for those locations where a thin self-adherent dressing is required. It is a very conformable and gentle alternative to other thin adhesive bordered dressings.</p> <p>minimizes pain and trauma at dressing changes :: self-adherent - no secondary fixation needed :: moisture proof and bacteria proof film backing :: may be used under compression bandages :: promotes patient comfort during wear :: designed for ease of use :: may remain in place for several days :: may be lifted and adjusted without losing its adherent properties :: low potential for skin irritation and allergy.</p> <p>www.molnlycke.com</p>', 'Mepilex Border Lite', '<p>Mepilex Border Lite thin foam dressing with Safetac adhesive border minimizes trauma to the wound and provides painless dressing changes.</p>', 'publish', 'open', 'open', '', 'mepilex-border-lite', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepilex-border-lite', 0, 'product', '', 0),
(84, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Polyderm Border Foam Wound Dressing-61', '', 'inherit', 'open', 'open', '', 'polyderm-border-foam-wound-dressing-61', '', '', '2014-12-20 22:51:28', '2014-12-20 22:51:28', '', 85, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_1_61.jpg', 0, 'attachment', 'image/jpeg', 0),
(85, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Effective in management of moderate to heavily exudating wounds. Made of non-adherent and highly absorbent lint-free polyurethane foam. Thick soft construction that is extremely comformable and comfortable. Ideal for painful wounds requiring protection and cushioning. Protects granulating tissue for effective healing.</p>', 'Polyderm Border Foam Wound Dressing', '<p>Effective in management of moderate to heavily exudating wounds. Made of non-adherent and highly absorbent lint-free polyurethane foam. Thick soft construction that is extremely comformable and comfortable.</p>', 'publish', 'open', 'open', '', 'polyderm-border-foam-wound-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=polyderm-border-foam-wound-dressing', 0, 'product', '', 0),
(86, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'PolyMem Dots-153', '', 'inherit', 'open', 'open', '', 'polymem-dots-153', '', '', '2014-12-20 22:51:28', '2014-12-20 22:51:28', '', 87, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_5_3_153.jpg', 0, 'attachment', 'image/jpeg', 0),
(87, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>PolyMem foam dressings consist of a polyurethane membrane matrix on a semipermeable thin-film backing. Unlike any other dressing, the hydrophilic membrane contains a cleanser and moisturizer plus a super-absorbent starch co-polymer. This unique design and patented formulation eliminates the need for manual debridement and cleaning during dressing changes while reducing patient discomfort and the time and cost of dressing changes.</p>', 'PolyMem Dots', '<p>PolyMem foam dressings consist of a polyurethane membrane matrix on a semipermeable thin-film backing. Unlike any other dressing, the hydrophilic membrane contains a cleanser and moisturizer plus a super-absorbent starch co-polymer.</p>', 'publish', 'open', 'open', '', 'polymem-dots', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=polymem-dots', 0, 'product', '', 0),
(88, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Bordered Foam Dressing-62', '', 'inherit', 'open', 'open', '', 'reliamed-bordered-foam-dressing-62', '', '', '2014-12-20 22:51:29', '2014-12-20 22:51:29', '', 89, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_2_62.jpg', 0, 'attachment', 'image/jpeg', 0),
(89, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Reliamed Bordered Foam Dressing is  non-adherent and highly absorptive to manage high levels of exudate :: High Moisture Vapor Transmission Rate (MVTR) and breathability :: Unique foam membrane top layer minimizes possibility of fluid strike-through :: Conforms to awkward sites :: Features excellent elasticity :: Latex-free</p>', 'ReliaMed Bordered Foam Dressing', '<p>ReliaMed Bordered Foam Dressing is non-adherent and highly absorptive to manage high levels of exudate. Features excellent elasticity which allows it to conform to awkward sites.</p>', 'publish', 'open', 'open', '', 'reliamed-bordered-foam-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-bordered-foam-dressing', 0, 'product', '', 0),
(90, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Algidex Ag -63', '', 'inherit', 'open', 'open', '', 'algidex-ag-63', '', '', '2014-12-20 22:51:29', '2014-12-20 22:51:29', '', 91, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_3_63.jpg', 0, 'attachment', 'image/jpeg', 0),
(91, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Unique combination of silver alginate and maltodextrin with a foam backing designed to create the optimal moist wound environment important to healing. Provides immediate and sustained antimicrobial activity against a broad spectrum of wound pathogens for up to seven days including methicillin-resistant Staphylococcus aureus (MRSA), Staphylococcus aureus, Pseudomonas aeruginosa and E. Coli.</p>', 'Algidex Ag', '<p>Unique combination of silver alginate and maltodextrin with a foam backing designed to create the optimal moist wound environment important to healing.</p>', 'publish', 'open', 'open', '', 'algidex-ag', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=algidex-ag', 0, 'product', '', 0),
(92, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'PolyMem Ag Non-Adhesive-64', '', 'inherit', 'open', 'open', '', 'polymem-ag-non-adhesive-64', '', '', '2014-12-20 22:51:29', '2014-12-20 22:51:29', '', 93, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_4_64.jpg', 0, 'attachment', 'image/jpeg', 0),
(93, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>PolyMem Ag can be used instead of other dressings containing silver because the dressings support moist wound healing while providing a continuous silver reservoir. PolyMem Ag Benefits: Polymem Ag incorporates unique silver particles. Eliminates need for secondary dressing (except when using PolyMem WIC Silver). Absorbs up to 10 times its dressing weight in exudate. Maintains a moist wound environment for improved healing. Indicates when dressing change is necessary via its clear and thin backing (except PolyMem WIC Silver). </p>', 'PolyMem Ag Non-Adhesive', '<p>PolyMem Ag foam dressings can be used instead of other dressings containing silver because the dressings support moist wound healing while providing a continuous silver reservoir. Absorbs up to ten times its weight in exudate.</p>', 'publish', 'open', 'open', '', 'polymem-ag-non-adhesive', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=polymem-ag-non-adhesive', 0, 'product', '', 0),
(94, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'PolyMem Shapes-65', '', 'inherit', 'open', 'open', '', 'polymem-shapes-65', '', '', '2014-12-20 22:51:29', '2014-12-20 22:51:29', '', 95, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_5_65.jpg', 0, 'attachment', 'image/jpeg', 0),
(95, 1, '2013-04-10 17:42:24', '0000-00-00 00:00:00', '<ul> <li><span style="font-size: 12px; line-height: 1.5em;">With four aspects of wound care in one formulation, PolyMem can be used throughout the wound-healing continuum. </span></li> <li>PolyMem is also indicated for all wound types (e.g., full and partial thickness wounds, skin tears, ulcers, surgical wounds, first- and second-degree burns).</li> <li>PolyMem\'s dressings are highly absorbent, allowing up to seven days between changes, depending on the wound status. This can mean a substantial reduction in labor and dressing costs.</li> <li>PolyMem\'s dressings provide a clear built-in visual indication of when they need to be changed, taking the guesswork out of patient care.</li> <li>Because of PolyMem\'s built-in cleansing and absorption capabilities, you may be able to change dressings less often and reduce wound bed cleansing during those changes, saving you precious time.</li> </ul>', 'PolyMem Shapes', '<p>Highly absorbent foam dressings having built-in cleansing and absorption capabilities.  </p>', 'draft', 'open', 'open', '', 'polymem-shapes', '', '', '2013-04-10 17:42:24', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?post_type=product&p=95', 0, 'product', '', 0),
(96, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Hydrofera Blue-66', '', 'inherit', 'open', 'open', '', 'hydrofera-blue-66', '', '', '2014-12-20 22:51:30', '2014-12-20 22:51:30', '', 97, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_6_66.jpg', 0, 'attachment', 'image/jpeg', 0),
(97, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p class="bodyplain">Hydrofera Blue is a simple, safe, effective and proven moist wound dressing. It is constructed of polyvinyl alcohol (PVA) sponge complexed with two organic pigments, which provide broad-spectrum bacteriostatic protection. The pigments (Methylene Blue and Gentian Violet) have been used safely in medicine for over 50 years and have proven effective against a variety of microorganisms including MRSA and VRE.</p> <p class="bodyplain">Hydrofera Blue has been approved for use on all types of wounds except third degree burns. Hydrofera Blue is intended for use on complex wounds and, in trials, has shown excellent results in treatment of wounds r/t Pyoderma, radiation burns, chemical burns, venous stasis ulcers, yeast infections, folliculitis and infected wounds. It can also be used to provide a safer moist environment for optimum wound healing on non-infected wounds.</p> <p class="bodyplain">Hydrofera Blue is highly absorptive. In addition to being bacteriostatic, its open cell structure provides capillary vacuum action to draw excess fluid and exudates from the wound bed. Hydrofera Blue must be moistened with sterile saline or sterile water, squeezed out and secured to the wound bed with an appropriate secondary dressing. When kept moist, Hydrofera Blue is incredibly soft and comfortable for the patient. Other attributes of the dressing include gentile self-debridement of necrotic tissue and odor control through prevention of the growth of odor causing bacteria on the sponge. Dressings should be changed every 1 to 3 days following good wound care practice. In cases of high infection, the dressing may require more frequent change, indicated by the dressing changing color from blue to white.</p> <p>Hydrofera Blue has been <strong>approved for use on all types of wounds</strong> <strong>except third degree burns</strong>. Hydrofera Blue is intended for use on complex wounds and has shown excellent results in trials for treatment of wounds (Pyoderma - radiation burns - chemical burns - venous stasis ulcers - yeast infections - folliculitis - infected wounds). Hydrofera Blue can be used to provide a safe moist environment for optimum wound healing on non-infected wounds. Hydrofera Blue is highly absorptive. In addition to being bacteriostatic the Hydrofera Blue open cell structure provides capillary vacuum action to draw excess fluid and exudate from the wound bed. Hydrofera Blue must be moistened with sterile saline or sterile water then squeezed out and secured to the wound bed with an appropriate secondary dressing. Hydrofera Blue is incredibly soft and comfortable for the patient (must be kept moist). Other attributes of Hydrofera Blue include gentle self-debridement of necrotic tissue and pain relief. Hydrofera Blue also provides odor control through prevention of the growth of odor-causing bacteria on the sponge. Hydrofera Blue dressings should be changed every 1 to 3 days following good wound care practice.</p> <p>A secondary dressing is required to hold Hydrofera Blue in place.</p>', 'Hydrofera Blue', '<p class="bodyplain">Hydrofera Blue is a simple, safe, effective and proven moist foam dressing. It is constructed of polyvinyl alcohol (PVA) sponge complexed with two organic pigments, which provide broad-spectrum bacteriostatic protection. </p>', 'publish', 'open', 'open', '', 'hydrofera-blue', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=hydrofera-blue', 0, 'product', '', 0),
(98, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Hydrofera Blue Ostomy Ring-67', '', 'inherit', 'open', 'open', '', 'hydrofera-blue-ostomy-ring-67', '', '', '2014-12-20 22:51:30', '2014-12-20 22:51:30', '', 99, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_7_67.jpg', 0, 'attachment', 'image/jpeg', 0),
(99, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p><span>A highly absorptive, non-adhesive, synthetic sponge composed of polyvinyl alcohol foam, impregnated with Methylene Blue and Gentian Violet, which provide broad-spectrum bacteriostatic protection. It is effective against a variety of microorganisms including MRSA and VRE. It has high filtering efficiency, extreme softness, excellent wicking and retention properties. The 2.5" ring dressing has a moisture retentive film backing, can be used under an ostomy skin barrier and won\'t interfere with adhesion of the barrier.</span></p>', 'Hydrofera Blue Ostomy Ring', '<p>Hydrofera Blue Ostomy Ring provides broad-spectrum bacteriostatic protection and is effective against microorganisms including MRSA and VRE.</p>', 'publish', 'open', 'open', '', 'hydrofera-blue-ostomy-ring', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=hydrofera-blue-ostomy-ring', 0, 'product', '', 0),
(100, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepilex-68', '', 'inherit', 'open', 'open', '', 'mepilex-68', '', '', '2014-12-20 22:51:30', '2014-12-20 22:51:30', '', 101, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_8_68.jpg', 0, 'attachment', 'image/jpeg', 0) ;
INSERT INTO `admedonline_posts` ( `ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(101, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mepilex is a soft and highly conformable foam dressing that absorbs exudate and maintains a moist wound environment. Safetac technology prevents Mepilex foam dressing from sticking to the wound bed yet it adheres gently to the surrounding skin allowing easy application of secondary fixation. The Safetac layer of Mepilex ensures that the dressing can be changed without damaging the wound or surrounding skin or subjecting the patient to additional pain. Mepilex foam dressing absorbs exudate effectively and ensures a low risk of maceration. Benefits of Mepilex: :: minimizes pain and trauma at dressing changes :: stays in place :: promotes patient comfort thin and very comfortable to wear :: may be left in place during radiation therapy :: well suited to be used under compression bandages :: may be cut to suit various wound shapes and difficult-to-dress locations :: may remain in place for several days depending on the condition of the wound :: may be lifted and adjusted without losing its adherent properties :: low potential for skin irritation and allergy :: available in a range of sizes to suit many wound types :: low potential for skin irritation and allergy. www.molnlycke.com</p>', 'Mepilex', '<p>Mepilex is a soft and highly conformable foam dressing that absorbs exudate and maintains a moist wound environment. Safetac technology prevents Mepilex foam dressing from sticking to the wound bed yet it adheres gently to the surrounding skin.</p>', 'publish', 'open', 'open', '', 'mepilex', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepilex', 0, 'product', '', 0),
(102, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepilex Lite-69', '', 'inherit', 'open', 'open', '', 'mepilex-lite-69', '', '', '2014-12-20 22:51:30', '2014-12-20 22:51:30', '', 103, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_6_9_69.jpg', 0, 'attachment', 'image/jpeg', 0),
(103, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mepilex Lite is a thin and highly conformable foam dressing that absorbs exudate and maintains a moist wound environment. The Mepilex Lite Safetac layer seals around the wound edges which prevents exudate from leaking onto the surrounding skin and minimizes the risk for maceration. The Safetac layer in Mepilex products ensures atraumatic dressing changes. Mepilex Lite can be cut to suit various wound shapes and locations. Benefits of Mepilex Lite :: minimizes pain and trauma at dressing changes and stays in place :: promotes patient comfort thin and very comfortable to wear :: may be left in place during radiation therapy :: well suited to be used under compression bandages :: may be cut to suit various wound shapes and difficult-to-dress locations :: may remain in place for several days depending on the condition of the wound:: may be lifted and adjusted without losing its adherent properties :: available in a range of sizes to suit many wound types :: low potential for skin irritation and allergy</p>', 'Mepilex Lite', '<p>Mepilex Lite is a thin and highly conformable foam dressing that absorbs exudate and maintains a moist wound environment. The Mepilex Lite Safetac layer seals around the wound edges which prevents exudate from leaking onto the surrounding skin and minimizes the risk for maceration.</p>', 'publish', 'open', 'open', '', 'mepilex-lite', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepilex-lite', 0, 'product', '', 0),
(104, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepilex Transfer-70', '', 'inherit', 'open', 'open', '', 'mepilex-transfer-70', '', '', '2014-12-20 22:51:30', '2014-12-20 22:51:30', '', 105, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_0_70.jpg', 0, 'attachment', 'image/jpeg', 0),
(105, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mepilex Transfer is a thin and highly conformable foam dressing that absorbs exudate and maintains a moist wound environment. The Safetac layer seals around the wound edges which prevents exudate from leaking onto the surrounding skin thus minimizing the risk for maceration. As the Safetac layer seals around the wound the foam structure of Mepilex Transfer allows the exudate to move vertically into a secondary absorbent pad which maintaines a moist wound environment. The Safetac layer ensures atraumatic dressing changes. Mepilex Transfer can be cut to suit various wound shapes and locations.</p>', 'Mepilex Transfer', '<p>Mepilex Transfer is a thin and highly conformable foam dressing that absorbs exudate and maintains a moist wound environment. The Safetac layer seals around the wound edges which prevents exudate from leaking onto the surrounding skin.</p>', 'publish', 'open', 'open', '', 'mepilex-transfer', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepilex-transfer', 0, 'product', '', 0),
(106, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Foam Dressing-71', '', 'inherit', 'open', 'open', '', 'reliamed-foam-dressing-71', '', '', '2014-12-20 22:51:30', '2014-12-20 22:51:30', '', 107, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_1_71.jpg', 0, 'attachment', 'image/jpeg', 0),
(107, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p> Finished selvage edges. Highly absorptive to manage high levels of exudate. High Moisture Vapor Transmission Rate (MVTR) and breathability leads to longer wear time between dressing changes. Unique foam membrane top layer minimizes possibility of fluid strike-through. Conforms to awkward sites and features excellent elasticity. 4" x 4" and 6" x 6" nonadherent pads are suitable for patients with sensitivity to adhesives. Latex-free.</p>', 'ReliaMed Foam Dressing', '<p>ReliaMed Foam Dressing is highly absorptive, non-adherent dressing used to manage high levels of exudate. High Moisture Vapor Transmission Rate (MVTR) and breathability leads to longer wear time between dressing changes.</p>', 'publish', 'open', 'open', '', 'reliamed-foam-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-foam-dressing', 0, 'product', '', 0),
(108, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Tegaderm Foam Dressing-72', '', 'inherit', 'open', 'open', '', 'tegaderm-foam-dressing-72', '', '', '2014-12-20 22:51:31', '2014-12-20 22:51:31', '', 109, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_2_72.jpg', 0, 'attachment', 'image/jpeg', 0),
(109, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>The wound dressing is a fast wicking non-swelling polyurethane foam with a highly breathable film backing which prevents wound exudate strike-through and is a barrier to outside contamination while the dressing remains intact without leakage. Heavily draining wounds often result in skin maceration frequent dressing changes and patient discomfort. Tegaderm foam dressing (nonadhesive) provides total fluid management by a combination of fast wicking and high absorbency and breathability.</p>', 'Tegaderm Foam Dressing', '<p>Tegaderm Foam wound dressing is a fast wicking, non-swelling polyurethane foam with a highly breathable film backing that is a barrier to outside contamination while the dressing remains intact without leakage.</p>', 'publish', 'open', 'open', '', 'tegaderm-foam-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=tegaderm-foam-dressing', 0, 'product', '', 0),
(110, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Medipore Bordered Gauze-73', '', 'inherit', 'open', 'open', '', 'medipore-bordered-gauze-73', '', '', '2014-12-20 22:51:31', '2014-12-20 22:51:31', '', 111, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_3_73.jpg', 0, 'attachment', 'image/jpeg', 0),
(111, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>An all-in-one sterile dressing that features a breathable soft cloth tape backing with a unique non-adherent pad. Medipore +Pad soft cloth adhesive wound dressing may be used as a primary or secondary dressing over light to moderately draining wounds. Also for securing devices or for protecting I.V. catheter sites. This all-in-one sterile dressing is a highly conformable absorbent dressing that provides superior patient comfort as dressing flexes with body movement and contours. Medipore +Pad dressing has a hypoallergenic and non-latex adhesive that provides excellent adhesion yet is gentle to the skin. The dressing features a unique non-adherent pad that is designed to promote normal wound healing processes  with less pain and trauma upon removal.</p>', 'Medipore Bordered Gauze', '<p>An all-in-one sterile dressing that features a breathable soft cloth tape backing with a unique non-adherent pad.</p>', 'publish', 'open', 'open', '', 'medipore-bordered-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=medipore-bordered-gauze', 0, 'product', '', 0),
(112, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepore Bordered Gauze-74', '', 'inherit', 'open', 'open', '', 'mepore-bordered-gauze-74', '', '', '2014-12-20 22:51:31', '2014-12-20 22:51:31', '', 113, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_4_74.jpg', 0, 'attachment', 'image/jpeg', 0),
(113, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mepore is the original self-adhesive absorbent dressing. The result of continuous innovation over the past 30 years Mepore combines gentle and secure fixation with excellent absorption properties and ease of use. Benefits: Easy-to-remove protection paper for ease of use soft elastic nonwoven with high breathability for better patient comfort, absorbent wound pad with a low-adherent wound-contact layer for better patient comfort and longer wear time, skin-friendly water-based and solvent-free adhesive for gentle and secure fixation.</p>', 'Mepore Bordered Gauze', '<p>Mepore is the original self-adhesive absorbent dressing that combines gentle and secure fixation with excellent absorption properties and ease of use.</p>', 'publish', 'open', 'open', '', 'mepore-bordered-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepore-bordered-gauze', 0, 'product', '', 0),
(114, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Bordered Gauze-75', '', 'inherit', 'open', 'open', '', 'reliamed-bordered-gauze-75', '', '', '2014-12-20 22:51:31', '2014-12-20 22:51:31', '', 115, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_5_75.jpg', 0, 'attachment', 'image/jpeg', 0),
(115, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Non-adherent contact layer with absorbent 100% cotton pad covered with an adhesive-coated nonwoven tape overlay. Latex-free.</p>', 'ReliaMed Bordered Gauze', '<p>Non-adherent contact layer with absorbent 100% cotton pad covered with an adhesive-coated nonwoven tape overlay. Latex-free.</p>', 'publish', 'open', 'open', '', 'reliamed-bordered-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-bordered-gauze', 0, 'product', '', 0),
(116, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Tegaderm Matrix-77', '', 'inherit', 'open', 'open', '', 'tegaderm-matrix-77', '', '', '2014-12-20 22:51:31', '2014-12-20 22:51:31', '', 117, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_7_77.jpg', 0, 'attachment', 'image/jpeg', 0),
(117, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Tegaderm Matrix dressing is a unique and affordable wound care solution that aids in the management of hard-to-heal wounds. It is designed to help jump-start wounds and enable the wound to progress through the normal healing cascade. The dressing is indicated for use with chronic and non-infected wounds including: diabetic ulcers and pressure ulcers (stages II-IV) and venous stasis ulcers. Tegaderm Matrix dressing is the first advanced wound care solution that utilizes the innovative PHI technology. This technology consists of a unique blend of cations found naturally in the body including potassium and zinc and calcium and rubidium. The unique formulation helps promote the natural moisture balance needed for chronic wound healing. Benefits :: Easy to apply and remove: safe and effective.</p> <p>www.3m.com</p> <p>Secondary dressing required to hold in place.</p>', 'Tegaderm Matrix', '<p>Tegaderm Matrix dressing is a unique, affordable wound care dressing that aids in the management of hard-to-heal wounds such as diabetic ulcers.</p>', 'publish', 'open', 'open', '', 'tegaderm-matrix', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=tegaderm-matrix', 0, 'product', '', 0),
(118, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Tegaderm Non-Adherent Contact Layer-78', '', 'inherit', 'open', 'open', '', 'tegaderm-non-adherent-contact-layer-78', '', '', '2014-12-20 22:51:31', '2014-12-20 22:51:31', '', 119, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_8_78.jpg', 0, 'attachment', 'image/jpeg', 0),
(119, 1, '2013-04-10 17:42:24', '0000-00-00 00:00:00', '<p>A woven and nylon fabric with sealed edges that is non-adherent and also non-irritating and hypoallergenic. The wound contact material is placed over the wound and under gauze or other absorbent dressing. Tegaderm Contact Layer is a woven nylon fabric with sealed edges that is a lint-free, non-adherent, non-toxic,  non-irritating and hypoallergenic. Clinical studies show that Tegaderm Contact Layer can be left on the wound for up to 7 days. Tegaderm Contact Layer can be used under gauze or other absorbent dressings. It allows exudates to pass through to an absorbent outer barrier. The non-adherence of this material will minimize disruption of healthy granulation tissue and re-epithelialized surfaces.</p> <p>Requires a secondary dressing to hold in place.</p>', 'Tegaderm Non-Adherent Contact Layer', '<p>A woven nylon fabric with sealed edges that is non-adherent, non-irritating and hypoallergenic. The wound contact material is placed over the wound and under gauze or other absorbent dressing.</p>', 'draft', 'open', 'open', '', 'tegaderm-non-adherent-contact-layer', '', '', '2013-04-10 17:42:24', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?post_type=product&p=119', 0, 'product', '', 0),
(120, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Gazetex 6-Ply Gauze Rolls-79', '', 'inherit', 'open', 'open', '', 'gazetex-6-ply-gauze-rolls-79', '', '', '2014-12-20 22:51:32', '2014-12-20 22:51:32', '', 121, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_7_9_79.jpg', 0, 'attachment', 'image/jpeg', 0),
(121, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Gazetex washed and low-linting woven gauze rolls are used for wrapping or packing large and deep wounds. When used as a primary dressing Gazetex rolls provide fast wicking and absorbency and aeration. This gauze dressing provides additional cushioning and comfort when used as a secondary dressing. Latex Free. Available in 6-ply Non-Sterile (NS) and Sterile (ST) rolls.</p>', 'Gazetex 6-Ply Gauze Rolls', '<p>Gazetex washed, low-linting woven gauze rolls are used for wrapping or packing large wounds. Available in 6-ply non-sterile (NS) sterile (ST) rolls.</p>', 'publish', 'open', 'open', '', 'gazetex-6-ply-and-8-ply-gauze-roll', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=gazetex-6-ply-and-8-ply-gauze-roll', 0, 'product', '', 0),
(122, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'BIOGUARD antimicrobial gauze rolls-80', '', 'inherit', 'open', 'open', '', 'bioguard-antimicrobial-gauze-rolls-80', '', '', '2014-12-20 22:51:32', '2014-12-20 22:51:32', '', 123, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_8_0_80.jpg', 0, 'attachment', 'image/jpeg', 0),
(123, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>BIOGUARD antimicrobial gauze rolls provide a barrier to bacterial contamination to prevent infection from entering the wound.  Biogard antimicrobial gauze rolls also provide redution of common pathogens absorbed within the dressing. BIOGUARD is available in 6-ply antimicrobial rolls 4.5" x 4.1 yd.</p>', 'BIOGUARD antimicrobial gauze rolls', '<p>BIOGUARD antimicrobial gauze rolls provide a barrier  to prevent infection from entering the wound. and  also provide reduction of common pathogens absorbed within the dressing.</p>', 'publish', 'open', 'open', '', 'bioguard-antimicrobial-gauze-rolls', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=bioguard-antimicrobial-gauze-rolls', 0, 'product', '', 0),
(124, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Conforming Stretch Gauze-81', '', 'inherit', 'open', 'open', '', 'conforming-stretch-gauze-81', '', '', '2014-12-20 22:51:32', '2014-12-20 22:51:32', '', 125, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_8_1_81.jpg', 0, 'attachment', 'image/jpeg', 0),
(125, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Unique knit construction offers proper compression without constriction. Stays in place with minimal taping and conforms to difficult body contours. Highly-absorbent gauze roll is non-linting and ravel free to keep the wound site clean. Sterile bandages are packed in peel-open poly pouches for aseptic handling. </p>', 'Conforming Stretch Gauze', '<p>Unique knit construction offers proper compression without constriction. Self adhering and stays in place with minimal taping.</p>', 'publish', 'open', 'open', '', 'conforming-stretch-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=conforming-stretch-gauze', 0, 'product', '', 0),
(126, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'KERLIX AMD 6-Ply Roll-82', '', 'inherit', 'open', 'open', '', 'kerlix-amd-6-ply-roll-82', '', '', '2014-12-20 22:51:32', '2014-12-20 22:51:32', '', 127, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_8_2_82.jpg', 0, 'attachment', 'image/jpeg', 0),
(127, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p><span>Kerlix™ AMD rolls are impregnated with PHMB (Polyhexamethylene Biguanide), a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA.</span> KERLIX Rolls provide fast-wicking action superior aeration and excellent absorbency. Finished edges on the product reduce loose ends and lint.</p>', 'KERLIX AMD 6-Ply Roll', '<p>Kerlix™ AMD rolls are impregnated with  a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms.</p>', 'publish', 'open', 'open', '', 'kerlix-amd-6-ply-roll', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=kerlix-amd-6-ply-roll', 0, 'product', '', 0),
(128, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'DuCare Gauze Sponge Loaf - NS-83', '', 'inherit', 'open', 'open', '', 'ducare-gauze-sponge-loaf-ns-83', '', '', '2014-12-20 22:51:33', '2014-12-20 22:51:33', '', 129, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_8_3_83.jpg', 0, 'attachment', 'image/jpeg', 0),
(129, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Low lint sterile gauze sponges made of 100% cotton with a clean fold and no raw edges. Non-sterile loaf.</p> <p>Secondary dressing or tape needed to hold in place</p>', 'DuCare Gauze Sponge Loaf - NS', '<p>Low lint sterile gauze sponges made of 100% cotton with a clean fold and no raw edges. Non-sterile loaf.</p>', 'publish', 'open', 'open', '', 'ducare-gauze-sponge', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=ducare-gauze-sponge', 0, 'product', '', 0),
(130, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Dynarex Gauze Sponge - ST-84', '', 'inherit', 'open', 'open', '', 'dynarex-gauze-sponge-st-84', '', '', '2014-12-20 22:51:33', '2014-12-20 22:51:33', '', 131, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_8_4_84.jpg', 0, 'attachment', 'image/jpeg', 0),
(131, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Dynarex STERILE gauze sponges combine superior quality with assured economy for a wide range of dressing and cleaning and prepping procedures. No exposed raw edges - cut edges folded in cotton-filled sponges provide maximum absorption. 25 packages of 2.</p> <p>Secondary dressing or tape required to hold in place.</p>', 'Dynarex Gauze Sponge - ST', '<p>Dynarex Cotton  STERILE sponges provide maximum absorption. 25 packages of 2.</p>', 'publish', 'open', 'open', '', 'dynarex-8-ply-gauze-sponge', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=dynarex-8-ply-gauze-sponge', 0, 'product', '', 0),
(132, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Kendall Curity AMD Antimicrobial Gauze Sponge-85', '', 'inherit', 'open', 'open', '', 'kendall-curity-amd-antimicrobial-gauze-sponge-85', '', '', '2014-12-20 22:51:33', '2014-12-20 22:51:33', '', 133, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_8_5_85.jpg', 0, 'attachment', 'image/jpeg', 0),
(133, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Kendall Curity AMD antimicrobial gauze sponges are impregnated with PHMB (Polyhexamethylene Biguanide). This is a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA.</p>', 'Kendall Curity AMD Antimicrobial Gauze Sponge', '<p>Kendall Curity AMD antimicrobial gauze sponges are impregnated with a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA.</p>', 'publish', 'open', 'open', '', 'kendall-curity-amd-antimicrobial-gauze-sponge', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=kendall-curity-amd-antimicrobial-gauze-sponge', 0, 'product', '', 0),
