(135, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>KERLIX Sponge absorbency and texture is ideal for prepping, cleansing, packing and debriding wounds.</p> <p><span style="font-size: 12px; line-height: 1.5em;">Requires a secondary or tape to hold in place.</span></p>', 'KERLIX 12-Ply Gauze Sponge', '<p>KERLIX Sponge absorbency and texture is ideal for prepping, cleansing, packing and debriding wounds.</p>', 'publish', 'open', 'open', '', 'kerlix-12-ply-gauze-sponge', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=kerlix-12-ply-gauze-sponge', 0, 'product', '', 0),
