(137, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Dynarex sterile latex surgical gloves size 7. Maximum strength with no loss of tactile sensitivity. Textured surface in palm and finger tips.</p>', 'Dynarex Sterile Latex Gloves', '<p>Dynarex sterile latex surgical gloves size 7. Maximum strength with no loss of tactile sensitivity. Textured surface in palm and finger tips.</p>', 'publish', 'open', 'open', '', 'dynarex-sterile-latex-gloves', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=dynarex-sterile-latex-gloves', 0, 'product', '', 0),
