(139, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Pure latex exam gloves that are premium medical-grade. They are powder-free and protein-free. These gloves are natural white in color, disposable,non-sterile and ambidextrous. Reliamed glove quality meets or exceeds ASTM and FDA 510K requirements.</p>', 'ReliaMed Latex Gloves - powder free', '<p>These powder-free latex exam gloves are premium medical-grade and made of pure latex.</p>', 'publish', 'open', 'open', '', 'reliamed-latex-gloves', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-latex-gloves', 0, 'product', '', 0),
