(141, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Vinyl synthetic exam gloves are premium medical-grade. They are powder free and protein-free,latex-free and disposable. They are non-sterile and ambidextrous. Reliamed glove quality meets or exceeds ASTM and FDA 510K requirements.</p>', 'ReliaMed Vinyl Gloves - powder-free', '<p>These powder-free nonsterile vinyl synthetic exam gloves are premium medical-grade, protein-free, latex-free, disposable, and ambidextrous.</p>', 'publish', 'open', 'open', '', 'reliamed-vinyl-gloves', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-vinyl-gloves', 0, 'product', '', 0),
(142, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'MEDIHONEY Hydrocolloid Sheet-90', '', 'inherit', 'open', 'open', '', 'medihoney-hydrocolloid-sheet-90', '', '', '2014-12-20 22:51:34', '2014-12-20 22:51:34', '', 143, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_0_90.jpg', 0, 'attachment', 'image/jpeg', 0),
(143, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>MEDIHONEY hydrocolloid sheet dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY dressings are able to work in the presence of wound fluid and blood and tissue. They promote an optimal healing environment because they contain a very high percentage of Leptospermum honey. MEDIHONEY dressings provide a moist and occlusive environment conducive to optimal wound healing.</p> <p>The dressings are indicated for the management of moderate to heavily exuding wounds such as: :: diabetic foot ulcers :: Venous stasis leg ulcers :: Arterial leg ulcers :: Leg ulcers of mixed etiology :: Pressure ulcers (I-IV) :: 1st and 2nd degree burns :: Donor sites :: Traumatic and surgical wounds.</p> <p>www.dermasciences.com</p> <p>May be used as a primary or secondary dressing.</p>', 'MEDIHONEY Hydrocolloid Sheet', '<p>Medihoney Hydrocolloid sheet contains 80% active medical-grade Leptospermum Honey in a hydrocolloid sheet form to absorb light to moderate drainage.</p>', 'publish', 'open', 'open', '', 'medihoney-hydrocolloid-sheet', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=medihoney-hydrocolloid-sheet', 0, 'product', '', 0),
(144, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'MEDIHONEY® Gel -91', '', 'inherit', 'open', 'open', '', 'medihoney-gel-91', '', '', '2014-12-20 22:51:34', '2014-12-20 22:51:34', '', 145, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_1_91.jpg', 0, 'attachment', 'image/jpeg', 0),
(145, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p><span class="highlight" style="font-family: \'arial black\', \'avant garde\'; font-size: 12pt;"><strong>80% Active <em>Leptospermum</em> Honey and 20% natural gelling agents.</strong> </span></p> <p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">• More viscous formulation with increased stability at the site of the wound </span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">• Demonstrated positive clinical outcomes</span><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">• Optimal for superficial to full thickness wounds</span></p> <p><br /><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;"><strong>MEDIHONEY® </strong>dressings are a unique line of dressings containing Active Leptospermum Honey from New Zealand and Australia. They have been shown to possess unique qualities that make them ideal for the management of chronic and acute wounds and burns. MEDIHONEY® dressings are able to work in the presence of wound fluid and blood and tissue. They promote an optimal healing environment because they contain a very high percentage of Leptospermum honey. MEDIHONEY dressings provide a moist and occlusive environment conducive to optimal wound healing. Due to their versatility and lack of toxicity, <strong><span class="highlight">MEDIHONEY®</span> </strong>dressings can be used in all stages of wound healing, and can also be used as an important component of wound bed preparation. As such, placing these dressings as the cornerstones of a wound care formulary can take a great deal of the guess-work out of wound management.</span></p> <p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">The dressings are indicated for the management of moderate to heavily exuding wounds such as:  diabetic foot ulcers, Venous stasis leg ulcers, Arterial leg ulcers, Leg ulcers of mixed etiolog, Pressure ulcers (I-IV),  1st and 2nd degree burns, Donor sites, Traumatic and surgical wounds.</span></p> <p><span style="text-decoration: underline; font-family: arial, helvetica, sans-serif; font-size: 12pt;">www.dermasciences.com</span></p> <p><span style="font-family: arial, helvetica, sans-serif; font-size: 12pt;">Requires a secondary dressing to cover.</span></p>', 'MEDIHONEY® Gel', '<p><strong><span class="highlight" style="font-size: 12pt; font-family: arial, helvetica, sans-serif;">80% Active <em>Leptospermum</em> Honey and 20% natural gelling agents </span></strong></p>\r\n<p><span style="font-size: 12pt; font-family: arial, helvetica, sans-serif;">Optimal for partical to full thickness wounds</span><br /><br /></p>', 'publish', 'open', 'open', '', 'medihoney-hydrocolloid-tube', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=medihoney-hydrocolloid-tube', 0, 'product', '', 0),
(146, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'FlexiCol-92', '', 'inherit', 'open', 'open', '', 'flexicol-92', '', '', '2014-12-20 22:51:34', '2014-12-20 22:51:34', '', 147, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_2_92.jpg', 0, 'attachment', 'image/jpeg', 0),
(147, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>FlexiCol handles wound drainage with a combination of absorption and evaporation. FlexiCol stays secure for days after its first application so re-application or securing with tape is eliminated. FlexiCol\'s thin film exterior and moist core allow for higher and quicker fluid uptake so most residue does not remain in the wound. Peel-off tabs and a thin beveled edge make application quick and prevent dressing roll-up. FlexiCol folds easily to conform to difficult-to-dress areas.</p>', 'FlexiCol', '<p>FlexiCol handles wound drainage with a combination of absorption and evaporation.  FlexiCol stays secure for days after its first application so re-application or securing with tape is eliminated.</p>', 'publish', 'open', 'open', '', 'flexicol', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=flexicol', 0, 'product', '', 0),
(148, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'PRIMACOL Hydocolloid Dressing-93', '', 'inherit', 'open', 'open', '', 'primacol-hydocolloid-dressing-93', '', '', '2014-12-20 22:51:34', '2014-12-20 22:51:34', '', 149, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_3_93.jpg', 0, 'attachment', 'image/jpeg', 0),
(149, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>These dressings mix with wound exudate to form a soft mass that allows for easy removal while protecting the wound from outside contamination from bacteria, fecal matter or urine. A moist wound environment is created that is conducive to wound healing. The foam backing provides an extra layer of cushioning and comfort, and tapered edges that are designed to minimize bunching and rolling up. This leads to improved wear times and cost-effectiveness. Use for the management of lightly exuding pressure ulcers (Stage I-IV), diabetic foot ulcers, venous stasis ulcer and other chronic and acute wounds.</p> <p>May be used as a primary or secondary dressing.</p>', 'PRIMACOL Hydocolloid Dressing', '<p>These dressings mix with wound exudate to form a soft mass that allows for easy removal while protecting the wound from outside contamination from bacteria, fecal matter or urine.</p>', 'publish', 'open', 'open', '', 'primacol-hydocolloid-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=primacol-hydocolloid-dressing', 0, 'product', '', 0),
(150, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Hydrocolloid Dressing-94', '', 'inherit', 'open', 'open', '', 'reliamed-hydrocolloid-dressing-94', '', '', '2014-12-20 22:51:34', '2014-12-20 22:51:34', '', 151, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_4_94.jpg', 0, 'attachment', 'image/jpeg', 0),
(151, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>State-of-the-art hydrocolloid formulation effectively absorbs wound exudate. This results in easier-to-care-for wounds that are cleaner and less painful. A uniquely smooth and low-friction film backing reduces shear forces that can contribute to skin tearing . Dressing adhesive qualities provide secure bonding to skin and allow normal bathing. Beveled edges minimize possiblity of lift-up. Latex-free. www.reliamedproducts.com</p>', 'ReliaMed Hydrocolloid Dressing', '<p>State-of-the-art hydrocolloid formulation effectively absorbs wound exudate resulting in cleaner, less painful and easier-to-care-for wounds. Latex-free.</p>', 'publish', 'open', 'open', '', 'reliamed-hydrocolloid-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-hydrocolloid-dressing', 0, 'product', '', 0),
(152, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Tegaderm Hydrocolloid Dressing-95', '', 'inherit', 'open', 'open', '', 'tegaderm-hydrocolloid-dressing-95', '', '', '2014-12-20 22:51:35', '2014-12-20 22:51:35', '', 153, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_5_95.jpg', 0, 'attachment', 'image/jpeg', 0),
(153, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Tegaderm Hydrocolloids are sterile wound dressings which consist of a hypoallergenic and hydrocolloid adhesive along with an outer clear adhesive cover film impermeable to liquids, bacteria and viruses. The inner layer of hydrocolloid adhesive rapidly absorbs exudate faster than the leading competitive hydrocolloid in the first 48 hours. The breathable outer film layer provides a consistently high rate of moisture vapor transmission. These features ensure an optimal moist wound environment, minimize the chance for damage to healthy periwound skin and provide extended wear for up to seven days.</p>', 'Tegaderm Hydrocolloid Dressing', '<p>Tegaderm Hydrocolloids are sterile wound dressings which consist of a hypoallergenic and hydrocolloid adhesive along with an outer clear adhesive cover film impermeable to liquids, bacteria and viruses.</p>', 'publish', 'open', 'open', '', 'tegaderm-hydrocolloid-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=tegaderm-hydrocolloid-dressing', 0, 'product', '', 0),
(154, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Anasept Antimicrobial Skin and Wound Gel-96', '', 'inherit', 'open', 'open', '', 'anasept-antimicrobial-skin-and-wound-gel-96', '', '', '2014-12-20 22:51:35', '2014-12-20 22:51:35', '', 155, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_6_96.jpg', 0, 'attachment', 'image/jpeg', 0),
(155, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>BEST PRICE AND FREE SHIP. Anasept  Antimicrobial Skin and Wound Gel is an extremely safe topical hydrogel with exceptionally rapid broad spectrum bactericidal and fungicidal and virucidal properties. Anasept Antimcrobial Skin and Wound Gel rapidly eliminates antibiotic-resistant strains MRSA and VRE and other dangerous micro-organisms.</p> <p>Anasept Antimicrobial Skin and Wound Gel may be used for the following wound types: pressure ulcers (stage I-IV) , cuts and abrasions, surgical incisions/wounds, diabetic foot ulcers,  first and second degree burn, venous stasis ulcers, grafted wounds, and donor sites. Anasept Antimicrobial Skin and Wound Gel may be used for irritated skin or rashes.</p> <p><strong>Anasept Antimicrobial Skin and Wound Gel may be used on wounds having no drainage to moderate levels of drainage as it has some absorptive capacity</strong>.</p> <p><em><span style="font-size: 12px; line-height: 1.5em;">Anasept </span><span style="font-size: 12px; line-height: 1.5em;">Antimicrobial Skin and Wound Gel is indicated for use by Health Care Professionals in the management of wounds.</span></em></p> <p><span style="text-decoration: underline;">www.anacapatechnologies.com</span></p> <p>Secondary dressing required to cover.</p>', 'Anasept Antimicrobial Skin and Wound Gel', '<p>BEST PRICE AND FREE SHIP. Anasept Antimicrobial Skin and Wound Gel is an extremely safe topical hydrogel with exceptionally rapid broad spectrum bactericidal, fungicidal and virucidal properties. FDA-approved to eliminate common infection-causing bacteria as well as antibiotic-resistant strains MRSA VRE and other dangerous micro-organisms. </p>', 'publish', 'open', 'open', '', 'anasept-gel', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=anasept-gel', 0, 'product', '', 0),
(156, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Silver-Sept Gel-97', '', 'inherit', 'open', 'open', '', 'silver-sept-gel-97', '', '', '2014-12-20 22:51:35', '2014-12-20 22:51:35', '', 157, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_7_97.jpg', 0, 'attachment', 'image/jpeg', 0),
(157, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>BEST PRICE and FREE SHIP. Silver-Sept Gel is a clear, LATEX FREE, antimicrobial, amorphous hydrogel wound dressing that helps to maintain a moist wound environment that is conducive to healing. Silver-Sept will absorb a mild amount of wound exudate and will not stain or discolor tissue. Silver-Sept functions as a long-lasting antimicrobial barrier by inhibiting the growth of bacteria including the antibiotic resistant strains: MRSA &amp; VRE &amp; clinically important fungi such as: Candida albicans and Aspergillus niger.</p> <p>www.anacapatechnologies.com</p> <p>Requires secondary dressing to hold in place.</p>', 'Silver-Sept Gel', '<p>A clear, amorphous, antimicrobial hydrogel that inhibits the growth of bacteria including antibiotic resistant strains such as MRSA VRE and fungi such as Candida albicans and Aspergillus niger.</p>', 'publish', 'open', 'open', '', 'silver-sept', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=silver-sept', 0, 'product', '', 0),
(158, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Sorbact Gel-98', '', 'inherit', 'open', 'open', '', 'sorbact-gel-98', '', '', '2014-12-20 22:51:35', '2014-12-20 22:51:35', '', 159, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_8_98.jpg', 0, 'attachment', 'image/jpeg', 0),
(159, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Sorbact Gel dressings are used to prevent or eliminate infection in dry to low-exudating wounds, burns or fungal infections without the use of silver. Sorbact selectively binds and inactivates pathogenic microorganisms through a natural binding process. Sorbact technology builds on the physical forces that make two hydrophobic (water-repellent) particles bind together when in direct contact utilizing the binding force of surrounding water molecules. The green surface of Sorbact has a unique property that binds and inactivates pathogenic microorganisms. Microorganisms bind to Sorbact within 15-30 seconds of application and become inactivated creating a microbiological balance that is favorable for the wound healing process. Binding and inactivation continues until Sorbact is removed and replaced.</p>', 'Sorbact Gel', '<p>Sorbact Gel dressings are used to prevent or eliminate infection in dry to low-exudating wounds, burns and fungal infections without the use of silver. Sorbact selectively binds and inactivates pathogenic microorganisms through a natural binding process.</p>', 'publish', 'open', 'open', '', 'sorbact-gel', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=sorbact-gel', 0, 'product', '', 0),
(160, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Hydrogel Sheet-99', '', 'inherit', 'open', 'open', '', 'reliamed-hydrogel-sheet-99', '', '', '2014-12-20 22:51:35', '2014-12-20 22:51:35', '', 161, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_9_9_99.jpg', 0, 'attachment', 'image/jpeg', 0),
(161, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Provides moisture to the wound bed, a cooling effect for first- and second-degree burns, and promotes autolytic debridement. Latex-free.</p> <p><span style="font-size: 12px; line-height: 1.5em;">A secondary dressing is required to hold in place</span></p>', 'ReliaMed Hydrogel Sheet', '<p>Provides moisture to the wound bed and a cooling effect for first- and second-degree burns. </p>', 'publish', 'open', 'open', '', 'reliamed-hydrogel-sheet', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-hydrogel-sheet', 0, 'product', '', 0),
(162, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Spand-Gel-100', '', 'inherit', 'open', 'open', '', 'spand-gel-100', '', '', '2014-12-20 22:51:36', '2014-12-20 22:51:36', '', 163, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_0_100.jpg', 0, 'attachment', 'image/jpeg', 0),
(163, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Hydrogel sheet designed for the breast provides scar reduction and improved healing after breast reconstruction or augmentation surgeries. Provides cooling relief after radiation or aesthetic treatments on face and neck.</p> <p>Spand-Gel primary wound hydrogel dressingd provide a moist and cool wound-healing environment to promote granulation tissue formation and relieve pain, burning, itching and soreness. Provides a barrier from exogenous bacteria and fluids and does not adhere to tissue.  Spand-Gel absorbs wound exudates up to 3 times its weight.</p> <p>Spand-Gel comes in <span style="text-decoration: underline;">specialized shapes and sizes</span> to fit any area. This cool hydrogel sheet may be used in conjunction with MediSoothe Lotion. Best when cooled in the refrigerator for 30 minutes before using to provide soothing and cooling relief and a more comfortable recovery. This product may be rinsed off and placed in a zip-locked bag and refrigerated for later use.</p> <p><span style="text-decoration: underline;">www.meditechintl.com</span></p> <p>Secondary dressing required to hold in place. (see Spandage tapeless retention)</p>', 'Spand-Gel', '<p>Spand-Gel hydrogel dressings are shaped for the face, breast, neck and more. Provide a moist, cool wound-healing environment to promote granulation tissue formation, burn relief after radiation or aesthetic treatments and reduced scarring.</p>', 'publish', 'open', 'open', '', 'spand-gel', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=spand-gel', 0, 'product', '', 0),
(164, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Dermagran Hydrophillic-101', '', 'inherit', 'open', 'open', '', 'dermagran-hydrophillic-101', '', '', '2014-12-20 22:51:36', '2014-12-20 22:51:36', '', 165, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_1_101.jpg', 0, 'attachment', 'image/jpeg', 0),
(165, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Dermagran Hydrophilic contains nutrients such as zinc and vitamin B6 that play an important role in tissue repair. Dermagran Hydrophilic dressing is useful for rehydrating sloughy or necrotic tissue and enhancing autolytic debridement. Dermagran provides a moist  and mildly acidic wound environment that is conducive to wound healing on minimally draining wounds and may be used as a  filler for chronic and acute wounds. The zinc-nutrient dressing formulation and balanced pH technology of Dermagran products contain Vitamin A, Vitamin B6,calcium and Magnesium. Dermagran may be used for the management of pressure ulcers.</p> <p>Requires a secondary dressing to cover.</p>', 'Dermagran Hydrophillic', '<p>Dermagran Hydrophilic contains nutrients such as zinc and vitamin B6 that play an important role in tissue repair. Dermagran Hydrophilic dressing is useful for rehydrating sloughy or necrotic tissue and enhancing autolytic debridement.</p>', 'publish', 'open', 'open', '', 'dermagran-hydrophillic', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=dermagran-hydrophillic', 0, 'product', '', 0),
(166, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Hypergel-102', '', 'inherit', 'open', 'open', '', 'hypergel-102', '', '', '2014-12-20 22:51:36', '2014-12-20 22:51:36', '', 167, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_2_102.jpg', 0, 'attachment', 'image/jpeg', 0),
(167, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Hypergel is a water-based hypertonic saline gel that effectively softens and debrides dry necrosis (eschar) to create an optimal environment for natural wound healing. </p> <p>Secondary dressing required to hold in place.</p>', 'Hypergel', '<p>A water-based hypertonic saline gel that effectively softens and debrides dry, necrotic tissue.</p>', 'publish', 'open', 'open', '', 'hypergel', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=hypergel', 0, 'product', '', 0),
(168, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Multidex Maltodextrin Gel-103', '', 'inherit', 'open', 'open', '', 'multidex-maltodextrin-gel-103', '', '', '2014-12-20 22:51:36', '2014-12-20 22:51:36', '', 169, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_3_103.jpg', 0, 'attachment', 'image/jpeg', 0),
(169, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote epithelial proliferation and granulation tissue. Quickly fills wound site and rapidly mixes with exudate to form a protective coating that maintains an ideal moisture balance to protect against dehydration. Available as a gel for dry and minimally draining wounds. For use on all wound types. Can be used on infected or hard-to-heal wounds. Specifically formulated to provide topical nutrients to wound sites and create a natural healing environment. Non-toxic and not systemically absorbed. Controls odor while decreasing purulent exudate. Penetrates all wound irregularities to fill tunneling and undermining. Softens necrotic tissue to facilitate debridement.</p> <p>Requires a secondary dressing to cover.</p>', 'Multidex Maltodextrin Gel', '<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote the growth of granulation tissue and epithelial proliferation. Quickly fills wound site rapidly mixing with exudate to form a protective coating that maintains an ideal moisture balance to protect against dehydration.</p>', 'publish', 'open', 'open', '', 'multidex-maltodextrin-gel', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=multidex-maltodextrin-gel', 0, 'product', '', 0),
(170, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Normlgel-104', '', 'inherit', 'open', 'open', '', 'normlgel-104', '', '', '2014-12-20 22:51:36', '2014-12-20 22:51:36', '', 171, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_4_104.jpg', 0, 'attachment', 'image/jpeg', 0) ;
INSERT INTO `admedonline_posts` ( `ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(171, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Normlgel is 0.9% Sodium Chloride (NaCl) solution in gel form. It donates moisture to the wound, maintains an optimal moist environment for wound healing and supports autolytic debridment. Normlgel may be used in granulating and open wounds such as pressure ulcers, venous ulcers, arterial leg ulcers, diabetic ulcers, superficial burns (1st and 2nd degree), and open surgical wounds. Normlgel may also be used on wounds covered with dry fibrin.</p> <p><span style="font-size: 12px; line-height: 1.5em;">Secondary dressing required to hold in place.</span></p>', 'Normlgel', '<p>Donates moisture to the wound site for optimal wound healing. </p>', 'publish', 'open', 'open', '', 'normlgel', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=normlgel', 0, 'product', '', 0),
(172, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Deroyal Xeroform Impregnated Gauze-105', '', 'inherit', 'open', 'open', '', 'deroyal-xeroform-impregnated-gauze-105', '', '', '2014-12-20 22:51:37', '2014-12-20 22:51:37', '', 173, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_5_105.jpg', 0, 'attachment', 'image/jpeg', 0),
(173, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A sterile fine mesh gauze impregnated with a blend of 3% Bismuth Tribromophenate (Xeroform) and USP Petrolatum. Non-adherent to wound site. Helps maintain a moist wound environment. 3% Bismuth Tribromophenate (Xeroform) provides deodorizing action. Primary dressing.</p> <p>Requires secondary dressing to hold in place.</p>', 'Deroyal Xeroform Impregnated Gauze', '<p>A sterile fine mesh gauze impregnated with a blend of 3% Bismuth Tribromophenate (Xeroform) and USP Petrolatum. Non-adherent to wound site. Helps maintain a moist wound environment.</p>', 'publish', 'open', 'open', '', 'deroyal-xeroform-impregnated-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=deroyal-xeroform-impregnated-gauze', 0, 'product', '', 0),
(174, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Integrity Xeroform Petrolatum Impregnated Gauze-106', '', 'inherit', 'open', 'open', '', 'integrity-xeroform-petrolatum-impregnated-gauze-106', '', '', '2014-12-20 22:51:37', '2014-12-20 22:51:37', '', 175, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_6_106.jpg', 0, 'attachment', 'image/jpeg', 0),
(175, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Xeroform Impregnated Gauze is a sterile non-adhering primary dressing with 3% Xeroform (Bismuth Tribromophenate) and USP Petrolatum in a blend on a fine mesh gauze. Xeroform Gauze is packaged in convenient peel-open tamper proof packages. Xeroform Gauze is: MEDICATED, mildly deodorizing and it\'s bacteriostatic properties inhibit the growth of bacteria in the wound. NON-ADHERING and a compfortable, soothing hypoallergenic dressing, Xeroform it clings and conforms to the wound without sticking. Occlusive Xeroform Gauze inhibits the loss of body fluids and helps to protect the wound site from contamination. A single layer provides effective coverage. Xeroform has a deodorizing and medicating property that is an ideal dressing for all types of open wounds (cancer resections - burns - donor sites - colostomies - urological - proctological procedures - and all surgical incisions. Can be applied to a non-draining or lightly draining wound. Xeroform Gauze dressings provide a moist environment that is conducive to wound healing.</p>', 'Integrity Xeroform Petrolatum Impregnated Gauze', '<p>Xeroform Impregnated Gauze is a sterile non-adhering primary dressing with 3% Xeroform (Bismuth Tribromophenate) and USP Petrolatum in a blend on a fine mesh gauze. Xeroform Gauze is packaged in convenient peel-open tamper proof packages.</p>', 'publish', 'open', 'open', '', 'integrity-xeroform-petrolatum-impregnated-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=integrity-xeroform-petrolatum-impregnated-gauze', 0, 'product', '', 0),
(176, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mesalt Impregnated Gauze-107', '', 'inherit', 'open', 'open', '', 'mesalt-impregnated-gauze-107', '', '', '2014-12-20 22:51:37', '2014-12-20 22:51:37', '', 177, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_7_107.jpg', 0, 'attachment', 'image/jpeg', 0),
(177, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mesalt supports the cleansing of moderately to heavily discharging wounds including infected wounds. </p> <p>How Mesalt works: The discharge from the wound releases the sodium chloride from the dressing. Mesalt effectively stimulates the cleansing of wounds in the inflammatory phase by absorbing exudate, bacteria and necrotic material from the wound and thereby facilitates the natural wound healing process .Easy application.</p> <p>Areas of use: Mesalt is intended for the management of heavily discharging, discharging infected wounds in the inflammatory phase and deep cavity wounds such as pressure ulcers and surgical wounds. </p> <p>Requires secondary dressings to hold in place.</p>', 'Mesalt Impregnated Gauze', '<p>Mesalt supports the cleansing of moderately to heavily discharging wounds including infected wounds.</p>', 'publish', 'open', 'open', '', 'mesalt-impregnated-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mesalt-impregnated-gauze', 0, 'product', '', 0),
(178, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'DeRoyal Oil Emulsion Dressing-108', '', 'inherit', 'open', 'open', '', 'deroyal-oil-emulsion-dressing-108', '', '', '2014-12-20 22:51:37', '2014-12-20 22:51:37', '', 179, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_8_108.jpg', 0, 'attachment', 'image/jpeg', 0),
(179, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>DeRoyal Oil Emulsion Dressing is a sterile, non-adhering dressing made of knitted cellulose fabric impregnated with an oil emulsion blend. It is used as a primary dressing (goes directly in or on a wound). DeRoyal Oil Emulsion Dressing conforms to the wound site without sticking to fragile healing tissue while helping to maintain a moist wound environment conducive to healing. The knitted cellulose fabric is breathable and allows wound drainage to flow away from the wound site into the absorbent cover dressing thus minimizing maceration or irritation. DeRoyal Oil Emulsion Dressing is ideal for dry to heavily draining wounds.</p> <p>Requires a secondary dressing.</p>', 'DeRoyal Oil Emulsion Dressing', '<p>DeRoyal Oil Emulsion Dressing is a sterile, non-adhering dressing made of knitted cellulose fabric impregnated with an oil emulsion blend. </p>', 'publish', 'open', 'open', '', 'deroyal-oil-emulsion-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=deroyal-oil-emulsion-dressing', 0, 'product', '', 0),
(180, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Petrolatum Impregnated Gauze-109', '', 'inherit', 'open', 'open', '', 'reliamed-petrolatum-impregnated-gauze-109', '', '', '2014-12-20 22:51:38', '2014-12-20 22:51:38', '', 181, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_0_9_109.jpg', 0, 'attachment', 'image/jpeg', 0),
(181, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>White petrolatum properties minimize trauma to the wound. Ideal for Stages II - IV chronic wounds, tunneling wounds and noninfected wounds. Latex-free.</p> <p>www.reliamedproducts.com</p>', 'ReliaMed Petrolatum Impregnated Gauze', '<p>ReliaMed Petrolatum Impregnated Gauze has white petrolatum propertiesthat minimize trauma to the wound.</p>', 'publish', 'open', 'open', '', 'reliamed-petrolatum-impregnated-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-petrolatum-impregnated-gauze', 0, 'product', '', 0),
(182, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Xeroform Impregnated Gauze-110', '', 'inherit', 'open', 'open', '', 'reliamed-xeroform-impregnated-gauze-110', '', '', '2014-12-20 22:51:38', '2014-12-20 22:51:38', '', 183, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_0_110.jpg', 0, 'attachment', 'image/jpeg', 0),
(183, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>ReliaMed Xeroform is a non-adherent dressing for wounds which provides a moist environment conducive to wound healing. The conformable gauze is soft but fine. Reliamed Xeroform is impregnated with 3% bismuth tribromophenate. <span style="font-size: 12px; line-height: 1.5em;"> Removal of these non-adherent dressings causes minimal trauma to both the wound bed and patient. They are the impregnated dressings of choice for applications when mild medication or deodorizing are required. Examples of use include: post operative applications, first and second degree burns and skin grafts.</span></p>', 'ReliaMed Xeroform Impregnated Gauze', '<p>ReliaMed Xeroform is a non-adherent dressing for wounds which provides a moist environment conducive to wound healing. Contains 3% bismuth for mild medication and deodorizing.</p>', 'publish', 'open', 'open', '', 'reliamed-xeroform-impregnated-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-xeroform-impregnated-gauze', 0, 'product', '', 0),
(184, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'SHUR-CONFORM Oil Emulsion Impregnated Gauze-111', '', 'inherit', 'open', 'open', '', 'shur-conform-oil-emulsion-impregnated-gauze-111', '', '', '2014-12-20 22:51:38', '2014-12-20 22:51:38', '', 185, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_1_111.jpg', 0, 'attachment', 'image/jpeg', 0),
(185, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Oil Emulsion impregnated dressings are designed to provide non-adherent dressing for wounds and also provide a moist environment conducive to wound healing. They are made of a knitted cellulose acetate fabric coated with a formulated petrolatum emulsion. The knitted fabric allows wound fluid to move through the dressing and into a secondary absorbent dressing. Oil Emulsion dressings are non-adherent. Removal of these dressings causes minimal trauma to the wound bed and patient. Oil Emulsion dressings are commonly used for the management many types of wounds: skin grafts - surgical sites -abrasions lacerations - dermal ulcers - cosmetic surgery sites. Latex Free.</p> <p>Requires a secondary dressing.</p>', 'SHUR-CONFORM Oil Emulsion Impregnated Gauze', '<p>Oil Emulsion impregnated dressings are designed to provide non-adherent dressing for wounds providing a moist environment conducive to wound healing. They are made of a knitted cellulose acetate fabric coated with a formulated petrolatum emulsion.</p>', 'publish', 'open', 'open', '', 'shur-conform-oil-emulsion-impregnated-gauze', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=shur-conform-oil-emulsion-impregnated-gauze', 0, 'product', '', 0),
(186, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Non-Adherent Wound Dressings-113', '', 'inherit', 'open', 'open', '', 'reliamed-non-adherent-wound-dressings-113', '', '', '2014-12-20 22:51:39', '2014-12-20 22:51:39', '', 187, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_3_113.jpg', 0, 'attachment', 'image/jpeg', 0),
(187, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Absorbent and will not damage tissue by sticking. Ideal for use as primary dressing for lightly draining wounds. Sterile.</p> <p>Requires tape or another secondary dressing to hold in place.</p>', 'ReliaMed Non-Adherent Wound Dressings', '<p>Absorbent yet will not damage tissue by sticking. Ideal for use as primary dressing for lightly draining wounds. Sterile.</p>', 'publish', 'open', 'open', '', 'reliamed-non-adherent-wound-dressings', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-non-adherent-wound-dressings', 0, 'product', '', 0),
(188, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Packing Strips-114', '', 'inherit', 'open', 'open', '', 'reliamed-packing-strips-114', '', '', '2014-12-20 22:51:39', '2014-12-20 22:51:39', '', 189, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_4_114.jpg', 0, 'attachment', 'image/jpeg', 0),
(189, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Can be used dry to absorb drainage in exuding wounds or soaked with a medication of choice. Secondary dressing is required to hold strips in place and protect wounds from outside contaminants. Each bottle has a special patent-pending strip delivery system that ensures packing material is kept clean and tangle-free with the end always easy to locate at the top of the bottle. Latex-free.</p>', 'ReliaMed Packing Strips', '<p>Can be used dry to absorb drainage in exuding wounds or soaked with a medication of choice. Secondary dressing is required to hold strips in place and protect wounds from outside contaminants.</p>', 'publish', 'open', 'open', '', 'reliamed-packing-strips', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-packing-strips', 0, 'product', '', 0),
(190, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Cavilon 3-in-1 Incontinence Care Lotion-115', '', 'inherit', 'open', 'open', '', 'cavilon-3-in-1-incontinence-care-lotion-115', '', '', '2014-12-20 22:51:39', '2014-12-20 22:51:39', '', 191, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_5_115.jpg', 0, 'attachment', 'image/jpeg', 0),
(191, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A no-rinse cleanser moisturizer and barrier in one product. Use for skin care after incontinence or for bathing when skin is fragile or at risk. A complete skin care system in one product. Gently removes contaminants from skin. Reduces caregiver time and effort.</p>', 'Cavilon 3-in-1 Incontinence Care Lotion', '<p>A no-rinse cleanser moisturizer and barrier in one product. Use for skin care after incontinence or for bathing when skin is fragile or at risk.</p>', 'publish', 'open', 'open', '', 'cavilon-3-in-1-incontinence-care-lotion', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=cavilon-3-in-1-incontinence-care-lotion', 0, 'product', '', 0),
(192, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Cavilon Antifungal Cream-116', '', 'inherit', 'open', 'open', '', 'cavilon-antifungal-cream-116', '', '', '2014-12-20 22:51:39', '2014-12-20 22:51:39', '', 193, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_6_116.jpg', 0, 'attachment', 'image/jpeg', 0),
(193, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>An antifungal barrier cream that effectively relieves common skin problems (redness - irritation - scaling - itching - discomfort - burning). This barrier protects against moisture, and the easy-to-spread formula soothes affected areas. Contains Miconazole Nitrate 2%. Enriched with water-repelling ingredients.</p>', 'Cavilon Antifungal Cream', '<p>An antifungal barrier cream that effectively relieves redness, irritation, scaling, itching discomfort and burning. This barrier protects against moisture, and the easy-to-spread formula soothes affected areas.</p>', 'publish', 'open', 'open', '', 'cavilon-antifungal-cream', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=cavilon-antifungal-cream', 0, 'product', '', 0),
(194, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Cavilon Durable Barrier Cream-117', '', 'inherit', 'open', 'open', '', 'cavilon-durable-barrier-cream-117', '', '', '2014-12-20 22:51:39', '2014-12-20 22:51:39', '', 195, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_7_117.jpg', 0, 'attachment', 'image/jpeg', 0),
(195, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Cavilon Durable Barrier Cream is a concentrated and therapeutic cream that provides durable, long-lasting protection from body fluids while it moisturizes the skin. Cavilon resists wash off and therefore, requires less frequent applications. Cavilon cream vanishes into the skin and does not transfer off to briefs or diapers. Contains dimethicone for skin protection.</p>', 'Cavilon Durable Barrier Cream', '<p>Cavilon Durable Barrier Cream is a concentrated and therapeutic cream that provides durable, long-lasting protection from body fluids while it moisturizes the skin</p>', 'publish', 'open', 'open', '', 'cavilon-durable-barrier-cream', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=cavilon-durable-barrier-cream', 0, 'product', '', 0),
(196, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Cavilon Extra Dry Skin Cream-118', '', 'inherit', 'open', 'open', '', 'cavilon-extra-dry-skin-cream-118', '', '', '2014-12-20 22:51:40', '2014-12-20 22:51:40', '', 197, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_8_118.jpg', 0, 'attachment', 'image/jpeg', 0),
(197, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A moisturizing cream ideal for individuals with diabetes or other dry skin conditions. The pH balanced and lipid-rich formula lasts 24 hours to soften and relieve rough or cracked and scaly skin.</p>', 'Cavilon Extra Dry Skin Cream', '<p>A moisturizing cream ideal for individuals with diabetes or other dry skin conditions. The pH balanced lipid-rich formula lasts 24 hours to soften and relieve rough cracked or scaly skin.</p>', 'publish', 'open', 'open', '', 'cavilon-extra-dry-skin-cream', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=cavilon-extra-dry-skin-cream', 0, 'product', '', 0),
(198, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Cavilon No Sting Barrier Swabs-119', '', 'inherit', 'open', 'open', '', 'cavilon-no-sting-barrier-swabs-119', '', '', '2014-12-20 22:51:40', '2014-12-20 22:51:40', '', 199, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_1_9_119.jpg', 0, 'attachment', 'image/jpeg', 0),
(199, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Cavilon No Sting Barrier Swabs contain a sting-free and alcohol-free liquid barrier film that dries quickly to form a breathable and transparent coating on the skin. Cavilon is designed to protect intact or damaged skin (from urine - feces - other body fluids - tape trauma - friction). Cavilon No-Sting is a hypoallergenic and non-cytotoxic liquid film which will not sting even when applied to damaged or denuded skin.  Used for Incontinence skin care, peri-stomal skin protection, peri-wound skin protection, peri-tube skin protection, and adhesive trauma prevention.</p>', 'Cavilon No Sting Barrier Swabs', '<p>Cavilon No Sting Barrier Swabs contain a sting-free alcohol-free liquid barrier film that dries quickly to form a breathable transparent coating on the skin. Cavilon is designed to protect intact or damaged skin from tape trauma and friction as well as urine, feces and other body fluids.</p>', 'publish', 'open', 'open', '', 'cavilon-no-sting-barrier-swabs', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=cavilon-no-sting-barrier-swabs', 0, 'product', '', 0),
(200, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'InterDry Ag-120', '', 'inherit', 'open', 'open', '', 'interdry-ag-120', '', '', '2014-12-20 22:51:40', '2014-12-20 22:51:40', '', 201, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_0_120.jpg', 0, 'attachment', 'image/jpeg', 0) ;
