(201, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>InterDry Ag Textile with Antimicrobial Silver Complex is a skin fold management system specially designed to manage moisture and odor. It will also help prevent inflammation and/or fungus in skin folds and other skin-to-skin contact areas. The textile significantly improves the symptoms associated with intertrigo including maceration, denudement, Inflammation, Itching, satellite lesions.  </p>', 'InterDry Ag', '<p>InterDry Ag Textile with Antimicrobial Silver Complex is a skin fold management system specially designed to manage moisture, odor, fungus  and inflammation in skin folds and other skin-to-skin contact areas. </p>', 'publish', 'open', 'open', '', 'interdry-ag', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=interdry-ag', 0, 'product', '', 0),
(202, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Alcohol Prep Pad-122', '', 'inherit', 'open', 'open', '', 'alcohol-prep-pad-122', '', '', '2014-12-20 22:51:40', '2014-12-20 22:51:40', '', 203, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_2_122.jpg', 0, 'attachment', 'image/jpeg', 0),
(203, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>ReliaMed Alcohol Prep Pads are made for preparation of skin prior to injection. Saturated with 70% isopropyl alcohol for optimum anti-bacterial action: Antiseptic for preparation of skin prior to injection. For individual, professional and hospital use.</p> <p>Four-layer wrapper provides air-tight seal prevents leakage and pad from drying out</p>', 'Alcohol Prep Pad', '<p>Dynarex Alcohol Prep Pads are made for preparation of skin prior to injection. Saturated with 70% isopropyl alcohol for optimum anti-bacterial action.</p>', 'publish', 'open', 'open', '', 'reliamed-alcohol-prep-pad', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-alcohol-prep-pad', 0, 'product', '', 0),
(204, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Sting-Free Protective Barrier Wipes-162', '', 'inherit', 'open', 'open', '', 'reliamed-sting-free-protective-barrier-wipes-162', '', '', '2014-12-20 22:51:40', '2014-12-20 22:51:40', '', 205, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_6_2_162.jpg', 0, 'attachment', 'image/jpeg', 0),
(205, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Quick-drying wipes protect skin from adhesive-stripping body fluids and incontinence without stinging. The wipes form a transparent and protective barrier between skin and moisture for 72 hours. Aids in the prevention of skin maceration.  Alcohol-free.</p>', 'ReliaMed Sting-Free Protective Barrier Wipes', '<p>Quick-drying wipes protect skin from adhesive-stripping body fluids and incontinence without stinging. Using wipes forms a transparent protective barrier between skin and moisture for 72 hours.</p>', 'publish', 'open', 'open', '', 'reliamed-sting-free-protective-barrier-wipes', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-sting-free-protective-barrier-wipes', 0, 'product', '', 0),
(206, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Durapore Cloth Tape-124', '', 'inherit', 'open', 'open', '', 'durapore-cloth-tape-124', '', '', '2014-12-20 22:51:41', '2014-12-20 22:51:41', '', 207, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_4_124.jpg', 0, 'attachment', 'image/jpeg', 0),
(207, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A "silk-like" tape with a latex-free and hypoallergenic adhesive that offers high strength and adhesion. It adheres well to dry skin. This "silk-like" tape is the most economical high-strength, high-adhesion tape. Durapore tape is conformable and has bi-directional tear. It is excellent for immobilization and securing regular and bulky dressings and tubing.</p>', 'Durapore Cloth Tape', '<p>A "silk-like" tape with a latex-free hypoallergenic adhesive that offers high strength and adhesion. It adheres well to dry skin.</p>', 'publish', 'open', 'open', '', 'durapore-cloth-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=durapore-cloth-tape', 0, 'product', '', 0),
(208, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Cloth Tape-125', '', 'inherit', 'open', 'open', '', 'reliamed-cloth-tape-125', '', '', '2014-12-20 22:51:41', '2014-12-20 22:51:41', '', 209, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_5_125.jpg', 0, 'attachment', 'image/jpeg', 0),
(209, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Perfect for securing dressings, catheters and tubing and for repeated applications where preservation of sensitive or at-risk skin is essential. Gentle to skin with moderate stretch to accommodate swelling and movement. Water-resistant.</p>', 'ReliaMed Cloth Tape', '<p>Perfect for securing dressings, catheters and tubing and for repeated applications where preservation of sensitive or at-risk skin is essential. Water-resistant</p>', 'publish', 'open', 'open', '', 'reliamed-cloth-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-cloth-tape', 0, 'product', '', 0),
(210, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Medipore H soft cloth medical tape-126', '', 'inherit', 'open', 'open', '', 'medipore-h-soft-cloth-medical-tape-126', '', '', '2014-12-20 22:51:41', '2014-12-20 22:51:41', '', 211, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_6_126.jpg', 0, 'attachment', 'image/jpeg', 0),
(211, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>3M Medipore H tape is the same as standard Medipore tape soft, atex free , hypoallergenic, conformable tape but with increased gentleness and stronger adhesion for more challenging applications. 3M Medipore H tape is available in perforated rolls. 3M Medipore H tape is a non-woven polyester, soft and highly-conformable tape. It has excellent adhesion yet is gentle to skin and reduces the risk of skin irritation. 3M Medipore H tape is comfortable, porous and breathable and stretches to accommodate swelling and movement. 3M Medipore H tape is perforated so that tape can be torn off the roll by hand. It is easy to handle (with or without gloves). 3M Medipore H tape does not stick to itself and the edges will not curl. Medipore H tape is particularly useful for repeated applications are necessary to secue wound dressings, tubing and catheters  where preservation of "at risk" skin is critical.</p>', 'Medipore H soft cloth medical tape', '<p>3M Medipore H tape is the same soft, latex-free, hypoallergenic, conformable tape as standard Medipore tape but with increased gentleness and stronger adhesion for more challenging applications. 3M Medipore H tape is available in perforated rolls.</p>', 'publish', 'open', 'open', '', 'm-medipore-h-soft-cloth-medical-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=m-medipore-h-soft-cloth-medical-tape', 0, 'product', '', 0),
(212, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Medipore Fabric Tape-127', '', 'inherit', 'open', 'open', '', 'medipore-fabric-tape-127', '', '', '2014-12-20 22:51:41', '2014-12-20 22:51:41', '', 213, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_7_127.jpg', 0, 'attachment', 'image/jpeg', 0),
(213, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Latex-free and hypoallergenic soft cloth tape that offer excellent adhesion yet are gentle to reduce risk of skin irritation.  Medipore tape is a non-woven polyester, soft and highly- conformable tape. It is comfortable, porous and breathable and stretches to accommodate swelling and movement. The tape is perforated so that no scissors are required and is easy to handle ( with or without gloves) without curling edges or sticking to itself. Medipore tape is particularly useful for securing wound dressings, tubing and catheters and repeated applications where preservation of "at risk" skin is critical.</p>', 'Medipore Fabric Tape', '<p>Latex-free, hypoallergenic soft cloth tape that offers excellent adhesion yet are gentle to reduce risk of skin irritation. Available in perforated rolls. </p>', 'publish', 'open', 'open', '', 'medipore-fabric-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=medipore-fabric-tape', 0, 'product', '', 0),
(214, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mefix Fabric Tape-128', '', 'inherit', 'open', 'open', '', 'mefix-fabric-tape-128', '', '', '2014-12-20 22:51:42', '2014-12-20 22:51:42', '', 215, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_8_128.jpg', 0, 'attachment', 'image/jpeg', 0),
(215, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Mefix Fabric ape  is skin-friendly and has perforated split in protection paper for easy handling. This tape has a waterbased and solvent-free polyacrylate adhesive for secure and gentle fixation, is soft, elastic, nonabsorbent and nonwoven for patient comfort.,</p> <p><span style="font-size: 12px; line-height: 1.5em;">Areas of use - Mefix can be used in a wide variety of situations where fixation is required (including fixation of dressings - swabs - catheters - tubes). How Mefix works - The porous structure of the nonwoven fabric ensures air and water vapour permeability. The fabric is flexible and confirms well to body contours. It allows body movements when in place. The fabric is non-absorbent and provides a barrier for blood and fluid strike-through. The easy-to-remove protection paper is pre-measured in 10 cm intervals and has a perforated split for easy removal and application. Mefix can easily be cut to the desired shape and size.</span></p>', 'Mefix Fabric Tape', '<p>Mefix Fabric Tape has a waterbased, solvent-free polyacrylate adhesive for skin-friendly, secure and gentle fixation.</p>', 'publish', 'open', 'open', '', 'mefix-fabric-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mefix-fabric-tape', 0, 'product', '', 0),
(216, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', '3M\'s Micropore Surgical Tape-129', '', 'inherit', 'open', 'open', '', '3ms-micropore-surgical-tape-129', '', '', '2014-12-20 22:51:42', '2014-12-20 22:51:42', '', 217, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_2_9_129.jpg', 0, 'attachment', 'image/jpeg', 0),
(217, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>3M\'s Micropore Surgical Tape is a latex-free, hypoallergenic paper tape that is ideal for frequent dressing changes. Upon removal, minimal adhesion is left behind which reduces the potential for irritation. This surgical tape is porous for breathability and improved healing.</p>', '3M\'s Micropore Surgical Tape', '<p>3M\'s Micropore Surgical Tape is a latex-free, hypoallergenic paper tape that is ideal for frequent dressing changes. Upon removal, minimal adhesion is left behind reducing the potential for irritation.</p>', 'publish', 'open', 'open', '', '3m-s-micropore-surgical-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=3m-s-micropore-surgical-tape', 0, 'product', '', 0),
(218, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Paper Tape-130', '', 'inherit', 'open', 'open', '', 'reliamed-paper-tape-130', '', '', '2014-12-20 22:51:42', '2014-12-20 22:51:42', '', 219, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_0_130.jpg', 0, 'attachment', 'image/jpeg', 0),
(219, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</p>', 'ReliaMed Paper Tape', '<p>ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</p>', 'publish', 'open', 'open', '', 'reliamed-paper-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-paper-tape', 0, 'product', '', 0),
(220, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', '3M Kind Removal Silicone Tape-131', '', 'inherit', 'open', 'open', '', '3m-kind-removal-silicone-tape-131', '', '', '2014-12-20 22:51:42', '2014-12-20 22:51:42', '', 221, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_1_131.jpg', 0, 'attachment', 'image/jpeg', 0),
(221, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>3M Kind Removal Tape offers comfortable application and gentle removal along with secure adhesion making it ideal for patients with sensitive and compromised or at-risk skin. Better for all patients whose treatment requires medical tape. </p>', '3M Kind Removal Silicone Tape', '<p>3M Kind Removal Silicone Tape has comfortable application and gentle removal along with secure adhesion for patients with sensitive and compromised or at-risk skin.</p>', 'publish', 'open', 'open', '', '3m-kind-removal-silicone-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=3m-kind-removal-silicone-tape', 0, 'product', '', 0),
(222, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', '3M Transpore Surgical Tape-155', '', 'inherit', 'open', 'open', '', '3m-transpore-surgical-tape-155', '', '', '2014-12-20 22:51:47', '2014-12-20 22:51:47', '', 223, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_5_5_155.jpg', 0, 'attachment', 'image/jpeg', 0),
(223, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Transpore is a latex-free, hypoallergenic, transparent and perforated plastic tape that offers strong adhesion. Transpore tape is easy to tear into very thin strips and is easy to use even with gloves. Features and Benefits:Transpore tape is easy to handle with gloves.  Good adhesive to skin and tubing for secure placement: Transpore tape is transparent for easy monitoring: Latex-free and hypoallergenic for sensitive patients: Water-resistant.</p>', '3M Transpore Surgical Tape', '<p>Transpore is a latex-free, hypoallergenic, transparent and perforated plastic tape that offers strong adhesion. Transpore tape is easy to tear into very thin strips and is easy to use even with gloves.</p>', 'publish', 'open', 'open', '', '3m-transpore-surgical-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=3m-transpore-surgical-tape', 0, 'product', '', 0),
(224, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Transparent Tape-133', '', 'inherit', 'open', 'open', '', 'reliamed-transparent-tape-133', '', '', '2014-12-20 22:51:48', '2014-12-20 22:51:48', '', 225, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_3_133.jpg', 0, 'attachment', 'image/jpeg', 0),
(225, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Ideal for securing catheters and tubing or anchoring bulky dressings.Easy to handle. Permits straight and bi-directional tearing: Adheres well to both tubing and skin.: Porous transparent and hypoallergenic.  Water-resistant.</p>', 'ReliaMed Transparent Tape', '<p>Ideal for securing catheters and tubing or anchoring bulky dressings.</p>', 'publish', 'open', 'open', '', 'reliamed-transparent-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-transparent-tape', 0, 'product', '', 0),
(226, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Hy-Tape-134', '', 'inherit', 'open', 'open', '', 'hy-tape-134', '', '', '2014-12-20 22:51:48', '2014-12-20 22:51:48', '', 227, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_4_134.jpg', 0, 'attachment', 'image/jpeg', 0),
(227, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Zinc oxide based adhesive formula is soothing to delicate skin. Tape removes with minimum trauma to the skin. Reduces the chance of skin tears and tape burns. LATEX-FREE .</p> <p>SKIN FRIENDLY - Zinc oxide based adhesive formula is soothing to delicate skin. Tape removes with minimum trauma to the skin. Reduces the chance of skin tears and tape burns. GENTLE ADHESIVE - Hy-Tape\'s protective nature is perfect for extended-wear use. Adheres to wet or oily or even hairy skin. Leaves little or no residue after adhesive has been removed. CONFORMABILITY - Thin and flexible and elastic. Hy-Tape conforms easily to body contours. Accommodates underlying tissue expansion or shrinkage. WATERPROOF AND WASHABLE - Waterproof and washable. Provides security even when exposed to moisture. Can be applied to wet or oily skin without slipping or detaching. Wipes clean with soap and water. OCCLUSIVE - Resists soiling from secretions.</p>', 'Hy-Tape', '<p>Zinc oxide-based adhesive formula is soothing to delicate skin. Tape removes with minimum trauma to the skin. Reduces the chance of skin tears and tape burns.</p>', 'publish', 'open', 'open', '', 'hy-tape', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=hy-tape', 0, 'product', '', 0),
(228, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Coban Self-Adherent Wrap-135', '', 'inherit', 'open', 'open', '', 'coban-self-adherent-wrap-135', '', '', '2014-12-20 22:51:48', '2014-12-20 22:51:48', '', 229, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_5_135.jpg', 0, 'attachment', 'image/jpeg', 0),
(229, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Coban self-adherent wrap is a laminate of nonwoven material and elastic fibers placed lengthwise to provide elasticity. The Coban elastic wrap contains a cohesive material that makes it stick to itself but not to other materials or skin.</p> <p>Caution: This Product Contains Natural Rubber Latex Which May Cause Allergic Reactions.</p>', 'Coban Self-Adherent Wrap', '<p>Coban is self-adherent elastic wrap that functions like a tape but sticks only to itself. </p>', 'publish', 'open', 'open', '', 'coban-self-adherent-wrap', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=coban-self-adherent-wrap', 0, 'product', '', 0),
(230, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'MediBrief-136', '', 'inherit', 'open', 'open', '', 'medibrief-136', '', '', '2014-12-20 22:51:48', '2014-12-20 22:51:48', '', 231, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_6_136.jpg', 0, 'attachment', 'image/jpeg', 0),
(231, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Cool and breathable mesh of 84% polyester and 16% spandex. Holds their shape for use with both ambulatory and bedridden patients. Designed to be used with any kind of liner or treatment application including as a tapeless retention for wound care dressings. Reusable,  disposable and <strong>Latex-Free</strong>.</p> <p>Color coded stitching indicates size:</p> <p>XLarge: Green - Waist circumference 26" relaxed to 62" stretched/let opening to 28".</p> <p>2X: Purple - Waist circumference 28" relaxed to 74" stretched/let opening to 28".</p> <p>3X: Blue - Waist circumference 30" relaxed to 82" stretched/let opening to 28".</p> <p>4X: White - Waist circumference 32" relaxed to 86" stretched/let opening to 28".</p>', 'MediBrief', '<p>Cool breathable mesh of 84% polyester and 16% spandex. Holds its shape for use with both ambulatory and bedridden patients. Designed to be used with any kind of liner or treatment application, including as a tapeless retention for wound care dressings. Reusable Disposable and Latex-Free.</p>', 'publish', 'open', 'open', '', 'medibrief', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=medibrief', 0, 'product', '', 0),
(232, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Reliamed Tubular Elastic Stretch Net Dressing Retention-137', '', 'inherit', 'open', 'open', '', 'reliamed-tubular-elastic-stretch-net-dressing-retention-137', '', '', '2014-12-20 22:51:49', '2014-12-20 22:51:49', '', 233, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_7_137.jpg', 0, 'attachment', 'image/jpeg', 0),
(233, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>This is constructed from high-quality nylon and rubber mix which is knitted in a seamless band. Secures dressings in place without adhesive while applying gentle pressure. Features strong elasticity and can be cut for a customized size without unraveling. Its smooth surface increases patient comfort.</p>', 'Reliamed Tubular Elastic Stretch Net Dressing Retention', '<p>Secures dressings in place without adhesive while applying gentle pressure. Features strong elasticity and can be cut for a customized size without unraveling.</p>', 'publish', 'open', 'open', '', 'reliamed-tubular-elastic-stretch-net-dressing-retention', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-tubular-elastic-stretch-net-dressing-retention', 0, 'product', '', 0),
(234, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Easy Wrap Elastic Bandage with Velcro-220', '', 'inherit', 'open', 'open', '', 'easy-wrap-elastic-bandage-with-velcro-220', '', '', '2014-12-20 22:51:49', '2014-12-20 22:51:49', '', 235, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_2_2_0_220.jpg', 0, 'attachment', 'image/jpeg', 0),
(235, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Elastic bandages made of cotton/poly blend yarn are breathable, durable and absorbent and will stretch up to 210 percent without loss of elasticity. Bandage ends are scalloped and rolled to help prevent "roll" and venous tourniquet effect.</p>', 'Easy Wrap Elastic Bandage with Velcro', '<p>Elastic bandages made of cotton/poly blend yarn are breathable, durable and absorbent and will stretch up to 210 percent without loss of elasticity. Bandage ends are scalloped and rolled to help prevent "roll" and venous tourniquet effect.</p>\r\n<ul>\r\n<li>Latex-free bandages include a center honey-colored stripe and teal end-stitching self-closure that replaces clips and an exclusive knit design that provides comfortable, controlled and consistent compression.</li>\r\n<li>The single-strip closure eliminates the need for clips.</li>\r\n</ul>\r\n<p> </p>', 'publish', 'open', 'open', '', 'reliamed-easy-wrap-elastic-bandage-with-velcro', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-easy-wrap-elastic-bandage-with-velcro', 0, 'product', '', 0),
(236, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Reliamed Self-Adhering Wrap-139', '', 'inherit', 'open', 'open', '', 'reliamed-self-adhering-wrap-139', '', '', '2014-12-20 22:51:49', '2014-12-20 22:51:49', '', 237, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_3_9_139.jpg', 0, 'attachment', 'image/jpeg', 0),
(237, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Easy-Tear Cohesive Bandages protect and secure pads, dressings and IVs and provides compression and edema control. Promotes circulation and healing for sprains and strains. Self-adhesive, and won\'t stick to hair or skin. Water resistant. Reliamed Easy-Tear Cohesive Bandages are made of comfortable and lightweight material that allows the skin to breathe. They tear easily by hand and can be used for a variety of applications.</p>', 'Reliamed Self-Adhering Wrap', '<p>Easy-Tear Cohesive Bandages protect and secures pads, dressings and IVs and provides compression and edema control. Promotes circulation and healing for sprains and strains. Self-adhesive, but won\'t stick to hair or skin.</p>', 'publish', 'open', 'open', '', 'reliamed-self-adhering-wrap', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-self-adhering-wrap', 0, 'product', '', 0),
(238, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Spandage-140', '', 'inherit', 'open', 'open', '', 'spandage-140', '', '', '2014-12-20 22:51:49', '2014-12-20 22:51:49', '', 239, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_0_140.jpg', 0, 'attachment', 'image/jpeg', 0),
(239, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Use Spandage to secure a dressing without tape.  An open-webbed tubular retainer net composed of latex-free elastic and polyester fibers. It is specifically indicated for patients with fragile skin and allergies to adhesive tape. An open-webbed tubular retainer net composed of latex-free elastic and polyester fibers. It is specifically indicated for patients with fragile skin and allergies to adhesive tape. Spandage is very effective when used for burn care surgery post-op dressing changes donor wound graft sites and daily dressing changes. Spandage eliminates the need for adhesive tapes. No more tape residue remaining on the skin and no more expensive inventory of hypoallergenic tapes Spandage simply contours itself with the body\'s natural curves.</p> <p>Tape free bandage holds dressings in place so the patient may resume normal activity while reducing discomfort and swelling.</p> <p>Spandage is available in 25-yard cut-to-fit dispensers. :: LATEX FREE :: REPLACES ADHESIVE TAPE &amp; WRAP GAUZE :: HOLDS BOTH WET &amp; DRY DRESSINGS FIRMLY IN PLACE.</p> <p>It is highly recommended that you contact our office for assistance in ordering proper sizes. Additional styles and sizes available by request - see size chart</p>', 'Spandage', '<p>Use Spandage to secure a dressing without tape.  Unique open-webbed tubular retainer net composed of LATEX FREE elastic and polyester fibers. It is specifically indicated for patients with fragile skin and allergies to adhesive tape. Many sizes available for perfect fit up to 80" circumference.</p>', 'publish', 'open', 'open', '', 'spandage', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=spandage', 0, 'product', '', 0),
(240, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Kendall TELFA Non-Adherent Dressings-141', '', 'inherit', 'open', 'open', '', 'kendall-telfa-non-adherent-dressings-141', '', '', '2014-12-20 22:51:50', '2014-12-20 22:51:50', '', 241, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_1_141.jpg', 0, 'attachment', 'image/jpeg', 0),
(241, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Kendall TELFA Non-Adherent Dressings will not disrupt healing tissue by sticking to wound. Ideal as a primary dressing for lightly draining wounds</p> <p>Requires a secondary dressing or tape to hold in place.</p>', 'Kendall TELFA Non-Adherent Dressings', '<p>Kendall TELFA  Non-Adherent Dressings. Will not disrupt healing tissue by sticking to wound. Ideal as a primary dressing for lightly draining wounds. </p>', 'publish', 'open', 'open', '', 'kendall-telfa-ouchless-non-adherent-dressings', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=kendall-telfa-ouchless-non-adherent-dressings', 0, 'product', '', 0),
(242, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Mepore Film-142', '', 'inherit', 'open', 'open', '', 'mepore-film-142', '', '', '2014-12-20 22:51:50', '2014-12-20 22:51:50', '', 243, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_2_142.jpg', 0, 'attachment', 'image/jpeg', 0),
(243, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Breathable transparent self-adhesiveMepore Film is a transparent self-adhesive film dressing ideal as secondary fixation dressing and as primary dressing for a wide range of clean wounds. Mepore Film\'s application system is designed for ease-of-use. Mepore Film provides a flexible and transparent covering to protect the wound and conforms to surface irregularities and body contours. The film provides a barrier to fluid strike-through and viral and bacterial contamination. Mepore Film maintains a moist environment in the wound and allows excess moisture to pass away from the wound and surrounding skin because of its high vapor permeability</p> <p>Benefits: Supporting protection foil and paper frame for ease of application transparent and breathable and elastic polyurethane film for patient comfort and optimized wound healing. <span style="font-size: 12px; line-height: 1.5em;">Has a skin-friendly adhesive for gentle, secure fixation. This viral and bacteria-proof film is </span><span style="font-size: 12px; line-height: 1.5em;">impermeable to fluids for a safe and protective healing environment.</span></p>', 'Mepore Film', '<p>Breathable, transparent self-adhesive film dressing Mepore Film is  ideal as secondary fixation dressing and as primary dressing for a wide range of clean wounds. Mepore Film\'s application system is designed for ease-of-use.</p>', 'publish', 'open', 'open', '', 'mepore-film', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=mepore-film', 0, 'product', '', 0),
(244, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Transparent Film Dressings-143', '', 'inherit', 'open', 'open', '', 'reliamed-transparent-film-dressings-143', '', '', '2014-12-20 22:51:50', '2014-12-20 22:51:50', '', 245, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_3_143.jpg', 0, 'attachment', 'image/jpeg', 0),
(245, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Semi-permeable and sterile polyurethane film with non-sensitizing adhesive. Impervious barrier to moisture and dust and bacteria. Permeable to water vapor. Allows for easy and one-handed application. Features a high moisture vapor transmission rate and a smooth finish to reduce shear friction to surrounding skin. Secures and protects I.V. catheter sites. Design is ideal as a secondary wound dressing. For use with low exuding wounds and superficial pressure ulcers and closed surgical wounds. Acts as a protective wound dressing on minor abrasions. Protects against skin breakdown.</p>', 'ReliaMed Transparent Film Dressings', '<p>Semi-permeable sterile polyurethane film with non-sensitizing adhesive.</p>', 'publish', 'open', 'open', '', 'reliamed-transparent-film-dressings', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-transparent-film-dressings', 0, 'product', '', 0),
(246, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Tegaderm T-Film Frame Style-144', '', 'inherit', 'open', 'open', '', 'tegaderm-t-film-frame-style-144', '', '', '2014-12-20 22:51:50', '2014-12-20 22:51:50', '', 247, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_4_144.jpg', 0, 'attachment', 'image/jpeg', 0),
(247, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>3M Tegaderm Transparent Film Wound Dressing is a transparent film dressing primarily designed for protecting skin and wound sites. It can also be used to cover and secure I.V. sites or used as a secondary dressing over acute wounds and surgical sites and chronic wounds. Frame style allows customization of shape and size to fit any site and a delivery system that makes placement quick and easy. This waterproof yet breathable film dressing provides a bacterial and viral barrier to outside contaminants and allows the patient to shower.</p>', 'Tegaderm T-Film Frame Style', '<p>3M Tegaderm Transparent Film Wound Dressing is a transparent film dressing primarily designed for protecting skin and wound sites. The frame style allows for quick and easy placement.</p>', 'publish', 'open', 'open', '', 'tegaderm-t-film-frame-style', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=tegaderm-t-film-frame-style', 0, 'product', '', 0),
(248, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Transeal Wound Dressing-145', '', 'inherit', 'open', 'open', '', 'transeal-wound-dressing-145', '', '', '2014-12-20 22:51:51', '2014-12-20 22:51:51', '', 249, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_5_145.jpg', 0, 'attachment', 'image/jpeg', 0),
(249, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>TRANSEAL Wound Dressing is a transparent polyurethane film coated with an acrylic pressure-sensitive adhesive that acts like a second skin to help control the environment in which the wound will heal. TRANSEAL is highly permeable to gases and moisture vapor which allows the skin to breathe and moisture to transmit from the site. It is impermeable to water and bacteria. TRANSEAL has an easy and two-step delivery system. TRANSEAL uses a carrier film that maintains the integrity of the dressing and ensures proper application every time. The carrier film is transparent which allows for accurate positioning over the wound site. It can be used as a tracing device to document wound measurements. TRANSEAL has been developed to have a very high moisture vapor transmission rate. A high MVTR will reduce the pooling of drainage under the film that can cause infection at the site or maceration of the peri-wound skin. TRANSEAL will allow moisture to transmit from the wound site at a faster rate but will keep the site moist enough to maintain an environment conducive to healing.</p>', 'Transeal Wound Dressing', '<p>TRANSEAL Wound Dressing is a transparent polyurethane film coated with an acrylic pressure-sensitive adhesive that acts like a second skin in controlling the environment for optimal healing. Impermeable to water and bacteria.</p>', 'publish', 'open', 'open', '', 'transeal-wound-dressing', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=transeal-wound-dressing', 0, 'product', '', 0),
(250, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Hibiclens-146', '', 'inherit', 'open', 'open', '', 'hibiclens-146', '', '', '2014-12-20 22:51:51', '2014-12-20 22:51:51', '', 251, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_6_146.jpg', 0, 'attachment', 'image/jpeg', 0),
(251, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Hibiclens kills MRSA, C. diff (in its vegetative state) and other pathogens that are common causes of infection and diseases. Hibiclens the antimicrobial antiseptic skin cleanser can be an effective defense for preventing the spread of MRSA and other staph infections. Its active ingredient CHG5 kills germs on contact and bonds with the skin to eliminate microorganisms.</p>', 'Hibiclens', '<p>Hibiclens kills MRSA, VRE and  C. diff (in its vegetative state) and other pathogens that are common causes of infection and diseases.</p>', 'publish', 'open', 'open', '', 'hibiclens', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=hibiclens', 0, 'product', '', 0),
(252, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'ReliaMed Wound and Skin Cleanser-147', '', 'inherit', 'open', 'open', '', 'reliamed-wound-and-skin-cleanser-147', '', '', '2014-12-20 22:51:51', '2014-12-20 22:51:51', '', 253, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_7_147.jpg', 0, 'attachment', 'image/jpeg', 0),
(253, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>Nontoxic pH-balanced and nonirritating wound cleanser gently removes debris and dressing residue from the wound bed. It does not require scrubbing or rinsing. Ideal for all types of wounds (stage I - IV pressure ulcers - stasis ulcers - diabetic ulcers - postsurgical wounds - first and second degree burns - abrasions and minor skin irritations).</p>', 'ReliaMed Wound and Skin Cleanser', '<p>Nontoxic pH-balanced and nonirritating wound cleanser gently removes debris and dressing residue from the wound bed. It does not require scrubbing or rinsing. Ideal for all types of wounds.</p>', 'publish', 'open', 'open', '', 'reliamed-contact-care-cleanser', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-contact-care-cleanser', 0, 'product', '', 0),
(254, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Algidex Ag Paste-148', '', 'inherit', 'open', 'open', '', 'algidex-ag-paste-148', '', '', '2014-12-20 22:51:51', '2014-12-20 22:51:51', '', 255, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_8_148.jpg', 0, 'attachment', 'image/jpeg', 0),
(255, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A major breakthrough in delivery of a proven antimicrobial. Unique combination of silver and alginate and maltodextrin designed to create the optimal moist wound environment important to healing. Provides immediate and sustained antimicrobial activity against a broad spectrum of wound pathogens for up to seven days including methicillin-resistant Staphylococcus aureus (MRSA) Staphylococcus aureus and Pseudomonas aeruginosa and E. Coli.</p>', 'Algidex Ag Paste', '<p>Unique combination of silver alginate and maltodextrin designed to create the optimal moist wound environment important to healing.</p>', 'publish', 'open', 'open', '', 'algidex-ag-paste', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=algidex-ag-paste', 0, 'product', '', 0),
(256, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 'Multidex Hydrophilic Powder-149', '', 'inherit', 'open', 'open', '', 'multidex-hydrophilic-powder-149', '', '', '2014-12-20 22:51:52', '2014-12-20 22:51:52', '', 257, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_4_9_149.jpg', 0, 'attachment', 'image/jpeg', 0),
(257, 1, '2013-04-10 17:42:24', '2013-04-10 17:42:24', '<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote the growth of granulation tissue and epithelial proliferation in moist and wet wounds. It will rapidly mix with exudate to form a protective coating that maintains an ideal moisture balance to protect against dehydration.  For use on all wound types especially infected hard-to-heal wounds. Specifically formulated to provide topical nutrients to wound sites. Non-toxic and not systemically absorbed. Controls odor while decreasing purulent exudate, penetrates all wound irregularities to fill tunneling and undermining, and softens necrotic tissue to facilitate debridement. Primary dressing.</p> <p>Secondary dressing required to hold in place.</p>', 'Multidex Hydrophilic Powder', '<p>A hydrophilic Maltodextrin NF wound dressing clinically proven to promote the growth of granulation tissue and epithelial proliferation in moist and wet wounds.</p>', 'publish', 'open', 'open', '', 'multidex-hydrophilic-powder', '', '', '2013-04-10 17:42:24', '2013-04-10 17:42:24', '', 0, 'http://admedonline.com/wordpress/?product=multidex-hydrophilic-powder', 0, 'product', '', 0),
(258, 1, '2013-04-26 01:12:17', '2013-04-26 01:12:17', '', 'Silverlon Acute Burn Gloves-156', '', 'inherit', 'open', 'open', '', 'silverlon-acute-burn-gloves-156', '', '', '2014-12-20 22:51:52', '2014-12-20 22:51:52', '', 259, 'http://admedonline.com/wordpress/wp-content/uploads/2013/04/p_1_5_6_156.jpg', 0, 'attachment', 'image/jpeg', 0),
(259, 1, '2013-04-26 01:12:17', '2013-04-26 01:12:17', '<p><span>Silverlon</span><span> Acute Burn Gloves have open fingers and are oversized 20% for use immediately after acute injury or post surgery for both partial to full thickness burns. They offer broad antimicrobial protection to often hard to dress parts of the hand. </span><br /><br /><span>Silverlon</span><span> Acute Burn Gloves are designed for use immediately after acute injury or post surgery of the hands. The Burn Gloves provide for quick and easy dressing applications to fingers and hands. Silverlon</span><span> Acute Burn Gloves are offered in  sizes to fit virtually all hands: </span><span style="font-size: 12px; line-height: 1.5em;">Pediatric, Small, Medium, Large</span></p> <p><br /><span>The Silverlon</span><span> Acute Burn Glove is indicated for 1st and 2nd Degree Burns, Partial and Full-thickness Wounds, Donor and Graft Sites, Acute Wounds, Lacerations, Abrasions, Traumatic Wounds, Surgical Wounds, Dehisced Wounds, Pressure Ulcers, Diabetic Ulcers, and Venous Ulcers. Silverlon</span><span> Burn Gloves are currently used in Burn Treatment Centers and Hospitals throughout the USA and Canada.</span></p>', 'Silverlon Acute Burn Gloves', '<p>Silverlon<span style="font-size: xx-small;"> </span>Acute Burn Gloves have open fingers and are oversized 20% for use immediately after acute injury or post surgery for both partial to full thickness burns. They offer broad antimicrobial protection to hard-to-dress parts of the hand.</p>', 'publish', 'open', 'open', '', 'silverlon-acute-burn-gloves', '', '', '2013-04-26 01:12:17', '2013-04-26 01:12:17', '', 0, 'http://admedonline.com/wordpress/?product=silverlon-acute-burn-gloves', 0, 'product', '', 0),
(260, 1, '2013-05-05 13:11:06', '2013-05-05 13:11:06', '', 'ReliaMed Composite Barrier Dressing  -212', '', 'inherit', 'open', 'open', '', 'reliamed-composite-barrier-dressing-212', '', '', '2014-12-20 22:51:52', '2014-12-20 22:51:52', '', 261, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_2_1_2_212.jpg', 0, 'attachment', 'image/jpeg', 0),
(261, 1, '2013-05-05 13:11:06', '2013-05-05 13:11:06', '<p>Sterile individually sealed 100% cotton <strong>non-adherent</strong> island pad absorbs exudate for a cleaner wound bed. Nonwoven adhesive cover has rounded edges to prevent detachment. Waterproof top film layer prevents fluid from passing through the dressing but is breathable to allow for moisture vapor transmission. <strong>Wide adhesive border</strong> ensures excellent adhesion. Latex- free.</p> <p>Can be used as a primary or secondary dressing.</p>', 'ReliaMed Composite Barrier Dressing', '<p>Sterile individually sealed 100% cotton non-adherent island pad absorbs exudate for a cleaner wound bed. Waterproof top film has rounded edges to prevent detachment. Has wide adhesive border to ensure excellent adhesion.</p>', 'publish', 'open', 'open', '', 'reliamed-composite-barrier-dressing-2', '', '', '2013-05-05 13:11:06', '2013-05-05 13:11:06', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-composite-barrier-dressing-2', 0, 'product', '', 0),
(262, 1, '2013-05-06 23:18:48', '2013-05-06 23:18:48', '', 'BIOGARD  Antimicrobial Gauze Sponges-208', '', 'inherit', 'open', 'open', '', 'biogard-antimicrobial-gauze-sponges-208', '', '', '2014-12-20 22:51:53', '2014-12-20 22:51:53', '', 263, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_2_0_8_208.jpg', 0, 'attachment', 'image/jpeg', 0),
(263, 1, '2013-05-06 23:18:48', '2013-05-06 23:18:48', '<p><span>Biogard roll conforming gauze features a novel cationic biocide that kills pathogens within the dressing and provides a barrier to bacterial penetration.  These dressings provide protection  from external contaminants, a reduction in bacteria and other pathogens from wound fluid, and also protect against cross-contamination to the caregiver during dressing changes.</span></p>', 'BIOGARD  Antimicrobial Gauze Sponges', '<p>Conforming bandage features a biocide that kills pathogens within the dressing and protects against outside contaminants.</p>', 'publish', 'open', 'open', '', 'biogard-antimicrobial-gauze-sponges', '', '', '2013-05-06 23:18:48', '2013-05-06 23:18:48', '', 0, 'http://admedonline.com/wordpress/?product=biogard-antimicrobial-gauze-sponges', 0, 'product', '', 0),
(264, 1, '2013-05-09 02:20:20', '2013-05-09 02:20:20', '', 'Anasept Gel and Bordered Gauze-164', '', 'inherit', 'open', 'open', '', 'anasept-gel-and-bordered-gauze-164', '', '', '2014-12-20 22:51:53', '2014-12-20 22:51:53', '', 266, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_1_6_4_164.jpg', 0, 'attachment', 'image/jpeg', 0),
(265, 1, '2013-05-09 02:20:20', '2013-05-09 02:20:20', '', 'Anasept Gel and Bordered Gauze-165', '', 'inherit', 'open', 'open', '', 'anasept-gel-and-bordered-gauze-165', '', '', '2014-12-20 22:51:53', '2014-12-20 22:51:53', '', 266, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_1_6_5_165.jpg', 0, 'attachment', 'image/jpeg', 0),
(266, 1, '2013-05-09 02:20:20', '2013-05-09 02:20:20', '<p> <strong style="font-size: 12px; line-height: 1.5em;">Anasept 3oz.</strong></p> <p>Anasept Antimicrobial Skin and Wound Gel is an extremely safe topical hydrogel with exceptionally rapid broad spectrum bactericidal and fungicidal and virucidal properties. Anasept Gel rapidly eliminates antibiotic-resistant strains MRSA and VRE and other dangerous micro-organisms.</p> <p>Anasept Gel may be used for the following wound types: pressure ulcers (stage I-IV) , cuts and abrasions, surgical incisions/wounds, diabetic foot ulcers,  first and second degree burn, venous stasis ulcers, grafted wounds, and donor sites. Anasept Gel may be used for irritated skin or rashes.</p> <p>Anasept <span>Antimicrobial Skin and Wound Gel is indicated for use by Health Care Professionals in the management of wounds.</span></p> <p>For more information view</p> <p><a title="Anasept gel" href="http://admedonline.com/wound-care/80-anasept-gel.html">Anasept Gel</a></p> <p><strong>30 4" x 4" Bordered Gauze - </strong><span style="font-size: 12px; line-height: 1.5em;">Non-adherent contact layer with absorbent 100% cotton pad covered with an adhesive-coated nonwoven tape overlay. Latex-free.</span></p> <p>For more information view</p> <p><a title="Reliamed Bordered Gauze" href="http://admedonline.com/wound-care/59-reliamed-bordered-gauze.html">ReliaMed Bordered Gauze</a></p> <p><strong><br /></strong></p>', 'Anasept Gel and Bordered Gauze', '<p>3oz tube of Anasept Gel and 30 4x4 bordered gauze. Rapid elimination of bacteria, virus, fungus including MRSA.</p>', 'publish', 'open', 'open', '', 'anasept-gel-and-bordered-gauze', '', '', '2013-05-09 02:20:20', '2013-05-09 02:20:20', '', 0, 'http://admedonline.com/wordpress/?product=anasept-gel-and-bordered-gauze', 0, 'product', '', 0),
