(273, 1, '2013-05-09 09:55:16', '2013-05-09 09:55:16', '<p>4" x 10" stretched finished with selvage edges and packaged in a vacuum-sealed plastic pouch for longer shelf life.   Indicated for the management of venous leg ulcers, venous edema and minor lower extremity trauma injuries.  </p> <p><span>FOR PROFESSIONAL USE ONLY.</span></p>', 'Unna Boot', '<p>4" x 10" stretched finished with selvage edges and packaged in a vacuum-sealed plastic pouch for longer shelf life.   Indicated for the management of venous leg ulcers, venous edema and minor lower extremity trauma injuries.  <span style="font-size: 12px; line-height: 1.5em;">FOR PROFESSIONAL USE ONLY.</span></p>', 'publish', 'open', 'open', '', 'unna-boot', '', '', '2013-05-09 09:55:16', '2013-05-09 09:55:16', '', 0, 'http://admedonline.com/wordpress/?product=unna-boot', 0, 'product', '', 0),
