(276, 1, '2013-05-09 23:08:29', '2013-05-09 23:08:29', '<div id="c1234" class="csc-default"> <div class="csc-textpic csc-textpic-intext-left-nowrap"> <div class="csc-textpic-text"> <p><span style="font-size: 12px; line-height: 1.5em;">Sorbact  is an bacteria-binding, non-adhesive absorbent wound dressing.  Used to eliminate infection, it consists of a hydroactive, highly absorbent hydropolymer matrix with an bacteria-binding Sorbact mesh (Sorbact acetate fabric coated with dialkyl carbamoyl chloride) covered by a semipermeable polyurethane film. The product is packaged along with a calcium alginate to absorb excess exudate in infected wounds of all kinds.</span></p> </div> </div> </div> <div id="c1235" class="csc-default"> <p class="bodytext"><span style="font-size: 12px; line-height: 1.5em;">Sorbact  is indicated for contaminated, colonized or infected wounds with low to high exudate levels, such as chronic wounds (venous and arterial ulcers, diabetic ulcers, and pressure ulcers), postoperative dehisced wounds and traumatic wounds.</span></p> </div> <p>Requires a secondary dressing to hold in place.</p>', 'Sorbact + Alginate System', '<p>Sorbact is a unique "green" dressing that eliminates infection in wounds without the use of silver.</p>', 'publish', 'open', 'open', '', 'sorbact-alginate-system', '', '', '2013-05-09 23:08:29', '2013-05-09 23:08:29', '', 0, 'http://admedonline.com/wordpress/?product=sorbact-alginate-system', 0, 'product', '', 0),
