(278, 1, '2013-05-12 11:25:58', '2013-05-12 11:25:58', '<p>Kendall™ Foam Dressing is an ultra-soft hydrophilic foam that protects and cushions wounds. Small pores decrease the chance of tissue migration into the foam dressing.</p>', 'Copa Foam', '<p><span>Kendall™ Foam Dressing is an ultra-soft hydrophilic foam that protects and cushions wounds. Small pores decrease the chance of tissue migration into the foam dressing.</span></p>', 'publish', 'open', 'open', '', 'copa-foam', '', '', '2013-05-12 11:25:58', '2013-05-12 11:25:58', '', 0, 'http://admedonline.com/wordpress/?product=copa-foam', 0, 'product', '', 0),
(279, 1, '2013-05-12 11:56:25', '2013-05-12 11:56:25', '', 'Algidex Ag Catheter Patch-170', '', 'inherit', 'open', 'open', '', 'algidex-ag-catheter-patch-170', '', '', '2014-12-20 22:51:55', '2014-12-20 22:51:55', '', 280, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_1_7_0_170.jpg', 0, 'attachment', 'image/jpeg', 0),
(280, 1, '2013-05-12 11:56:25', '2013-05-12 11:56:25', '<ul> <li>Reduces bacterial colonization associated with catheter related infections</li> <li>Absorbs moisture around the catheter insertion site</li> <li>Sterile patch of polyurethane foam coated with an ionic silver alginate and maltodextrin matrix</li> <li>Releases active ionic silver for broad antimicrobial effectiveness</li> <li>Does NOT require activation</li> <li>Up to seven days wear time</li> <li>Non-irritating</li> <li>Non-staining</li> </ul> <p><strong><span class="orange">INDICATIONS:  </span> </strong>Dialysis catheters, Central venous lines, Arterial catheters, External fixator pins, Epidural catheters, Peripheral IV catheters, Gastrostomy feeding tubes, Non-vascular percutaneous devices</p>', 'Algidex Ag Catheter Patch', '<p>Algidex Ag catheter patches reduce bacterial colonization associated with catheter-related infections by releasing ionic silver for broad antimicrobial effectiveness.</p>', 'publish', 'open', 'open', '', 'algidex-ag-catheter-patch', '', '', '2013-05-12 11:56:25', '2013-05-12 11:56:25', '', 0, 'http://admedonline.com/wordpress/?product=algidex-ag-catheter-patch', 0, 'product', '', 0),
(281, 1, '2013-05-12 16:30:08', '2013-05-12 16:30:08', '', 'DuoDERM  Extra Thin-171', '', 'inherit', 'open', 'open', '', 'duoderm-extra-thin-171', '', '', '2014-12-20 22:51:55', '2014-12-20 22:51:55', '', 282, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_1_7_1_171.jpg', 0, 'attachment', 'image/jpeg', 0),
(282, 1, '2013-05-12 16:30:08', '2013-05-12 16:30:08', '<p>DuoDERM is the only hydrocolloid dressing with both a Triple Hydrocolloid Matrix® and a viral/bacterial barrier. <span style="font-size: 12px; line-height: 1.5em;">Translucent backing is designed to prevent needless dressing changes that can cause </span><span style="font-size: 12px; line-height: 1.5em;">discomfort and disturb healing</span></p> <p>• Thin design is flexible and conformable<br />• Designed to promote a moist wound environment, which supports healing and prevents damage to <br />   new epithelium upon removal<br />• Moisture-resistant for ease of cleaning/showering<br />• Can be used as a primary or secondary dressing<br /><span>• Can be cut to shape</span></p>', 'DuoDERM  Extra Thin', '<p>DuoDERM is the only hydrocolloid dressing with both a Triple Hydrocolloid Matrix® and a viral/bacterial barrier.  <span style="font-size: 12px; line-height: 1.5em;">Translucent backing is designed to prevent needless dressing changes that can cause </span><span style="font-size: 12px; line-height: 1.5em;">discomfort and disturb healing.</span></p>', 'publish', 'open', 'open', '', 'duoderm-cfg-extra-this', '', '', '2013-05-12 16:30:08', '2013-05-12 16:30:08', '', 0, 'http://admedonline.com/wordpress/?product=duoderm-cfg-extra-this', 0, 'product', '', 0),
(283, 1, '2013-05-12 16:40:34', '2013-05-12 16:40:34', '', 'Kendall Sorb-it Drain Sponge-172', '', 'inherit', 'open', 'open', '', 'kendall-sorb-it-drain-sponge-172', '', '', '2014-12-20 22:51:56', '2014-12-20 22:51:56', '', 284, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_1_7_2_172.jpg', 0, 'attachment', 'image/jpeg', 0),
(284, 1, '2013-05-12 16:40:34', '2013-05-12 16:40:34', '<p><span>The Kendall Sorb-It I.V. Sponges have a pre-cut notch that conforms well around drains, catheters, chest tubes, I.V.\'s and tracheotomies. Sorb-It 2"x2" are 6 ply sterile sponges and are packaged in a box of 35 sealed packs, each pack contains 2 sponges. The smaller 2"x2" size eliminates the need for sterile scissors. These sponges are virtually lint free which minimizes the risk of wound contamination.</span></p>', 'Kendall Sorb-it Drain Sponge', '<p>Kendall Sorb-it Drain Sponges conforms well around drains, catheters, chest tubes, IV\'s and tracheotomies. 6-ply ST.  Each packages contains 2 sponges.</p>', 'publish', 'open', 'open', '', 'kendall-sorb-it-drain-sponge', '', '', '2013-05-12 16:40:34', '2013-05-12 16:40:34', '', 0, 'http://admedonline.com/wordpress/?product=kendall-sorb-it-drain-sponge', 0, 'product', '', 0),
(285, 1, '2013-05-12 19:52:49', '2013-05-12 19:52:49', '', 'Circaid Juxta-Lite Standard Legging-173', '', 'inherit', 'open', 'open', '', 'circaid-juxta-lite-standard-legging-173', '', '', '2014-12-20 22:51:56', '2014-12-20 22:51:56', '', 286, 'http://admedonline.com/wordpress/wp-content/uploads/2013/05/p_1_7_3_173.jpg', 0, 'attachment', 'image/jpeg', 0),
(286, 1, '2013-05-12 19:52:49', '2013-05-12 19:52:49', '<p><span>The <strong><span>Juxta-Lite</span></strong> is an easy alternative for those who lack the strength or dexterity to use traditional compression stockings. <strong>Q</strong></span><strong style="font-size: 12px; line-height: 1.5em;">uick and easy application</strong><span style="font-size: 12px; line-height: 1.5em;"> and </span><strong style="font-size: 12px; line-height: 1.5em;">minimal adjustments</strong><span style="font-size: 12px; line-height: 1.5em;"> increase patient compliance for treatment of venous Insufficiency. </span></p> <p><span style="font-size: 12px; line-height: 1.5em;">The Juxta-Lite is engineered with the ability to be set to three compression levels (20-30, 30-40 or 40-50 mmHg) and is available in two lengths with sizes ranging from Small through XXL. The  compression anklet  is available in S and M sizes.</span></p> <p><span style="font-size: 12px; line-height: 1.5em;"><span>Packages include</span><br /><span>Juxta-Lite™ Standard Legging, one pair of Comfort Compression Anklets™, one Comfort Leg Liner™, and one Built-in Pressure™ (BPS™) Guide Card.</span></span></p> <p><span style="font-size: 12px; line-height: 1.5em;">The user-friendly design of Juxta-Lite enables patients to achieve the higher compression levels that are necessary to reduce ulcer occurance. The patented Juxta-Lock Band System allows for easy application and adjustment to assure the appropriate compression level.</span></p> <p><span style="font-size: 12pt;"><strong><em>This product requires a signature upon delivery.</em></strong></span></p> <p><strong>PLEASE CALL OUR TOLL FREE NUMBER FOR SIZING ASSISTANCE:   </strong><strong style="font-size: 12px; line-height: 1.5em;">Sizing requires                 </strong><strong style="font-size: 12px; line-height: 1.5em;">ankle circumference measurement                                                                                           </strong></p> <p><strong style="font-size: 12px; line-height: 1.5em;">calf circumference measurement                                                                                            </strong></p> <p><strong style="font-size: 12px; line-height: 1.5em;">length measurement from floor to knee crease</strong></p> <p><strong> </strong></p> <p><strong><br /></strong></p>', 'Circaid Juxta-Lite Standard Legging', '<p>The <strong>Juxta-Lite</strong> knee-high "standard legging" compression garment is an easy alternative for those who lack the strength or dexterity to use traditional compression stockings. The patented Juxta-Lock Band System allows for easy application and adjustment to assure the appropriate compression level.</p>', 'publish', 'open', 'open', '', 'circaid-juxta-lite', '', '', '2013-05-12 19:52:49', '2013-05-12 19:52:49', '', 0, 'http://admedonline.com/wordpress/?product=circaid-juxta-lite', 0, 'product', '', 0),
