(290, 1, '2013-05-13 16:20:45', '2013-05-13 16:20:45', '<p>Reliamed Self-Adhesive Dressing Retention Sheet<strong> </strong><span>is a comfortable, highly conformable, nonwoven, water-resistant dressing retention tape that stretches for easy application and patient comfort. </span></p> <p><span>Secures dressings, tubes, cannulas, drainage devices and instruments.</span></p>', 'Reliamed Retention Tape', '<p>Reliamed Self-Adhesive Dressing Retention Sheet<strong> </strong>is a comfortable, highly conformable, nonwoven, water-resistant dressing retention tape that stretches for easy application and patient comfort.</p>', 'publish', 'open', 'open', '', 'reliamed-retention-tape', '', '', '2013-05-13 16:20:45', '2013-05-13 16:20:45', '', 0, 'http://admedonline.com/wordpress/?product=reliamed-retention-tape', 0, 'product', '', 0),
