(296, 1, '2013-05-15 03:45:48', '2013-05-15 03:45:48', '<p><strong>Anasept Spray 8 oz</strong>.   <span style="font-size: 12px; line-height: 1.5em;">BEST PRICE! Anasept Spray is an extremely safe and gentle wound cleanser that eliminates all bacteria, fungi and viruses including MRSA and VRE and more in 30-60 seconds without harm to healthy tissue.  It should be used when there is any break in the skin,  skin irritation or a chronic wound. It is also used for preparation for dialysis and central line, IV fluid and infusion sites. Anasept Spray is  colorless isotonic-tissue compatible solution.  Anasept Spray is stable for two-years and is free of necrotizing chemicals found in other antiseptic products. Anasept Spray will not stain the skin. FDA approved as an antimicrobial solution.    </span><span style="text-decoration: underline; font-size: 12px; line-height: 1.5em;">www.anacapatechnologies.com</span></p> <p><strong><span style="font-size: 12px; line-height: 1.5em;">ST Gauze Sponges  30 pcs. 4" x 4"  </span></strong><span style="font-size: 12px; line-height: 1.5em;">Sterile Latex-free sponges made from 100% USP cotton. Ideal for wound cleansing and as secondary dressings for added absorbency. Highly absorbent rayon/polyester blend provides fast wicking properties and minimizes skin maceration. Suitable for debriding and covering and packing wounds or general use. Sterile and latex-free.</span></p> <p><strong>Paper tape 2"  </strong><span style="font-size: 12px; line-height: 1.5em;">ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</span></p> <p><span><br /></span></p>', 'Anasept Spray, ST Gauze Sponges, Tape', '', 'publish', 'open', 'open', '', 'anasept-spray-gauze-sponges-and-2-paper-tape', '', '', '2013-05-15 03:45:48', '2013-05-15 03:45:48', '', 0, 'http://admedonline.com/wordpress/?product=anasept-spray-gauze-sponges-and-2-paper-tape', 0, 'product', '', 0),
