(307, 1, '2013-05-15 12:37:46', '2013-05-15 12:37:46', '<p><strong>4 x 4 Sterile Antimicrobial Gauze Sponge - 30 pcs.</strong></p> <p>Antimicrobial gauze sponges are impregnated with PHMB (Polyhexamethylene Biguanide). This is a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA.</p> <p> </p> <p><strong>2" Paper Tape - 2 Rolls</strong></p> <p>ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</p>', 'Antimicrobial Gauze Sponges & Paper Tape', '', 'publish', 'open', 'open', '', 'sterile-antimicrobial-gauze-sponge-2-taper-tape', '', '', '2013-05-15 12:37:46', '2013-05-15 12:37:46', '', 0, 'http://admedonline.com/wordpress/?product=sterile-antimicrobial-gauze-sponge-2-taper-tape', 0, 'product', '', 0),
