(311, 1, '2013-05-21 02:43:04', '2013-05-21 02:43:04', '<p><strong>30 4" x 4" antimicrobial gauze sponges - </strong> Kendall Curity AMD antimicrobial gauze sponges are impregnated with PHMB (Polyhexamethylene Biguanide). This is a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA.</p> <p><strong>30 gauze rolls -</strong> Gazetex washed and low-linting woven gauze rolls are used for wrapping or packing large and deep wounds. When used as a primary dressing Gazetex rolls provide fast wicking and absorbency and aeration. This gauze dressing provides additional cushioning and comfort when used as a secondary dressing. Latex Free. Available in 6-ply Non-Sterile (NS) and Sterile (ST) rolls.</p> <p><span style="font-size: 12px; line-height: 1.5em;"><strong>2 Rolls 2" paper tape -  </strong> easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</span></p>', 'Antimicrobial Sponges, Gauze Rolls, Paper Tape', '', 'publish', 'open', 'open', '', '4x4-antimicrobial-gauze-sponge-gauze-rolls-2-paper-tape', '', '', '2013-05-21 02:43:04', '2013-05-21 02:43:04', '', 0, 'http://admedonline.com/wordpress/?product=4x4-antimicrobial-gauze-sponge-gauze-rolls-2-paper-tape', 0, 'product', '', 0),
