(315, 1, '2013-05-21 02:52:49', '2013-05-21 02:52:49', '<p><strong>Multidex Gel - 3oz Tube </strong><br />A hydrophilic Maltodextrin NF wound dressing clinically proven to promote epithelial proliferation and granulation tissue. Quickly fills wound site and rapidly mixes with exudate to form a protective coating that maintains an ideal moisture balance to protect against dehydration. Available as a gel for dry and minimally draining wounds. For use on all wound types. Can be used on infected or hard-to-heal wounds. Specifically formulated to provide topical nutrients to wound sites and create a natural healing environment. Non-toxic and not systemically absorbed. Controls odor while decreasing purulent exudate. Penetrates all wound irregularities to fill tunneling and undermining. Softens necrotic tissue to facilitate debridement.</p> <p><strong style="font-size: 12px; line-height: 1.5em;">Kendall Curity AMD antimicrobial gauze sponges - 30pcs     </strong><span style="line-height: 1.5em; font-size: 12px;">Kendall Curity AMD antimicrobial gauze sponges are impregnated with PHMB (Polyhexamethylene Biguanide). This is a powerful yet safe antiseptic that has a broad range effectiveness against gram positive and gram negative microorganisms including some multi-drug resistant strains such as MRSA.</span></p> <p><span style="line-height: 1.5em;"><strong>Paper Tape - 2 Rolls 2"</strong><br />ReliaMed Paper Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping.</span></p>', 'Multidex Gel, Gauze Sponges, Paper Tape', '', 'publish', 'open', 'open', '', 'multidex-gel-4x4-gauze-sponges-2-paper-tape', '', '', '2013-05-21 02:52:49', '2013-05-21 02:52:49', '', 0, 'http://admedonline.com/wordpress/?product=multidex-gel-4x4-gauze-sponges-2-paper-tape', 0, 'product', '', 0),
