(327, 1, '2013-05-21 09:57:21', '2013-05-21 09:57:21', '<p><strong>12 Pcs Hydrofera Blue - 4\' x 4" </strong></p> <p class="bodyplain">Hydrofera Blue is a simple, safe, effective and proven moist wound dressing. It is constructed of polyvinyl alcohol (PVA) sponge complexed with two organic pigments, which provide broad-spectrum bacteriostatic protection. The pigments (Methylene Blue and Gentian Violet) have been used safely in medicine for over 50 years and have proven effective against a variety of microorganisms including MRSA and VRE.</p> <p class="bodyplain"><span style="font-size: 12px; line-height: 1.5em;">Hydrofera Blue is highly absorptive. In addition to being bacteriostatic, its open cell structure provides capillary vacuum action to draw excess fluid and exudates from the wound bed. Hydrofera Blue must be moistened with sterile saline or sterile water, squeezed out and secured to the wound bed with an appropriate secondary dressing. When kept moist, Hydrofera Blue is incredibly soft and comfortable for the patient. Other attributes of the dressing include gentile self-debridement of necrotic tissue and odor control through prevention of the growth of odor causing bacteria on the sponge. Dressings should be changed every 1 to 3 days following good wound care practice. In cases of high infection, the dressing may require more frequent change, indicated by the dressing changing color from blue to white.</span></p> <p>Hydrofera Blue has been <strong>approved for use on all types of wounds</strong> <strong>except third degree burns</strong>. Hydrofera Blue is intended for use on complex wounds and has shown excellent results in trials for treatment of wounds (Pyoderma - radiation burns - chemical burns - venous stasis ulcers - yeast infections - folliculitis - infected wounds). Hydrofera Blue can be used to provide a safe moist environment for optimum wound healing on non-infected wounds. Hydrofera Blue is highly absorptive. In addition to being bacteriostatic the Hydrofera Blue open cell structure provides capillary vacuum action to draw excess fluid and exudate from the wound bed. Hydrofera Blue must be moistened with sterile saline or sterile water then squeezed out and secured to the wound bed with an appropriate secondary dressing. Hydrofera Blue is incredibly soft and comfortable for the patient (must be kept moist). Other attributes of Hydrofera Blue include gentle self-debridement of necrotic tissue and pain relief. Hydrofera Blue also provides odor control through prevention of the growth of odor-causing bacteria on the sponge. Hydrofera Blue dressings should be changed every 1 to 3 days following good wound care practice.</p> <p> </p> <p><strong>Sterile roll gauze - 12   </strong>Gazetex washed and low-linting woven gauze rolls are used for wrapping or packing large and deep wounds. When used as a primary dressing Gazetex rolls provide fast wicking and absorbency and aeration. This gauze dressing provides additional cushioning and comfort when used as a secondary dressing. Latex Free. Available in 6-ply Non-Sterile (NS) and Sterile (ST) rolls.</p> <p> <strong style="font-size: 12px; line-height: 1.5em;"></strong></p> <p><strong style="font-size: 12px; line-height: 1.5em;">2" paper tape - 2 rolls  </strong><span style="font-size: 12px; line-height: 1.5em;">ReliaMed Paper 2" Tape is easy to tear with a natural porosity which allows skin to breathe. Ideal for situations involving frequent re-taping. </span></p> <p> </p>', 'Hydrofera Blue, Roll Gauze, Tape', '', 'publish', 'open', 'open', '', 'hydrofera-blue-4x4-bulky-gauze-and-2-paper-tape', '', '', '2013-05-21 09:57:21', '2013-05-21 09:57:21', '', 0, 'http://admedonline.com/wordpress/?product=hydrofera-blue-4x4-bulky-gauze-and-2-paper-tape', 0, 'product', '', 0),
