(331, 1, '2013-05-23 21:01:16', '2013-05-23 21:01:16', '<p><span style="font-size: 12px; line-height: 1.5em;">Aside from its unique dual mode of action (hydrating dry to lightly exuding wounds while also capable of absorbing moderate amounts of exudates), this hybrid hydrogel/hydrocolloid dressing has several features giving it a distinct advantage over other dressings:</span></p> <ul> <li>Cooling and soothing upon application</li> <li>Extremely conformable, even in difficult to dress areas</li> <li>100% atraumatic adhesion across the wound contact surface</li> <li>Completely clear for easier wound observation</li> <li>Gelatin-free – so no associated odor common with standard hydrocolloids</li> </ul>', 'XTRASORB HCS', '<p>A cool and soothing hybrid hydrogel/hydrocolloid dressing.  100% atraumatic adhesion and completely clear for wound observation. </p>', 'publish', 'open', 'open', '', 'xtrasorb-hcs', '', '', '2013-05-23 21:01:16', '2013-05-23 21:01:16', '', 0, 'http://admedonline.com/wordpress/?product=xtrasorb-hcs', 0, 'product', '', 0),
