(333, 1, '2013-05-23 21:14:21', '2013-05-23 21:14:21', '<p><span><span>XTRASORB</span></span><span>  </span><span>Is a novel super-absorbent wound dressing. At its core is a super -absorbent polymer that allows the dressing to help re-define the category of highly absorbent dressings. Whereas other absorbent dressings (include foams, abd pads, and other cellulose-based dressings) rely on spaces within the dressings to fill with fluid, XTRASORB\'s super-absorbent polymer binds to fluid and converts to a gel. The distinct advantages this offers over traditional dressings are:<br /></span></p> <p><span style="font-size: 12px; line-height: 1.5em;">XTRASORB</span><span style="font-size: 12px; line-height: 1.5em;"> dressings are able to hold more fluid</span></p> <ul> <li><span><span>XTRASORB</span></span><span> dressings lock fluid inside the dressing, helping to <br /></span><span>decrease the risk of maceration</span><span><br /></span></li> <li><span><span>XTRASORB </span></span><span>dressings lock fluid inside the dressing, helping to keep <br /></span><span>the harmful contents inside would fluid away from the wound and <br /></span><span>periwound skin</span><span><br /></span></li> </ul> <p><span>The dressings come in a variety of sizes, and can be used on an assortment of chronic and acute wounds including:<br /></span></p> <p><span style="font-size: 12px; line-height: 1.5em;">Pressure Ulcers</span></p> <p><span style="font-size: 12px; line-height: 1.5em;">Diabetic Foot Ulcers</span></p> <ul> <li><span>Fistulas</span><span><br /></span></li> <li><span>Venous Leg Ulcers</span><span><br /></span></li> <li><span>Post-Operative Wounds</span><span><br /></span></li> <li><span>Oncologic Wounds</span><span><br /></span></li> <li><span>Arterial Ulcers</span><span><br /></span></li> <li><span>Laparotomy Wounds</span><span>  </span></li> </ul>', 'XTRASORB Foam', '<p>A novel super-absorbent wound dressing that binds with fluid and converts to a gel. This product can be used on many types of chronic and acute wounds.</p>', 'publish', 'open', 'open', '', 'xtrasorb-foam-non-adhesive', '', '', '2013-05-23 21:14:21', '2013-05-23 21:14:21', '', 0, 'http://admedonline.com/wordpress/?product=xtrasorb-foam-non-adhesive', 0, 'product', '', 0),
