(335, 1, '2013-06-18 20:03:46', '2013-06-18 20:03:46', '<p>This conforming (stretch) gauze prevents bacteria from entering a wound and inhibits bacterial growth without toxicity to healthy tissue.  The cationic biocide Poly DADMAC is intrinsically bound to the substrate dressings to prevent bacteria from entering a wound and inhibit bacterial growth without toxicity to healthy tissue.</p>', 'BIOGARD Conforming Gauze Barrier Dressing', '<p>This conforming (stretch) gauze prevents bacteria from entering a wound and inhibits bacterial growth without toxicity to healthy tissue.</p>', 'publish', 'open', 'open', '', 'biogard-conforming-gauze-barrier-dressing', '', '', '2013-06-18 20:03:46', '2013-06-18 20:03:46', '', 0, 'http://admedonline.com/wordpress/?product=biogard-conforming-gauze-barrier-dressing', 0, 'product', '', 0),
