(337, 1, '2014-04-07 13:19:27', '2014-04-07 13:19:27', '<p>MEDIHONEY®  Paste</p> <p>100% Active Leptospermum Honey</p> <p>• Helps to maintain a moist environment for optimal healing. <br />• High osmotic potential can promote an increase in the outflow of wound fluid aiding in autolytic debridement.<br />• Low pH helps to lower the pH within the wound environment, which has been shown to have wound healing benefits <br /> <br />• Easy-to-use, non-toxic, natural and safe with the potential for extended wear times</p> <p> </p>', 'MEDIHONEY® Paste', '<p>MEDIHONEY PASTE® - 100% Leptospermum Honey</p>', 'publish', 'open', 'open', '', 'medihoney-paste', '', '', '2014-04-07 13:19:27', '2014-04-07 13:19:27', '', 0, 'http://admedonline.com/wordpress/?product=medihoney-paste', 0, 'product', '', 0),
