(346, 1, '2014-09-22 17:37:03', '2014-09-22 17:37:03', '<p>Novana Protect with 12% Zinc Oxide is a skin protectant cream that provides a protective barrier.  This barrier helps seal out wetness and aids in the prevention and treatment  of skin problems associated with the wearing of diapers.</p>', 'Novana Protect', '<p>Novana Protect is a skin protectant cream that contains 12% Zinc Oxide.</p>', 'publish', 'open', 'open', '', 'novana-protect', '', '', '2014-09-22 17:37:03', '2014-09-22 17:37:03', '', 0, 'http://admedonline.com/wordpress/?product=novana-protect', 0, 'product', '', 0),
(347, 1, '2014-09-22 17:47:42', '2014-09-22 17:47:42', '<p>Novana Anti-fungal cream contains 2% Miconazole Nitrate which treats, relieves and aids in the healing of fungal infections.  This cream is formulated with zinc oxide for an added moisture barrier.</p>', 'Novana Anti-fungal', '<p>Novana Anti-fungal cream contains 2% Miconazole Nitrate.</p>', 'publish', 'open', 'open', '', 'novana-anti-fungal', '', '', '2014-09-22 17:47:42', '2014-09-22 17:47:42', '', 0, 'http://admedonline.com/wordpress/?product=novana-anti-fungal', 0, 'product', '', 0),
(348, 1, '2014-09-22 18:03:45', '2014-09-22 18:03:45', '<p>Novana All-In-One  with Dimethicone is a one-step perineal cleanser.  This product is a moisturizer, skin protectant and barrier cream.</p>', 'Novana All-In-One', '<p>Novana All-In-One  with Dimethicone is a one-step perineal cleanser.</p>', 'publish', 'open', 'open', '', 'novana-all-in-one', '', '', '2014-09-22 18:03:45', '2014-09-22 18:03:45', '', 0, 'http://admedonline.com/wordpress/?product=novana-all-in-one', 0, 'product', '', 0),
(349, 1, '2014-10-03 14:21:28', '2014-10-03 14:21:28', '<p>ColActive Plus Ag contains collagen, ionic silver, alginate and CMC.  This product targets excess protease activity to trigger the healing of chronic wounds. While this patented matrix atracts, binds and deactivates MMP\'s, it provides  prolonged, targeted MMP control without altering the activity of essential growth factors. Excess exudate is removed through the action of alginate and CMC while an optimal moisture balance is maintained for wound closure.  Ionic silver provides broad spectrum antimicrobial action.</p> <p>This easy to use product gels on contact with moisture and is highly conformable. It is ideal for restarting the healing process in chronic, difficult to heal wounds including diabetic foot ulcers, venous leg ulcers, pressure ulcers, donor and graft sites, traumatic wounds, dehisced surgical wounds, and1st and 2nd degree burns.</p>', 'ColActive Plus Ag', '<p>ColActive Plus Ag collagen with silver targets excess protease activity to trigger the healing of chronic wounds. </p>', 'publish', 'open', 'open', '', 'colactive-plus-ag', '', '', '2014-10-03 14:21:28', '2014-10-03 14:21:28', '', 0, 'http://admedonline.com/wordpress/?product=colactive-plus-ag', 0, 'product', '', 0),
