(944, 1, '2014-12-20 22:59:03', '2014-12-20 22:59:03', '<p class="bodytxt">Painful and debilitating chronic wounds caused by diabetes, pressure, venous insufficiency and arterial disease affect millions of Americans. These wounds are frequently treated in nursing offices and physician offices. A patient caring for his own wounds at home between appointments must either purchase supplies or have a wound care provider bill his insurance for wound care dressings.</p>\r\n<p class="bodytxt">Wound Care Resources specializes in providing a complete selection of traditional and advanced wound care dressings for patient use either at home or in the nursing home. Our mission is to seek out and provide the newest, most advanced products on the market so wound care professionals can access whatever will enable each patient to heal faster and with less pain.</p>', 'Home', '', 'publish', 'open', 'open', '', 'home', '', '', '2014-12-21 00:00:11', '2014-12-21 00:00:11', '', 0, 'http://admedonline.com/wordpress/?page_id=944', 0, 'page', '', 0),
(945, 1, '2014-12-20 22:59:03', '2014-12-20 22:59:03', '', 'Home', '', 'inherit', 'open', 'open', '', '944-revision-v1', '', '', '2014-12-20 22:59:03', '2014-12-20 22:59:03', '', 944, 'http://admedonline.com/wordpress/?p=945', 0, 'revision', '', 0),
(946, 1, '2014-12-20 22:59:35', '2014-12-20 22:59:35', '', 'Blog', '', 'publish', 'open', 'open', '', 'blog', '', '', '2014-12-20 22:59:35', '2014-12-20 22:59:35', '', 0, 'http://admedonline.com/wordpress/?page_id=946', 0, 'page', '', 0),
(947, 1, '2014-12-20 22:59:35', '2014-12-20 22:59:35', '', 'Blog', '', 'inherit', 'open', 'open', '', '946-revision-v1', '', '', '2014-12-20 22:59:35', '2014-12-20 22:59:35', '', 946, 'http://admedonline.com/wordpress/?p=947', 0, 'revision', '', 0),
(954, 1, '2014-12-21 00:00:11', '2014-12-21 00:00:11', '<p class="bodytxt">Painful and debilitating chronic wounds caused by diabetes, pressure, venous insufficiency and arterial disease affect millions of Americans. These wounds are frequently treated in nursing offices and physician offices. A patient caring for his own wounds at home between appointments must either purchase supplies or have a wound care provider bill his insurance for wound care dressings.</p>\r\n<p class="bodytxt">Wound Care Resources specializes in providing a complete selection of traditional and advanced wound care dressings for patient use either at home or in the nursing home. Our mission is to seek out and provide the newest, most advanced products on the market so wound care professionals can access whatever will enable each patient to heal faster and with less pain.</p>', 'Home', '', 'inherit', 'open', 'open', '', '944-revision-v1', '', '', '2014-12-21 00:00:11', '2014-12-21 00:00:11', '', 944, 'http://admedonline.com/wordpress/?p=954', 0, 'revision', '', 0),
(955, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', ' ', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?p=955', 1, 'nav_menu_item', '', 0),
(956, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', ' ', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 7, 'http://admedonline.com/wordpress/?p=956', 1, 'nav_menu_item', '', 0),
(957, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Wound dressings appropriate for all types of wounds including, pressure ulcers, diabetic ulcers, arterial wounds, post-surgical wounds, non-healing surgical wounds and wounds caused by venous insufficiency.  Included in this category are both primary and secondary dressings.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?p=957', 1, 'nav_menu_item', '', 0),
(958, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Absorb very large amounts of drainage that can delay the healing of any of wound including pressure ulcers, arterial ulcers, surgical wounds, and diabetic ulcers.  Large amounts of drainage is common if any type of infection or Superbug is present in the wound site.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=958', 1, 'nav_menu_item', '', 0),
(959, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Absorb excess wound fluid that can prevent or delay wound healing.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=959', 1, 'nav_menu_item', '', 0),
(960, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Gently removes debris and dressings residue from the wound bed.  For all kinds of wounds including pressure ulcers, stasis ulcers, diabetic ulcers, arterial ulcers, postsurgical wounds, burns, and abrasions.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=960', 1, 'nav_menu_item', '', 0),
(961, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Antimicrobial cleansers contain either sodium hypochlorite or chlorhexidine gluconate to prevent or kill common infection and Superbug infections such as MRSA, VRE, Pseudomonas, C Difficile, Acinetobacter and pathogenic fungi</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 27, 'http://admedonline.com/wordpress/?p=961', 1, 'nav_menu_item', '', 0),
(962, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Dressings used to absorb excess drainage and prevent maceration of wounds.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=962', 1, 'nav_menu_item', '', 0),
(963, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Surgical dressings and products designed to heal, soothe and/or prevent infection in first and second degree burns, radiation dermatitis and some aesthetic procedures that produce a burning sensation.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=963', 1, 'nav_menu_item', '', 0),
(964, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Silverlon Acute Burn Gloves are open finger and oversized 20% for use immediately after acute injury or post surgery for both partial to full thickness burns. They offer broad antimicrobial protection to often hard to dress parts of the hand.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 30, 'http://admedonline.com/wordpress/?p=964', 1, 'nav_menu_item', '', 0),
(965, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Dressings used as a secondary covering or secondary dressing to hold a primary dressing in place.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 30, 'http://admedonline.com/wordpress/?p=965', 1, 'nav_menu_item', '', 0),
(966, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>These dressings  are hydrogels in a tube or sheet form and provide moisture needed to heal many burns. Some hydrating dressings also have antimicrobial benefits.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 30, 'http://admedonline.com/wordpress/?p=966', 1, 'nav_menu_item', '', 0),
(967, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Oil-based products such as petroleum gauze, Xeroform and oil emulsion gauze protect and provide a moist environment for the healing of burns and can be removed with minimal pain or trauma.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 30, 'http://admedonline.com/wordpress/?p=967', 1, 'nav_menu_item', '', 0),
(968, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Products that provide needed moisture and soothe burns along with Silverlon burn dressings that take the pain out of wounds and promote healing.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 30, 'http://admedonline.com/wordpress/?p=968', 1, 'nav_menu_item', '', 0),
(969, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Gloves come in different sizes, styles, vinyl or latex, powdered or unpowdered and are used to prevent transmission of disease and infection.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=969', 1, 'nav_menu_item', '', 0),
(970, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Surgical dressings that will not disrupt healing by sticking to a wound and can be removed with minimal pain. These include products with special non-adherent ,breathable coatings and dressings that have an oil, oil emulsion or petroleum base.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=970', 1, 'nav_menu_item', '', 0),
(971, 1, '2014-12-22 05:03:52', '0000-00-00 00:00:00', '<p>Dressings containing silver, honey or sodium hypochlorite to eliminate infections or Superbugs in burn patients along with cover dressings and other products important to preventing or treating  infection.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:52', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=971', 1, 'nav_menu_item', '', 0),
(972, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Sheets or particles used to assist in wound healing. These products may be used in conjunction with most other surgical dressings.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=972', 1, 'nav_menu_item', '', 0),
(973, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Hold secondary dressings (example,  gauze) in place without the use of tape or other adhesive products. An excellent choice for those with fragile skin or adhesive sensitivities.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=973', 1, 'nav_menu_item', '', 0),
(974, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Bundled products often used together for wound healing. DISCOUNT prices and  FREE shipping.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=974', 1, 'nav_menu_item', '', 0),
(975, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Products used to compress the leg to prevent swelling or to heal wounds in patients having venous insufficiency.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=975', 1, 'nav_menu_item', '', 0),
(976, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Fillers are applied inside a wound to assist in healing.  These may be in the form of a packing gauze, a paste or a powder and may or may not be antimicrobial.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=976', 1, 'nav_menu_item', '', 0),
(977, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Used to absorb drainage and sometimes to provide extra protection to an area.  These come either as non-adhesive dressings to be retained with tape or  tapeless product or with an adhesive border.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=977', 1, 'nav_menu_item', '', 0),
(978, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Products in this category include bulky gauze rolls,conforming gauze rolls, gauze sponges, antimicrobial gauze rolls and sponges, drain sponges and impregnated gauze. Most of these products are used as secondary dressings to cover a primary dressing and provide protection against infection or trauma and for minimal absorption.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=978', 1, 'nav_menu_item', '', 0),
(979, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Gauzes impregnated with an antimicrobial agent to protect a wound and prevent infection from penetrating from the outside and to eliminate infection that is absorbed from a draining wound.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=979', 1, 'nav_menu_item', '', 0),
(980, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', ' ', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=980', 1, 'nav_menu_item', '', 0),
(981, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', ' ', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=981', 1, 'nav_menu_item', '', 0),
(982, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', ' ', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=982', 1, 'nav_menu_item', '', 0),
(983, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Reliamed conforming gauze and Biogard antimicrobial conforming gauze stay in place with minimal taping and conform to difficult body contours.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=983', 1, 'nav_menu_item', '', 0),
(984, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', ' ', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=984', 1, 'nav_menu_item', '', 0),
(985, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Strips of gauze that may be impregnated with other dressings or are already impregnated with antimicrobial products to prevent infections or Superbugs.  These products are used to fill space in deep wounds for proper healing.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=985', 1, 'nav_menu_item', '', 0),
(986, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', ' ', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 53, 'http://admedonline.com/wordpress/?p=986', 1, 'nav_menu_item', '', 0),
(987, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Traditional hydrocolloids come in a sheet form and are made to protect an area and absorb moderate wound exudate.  Built-in adhesive qualities provide a bonding to the skin. </p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=987', 1, 'nav_menu_item', '', 0),
(988, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Gels or sheet-style hydrogels are made to add  moisture to wounds that are too dry and promote debridement of dead or devitalized tissue.  Hydrogels may also contain products that make them antimicrobial and  prevent or eliminate infection. May also be used to soothe and provide moisture to  burns.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 18, 'http://admedonline.com/wordpress/?p=988', 1, 'nav_menu_item', '', 0),
(989, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Includes dressings containing silver or sodium hypochlorite to eliminate infections and Superbugs.  Products in this category are effective against such strains as staph, MRSA, VRE, CRE, Pseudomonas, C Difficile, Acinetobacter and more.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?p=989', 1, 'nav_menu_item', '', 0),
(990, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Used to wick away or absorb heavy drainage that is common in patients having venous insufficiency.  These products are applied before compression dressings or garments.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 26, 'http://admedonline.com/wordpress/?p=990', 1, 'nav_menu_item', '', 0),
(991, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Cleaning agents used on the skin or a wound to prevent or eliminate infections such as staph, MRSA, VRE, CRE, C Diff, Acinetobacter, pathogenic fungi and more.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 26, 'http://admedonline.com/wordpress/?p=991', 1, 'nav_menu_item', '', 0),
(992, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Antimiccrobial dressings eliminate common infections and multi-resistant infections (Superbugs) without the use of silver.  These products are useful for any kind of wound needing antimicrobial protection or elimination of infection.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 26, 'http://admedonline.com/wordpress/?p=992', 1, 'nav_menu_item', '', 0),
(993, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Products containing silver come in both hydrogel formats for  wounds needing moisture or in alginate or foam form for wounds with drainage. These products are used to eliminate infection in all types of wounds.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 26, 'http://admedonline.com/wordpress/?p=993', 1, 'nav_menu_item', '', 0),
(994, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Provide compression to the lower leg for patients to control swelling and assist in both the prevention and healing of wounds in those having venous insufficiency.  </p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?p=994', 1, 'nav_menu_item', '', 0),
(995, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Products used to clean the leg or wounds on the leg before the application of compression products or garments.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 36, 'http://admedonline.com/wordpress/?p=995', 1, 'nav_menu_item', '', 0),
(996, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Garments and stockings are used to control swelling and wounds of the lower leg in patients that have venous insufficiency.  Other products in this group are those that can be used to provide infection control and absorb drainage caused by weeping of wounds on the lower leg  before application of garments or wraps which control swelling and prevent or assist in wound healing.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 36, 'http://admedonline.com/wordpress/?p=996', 1, 'nav_menu_item', '', 0),
(997, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p> 3M Coban 2 Layer, 3M 2 Layer Lite and DeWrap Three Layer are used to reduce swelling and provide therapeutic compression for legs affected by venous insufficiency.  These must be applied by a medical professional.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 36, 'http://admedonline.com/wordpress/?p=997', 1, 'nav_menu_item', '', 0),
(998, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>One and two-piece pouches,  wafers, barriers ,preps, deodorizing drops and other supplies for patients with ostomy, urostomy or iliostomy needs.  CALL TO FIND OUT IF WE CAN BILL YOUR INSURANCE.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?p=998', 1, 'nav_menu_item', '', 0),
(999, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Products provided include:<br />\n One-Piece Pouches,<br />\n Two-Piece Pouches,<br />\n Urostomy Pouches,<br />\n Wafers,<br />\n Skin Barriers,<br />\n Skin prep products,<br />\n Deodorizing drops,<br />\n    &#8230;..and much more</p>\n<p>We carry Hollister, Convatec, Perfect Choice, generic brands and more to suit all consumers.  There are thousands of sizes, styles and products to choose from to suit your individual needs.</p>\n<p>Please call our ostomy department toll free at (877) 278-3088 for the best in personalized service.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 40, 'http://admedonline.com/wordpress/?p=999', 1, 'nav_menu_item', '', 0),
(1000, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Products providing soothing relief and  moisture needed after laser treatments, other aesthetic procedures or surgeries. Also in this group are creams and preps for skin protection or moisturizing and special tapeless secondary dressings for those who cannot use adhesive products.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 0, 'http://admedonline.com/wordpress/?p=1000', 1, 'nav_menu_item', '', 0),
(1001, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Thick, very absorbent dressings used to absorb excess drainage or to provide padding. Dermasciences&#8217;  Xtrasorb and Sorbion are used like ABD pads to absorb very heavy amounts of drainage.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 44, 'http://admedonline.com/wordpress/?p=1001', 1, 'nav_menu_item', '', 0),
(1002, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Medi-Tech Spand-Gel hydrogel sheets and Medi-Tech Medi-Soothe Lotion are effective for soothing and cooling relief after facial peels, laser treatments and other aesthetic treatments or cosmetic treatments. </p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 44, 'http://admedonline.com/wordpress/?p=1002', 1, 'nav_menu_item', '', 0),
(1003, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>3M Cavilon  Antifungal Cream, Durable Barrier Cream, Cavilon Extra Dry Skin Cream, 3M tapes, 3M Barrier Film Spray, No Sting Barrier Swabs, Dermagran Hydrophillic, 3-in-1 Incontinence Spray, Medi-Sooth Therapy Lotion protect skin</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 44, 'http://admedonline.com/wordpress/?p=1003', 1, 'nav_menu_item', '', 0),
(1004, 1, '2014-12-22 05:03:53', '0000-00-00 00:00:00', '<p>Specialty products including InterDry Ag, Medi-Tech Medibrief, Algidex Ag Catheter patch, Silverlon Acute Burn gloves, Medi-Tech Spandage, Coban, 3M Kind Removal Silicone Tape, Sorbact Gel and more.</p>\n', '', '', 'draft', 'open', 'open', '', '', '', '', '2014-12-22 05:03:53', '0000-00-00 00:00:00', '', 44, 'http://admedonline.com/wordpress/?p=1004', 1, 'nav_menu_item', '', 0),
(1005, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Wound dressings appropriate for all types of wounds including, pressure ulcers, diabetic ulcers, arterial wounds, post-surgical wounds, non-healing surgical wounds and wounds caused by venous insufficiency. Included in this category are both primary and secondary dressings.', '', '', 'publish', 'open', 'open', '', '1005', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 0, 'http://admedonline.com/wordpress/?p=1005', 1, 'nav_menu_item', '', 0),
(1006, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Absorb very large amounts of drainage that can delay the healing of any of wound including pressure ulcers, arterial ulcers, surgical wounds, and diabetic ulcers. Large amounts of drainage is common if any type of infection or Superbug is present in the wound site.', '', '', 'publish', 'open', 'open', '', '1006', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1006', 2, 'nav_menu_item', '', 0) ;
