(1007, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Absorb excess wound fluid that can prevent or delay wound healing.', '', '', 'publish', 'open', 'open', '', '1007', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1007', 3, 'nav_menu_item', '', 0),
(1008, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Gently removes debris and dressings residue from the wound bed. For all kinds of wounds including pressure ulcers, stasis ulcers, diabetic ulcers, arterial ulcers, postsurgical wounds, burns, and abrasions.', '', '', 'publish', 'open', 'open', '', '1008', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1008', 6, 'nav_menu_item', '', 0),
(1010, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Dressings used to absorb excess drainage and prevent maceration of wounds.', '', '', 'publish', 'open', 'open', '', '1010', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1010', 4, 'nav_menu_item', '', 0),
(1011, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Surgical dressings and products designed to heal, soothe and/or prevent infection in first and second degree burns, radiation dermatitis and some aesthetic procedures that produce a burning sensation.', '', '', 'publish', 'open', 'open', '', '1011', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1011', 5, 'nav_menu_item', '', 0),
(1017, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Gloves come in different sizes, styles, vinyl or latex, powdered or unpowdered and are used to prevent transmission of disease and infection.', '', '', 'publish', 'open', 'open', '', '1017', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1017', 13, 'nav_menu_item', '', 0),
(1018, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Surgical dressings that will not disrupt healing by sticking to a wound and can be removed with minimal pain. These include products with special non-adherent ,breathable coatings and dressings that have an oil, oil emulsion or petroleum base.', '', '', 'publish', 'open', 'open', '', '1018', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1018', 18, 'nav_menu_item', '', 0),
(1019, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Dressings containing silver, honey or sodium hypochlorite to eliminate infections or Superbugs in burn patients along with cover dressings and other products important to preventing or treating infection.', '', '', 'publish', 'open', 'open', '', '1019', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1019', 17, 'nav_menu_item', '', 0),
(1020, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Sheets or particles used to assist in wound healing. These products may be used in conjunction with most other surgical dressings.', '', '', 'publish', 'open', 'open', '', '1020', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1020', 7, 'nav_menu_item', '', 0),
(1021, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Hold secondary dressings (example, gauze) in place without the use of tape or other adhesive products. An excellent choice for those with fragile skin or adhesive sensitivities.', '', '', 'publish', 'open', 'open', '', '1021', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1021', 20, 'nav_menu_item', '', 0),
(1022, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Bundled products often used together for wound healing. DISCOUNT prices and FREE shipping.', '', '', 'publish', 'open', 'open', '', '1022', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1022', 9, 'nav_menu_item', '', 0),
(1023, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Products used to compress the leg to prevent swelling or to heal wounds in patients having venous insufficiency.', '', '', 'publish', 'open', 'open', '', '1023', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1023', 8, 'nav_menu_item', '', 0),
(1024, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Fillers are applied inside a wound to assist in healing. These may be in the form of a packing gauze, a paste or a powder and may or may not be antimicrobial.', '', '', 'publish', 'open', 'open', '', '1024', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1024', 10, 'nav_menu_item', '', 0),
(1025, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Used to absorb drainage and sometimes to provide extra protection to an area. These come either as non-adhesive dressings to be retained with tape or tapeless product or with an adhesive border.', '', '', 'publish', 'open', 'open', '', '1025', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1025', 11, 'nav_menu_item', '', 0),
(1026, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Products in this category include bulky gauze rolls,conforming gauze rolls, gauze sponges, antimicrobial gauze rolls and sponges, drain sponges and impregnated gauze. Most of these products are used as secondary dressings to cover a primary dressing and provide protection against infection or trauma and for minimal absorption.', '', '', 'publish', 'open', 'open', '', '1026', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1026', 12, 'nav_menu_item', '', 0),
(1035, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Traditional hydrocolloids come in a sheet form and are made to protect an area and absorb moderate wound exudate. Built-in adhesive qualities provide a bonding to the skin.', '', '', 'publish', 'open', 'open', '', '1035', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1035', 14, 'nav_menu_item', '', 0),
(1036, 1, '2014-12-22 05:06:24', '2014-12-22 05:06:24', 'Gels or sheet-style hydrogels are made to add moisture to wounds that are too dry and promote debridement of dead or devitalized tissue. Hydrogels may also contain products that make them antimicrobial and prevent or eliminate infection. May also be used to soothe and provide moisture to burns.', '', '', 'publish', 'open', 'open', '', '1036', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1036', 15, 'nav_menu_item', '', 0),
(1037, 1, '2014-12-22 06:59:37', '2014-12-22 06:59:37', 'Surgical dressings and products designed to heal, soothe and/or prevent infection in first and second degree burns, radiation dermatitis and some aesthetic procedures that produce a burning sensation.', '', '', 'publish', 'open', 'open', '', '1037', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1037', 23, 'nav_menu_item', '', 0),
(1038, 1, '2014-12-22 06:59:37', '2014-12-22 06:59:37', 'Silverlon Acute Burn Gloves are open finger and oversized 20% for use immediately after acute injury or post surgery for both partial to full thickness burns. They offer broad antimicrobial protection to often hard to dress parts of the hand.', '', '', 'publish', 'open', 'open', '', '1038', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 30, 'http://admedonline.com/wordpress/?p=1038', 26, 'nav_menu_item', '', 0),
(1039, 1, '2014-12-22 06:59:37', '2014-12-22 06:59:37', 'Dressings used as a secondary covering or secondary dressing to hold a primary dressing in place.', '', '', 'publish', 'open', 'open', '', '1039', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 30, 'http://admedonline.com/wordpress/?p=1039', 24, 'nav_menu_item', '', 0),
(1040, 1, '2014-12-22 06:59:37', '2014-12-22 06:59:37', 'These dressings are hydrogels in a tube or sheet form and provide moisture needed to heal many burns. Some hydrating dressings also have antimicrobial benefits.', '', '', 'publish', 'open', 'open', '', '1040', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 30, 'http://admedonline.com/wordpress/?p=1040', 25, 'nav_menu_item', '', 0),
