(1058, 1, '2014-12-22 07:04:52', '2014-12-22 07:04:52', 'Products providing soothing relief and moisture needed after laser treatments, other aesthetic procedures or surgeries. Also in this group are creams and preps for skin protection or moisturizing and special tapeless secondary dressings for those who cannot use adhesive products.', '', '', 'publish', 'open', 'open', '', '1058', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 0, 'http://admedonline.com/wordpress/?p=1058', 44, 'nav_menu_item', '', 0),
(1059, 1, '2014-12-22 07:04:52', '2014-12-22 07:04:52', 'Thick, very absorbent dressings used to absorb excess drainage or to provide padding. Dermasciences’ Xtrasorb and Sorbion are used like ABD pads to absorb very heavy amounts of drainage.', '', '', 'publish', 'open', 'open', '', '1059', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 44, 'http://admedonline.com/wordpress/?p=1059', 45, 'nav_menu_item', '', 0),
(1060, 1, '2014-12-22 07:04:52', '2014-12-22 07:04:52', 'Medi-Tech Spand-Gel hydrogel sheets and Medi-Tech Medi-Soothe Lotion are effective for soothing and cooling relief after facial peels, laser treatments and other aesthetic treatments or cosmetic treatments.', '', '', 'publish', 'open', 'open', '', '1060', '', '', '2014-12-23 05:53:13', '2014-12-23 05:53:13', '', 44, 'http://admedonline.com/wordpress/?p=1060', 46, 'nav_menu_item', '', 0),
