(1062, 1, '2014-12-22 07:04:52', '2014-12-22 07:04:52', 'Specialty products including InterDry Ag, Medi-Tech Medibrief, Algidex Ag Catheter patch, Silverlon Acute Burn gloves, Medi-Tech Spandage, Coban, 3M Kind Removal Silicone Tape, Sorbact Gel and more.', '', '', 'publish', 'open', 'open', '', '1062', '', '', '2014-12-23 05:53:13', '2014-12-23 05:53:13', '', 44, 'http://admedonline.com/wordpress/?p=1062', 48, 'nav_menu_item', '', 0),
(1063, 1, '2014-12-22 07:12:05', '2014-12-22 07:12:05', 'Protect the skin against body fluids, tape trauma and friction and can be used to create better adherence of adhesive dressings and less trauma upon removal. Cream barriers are used to protect and relieve common skin problems like irritation, itching and burning.', '', '', 'publish', 'open', 'open', '', '1063', '', '', '2014-12-23 05:53:12', '2014-12-23 05:53:12', '', 18, 'http://admedonline.com/wordpress/?p=1063', 16, 'nav_menu_item', '', 0),
