(1068, 1, '2014-12-23 04:16:04', '2014-12-23 04:16:04', '<div class="rte">\r\n<h4>Are you under a doctor\'s care for an open wound?</h4>\r\nPlease be advised that many products shown on this site are covered by Medicare B or private insurance policies. To find out about what your insurance will cover, please call Wound Care Resources at (888) 287-9797 or go to our <a href="http://www.woundcareresources.net/" target="new"><strong>website</strong></a>. If Wound Care Resources bills your insurance for wound care dressings, anything purchased on this site will be packed along with covered items and shipped for a reduced shipping charge of $5.00.\r\n<h4>Shipping and Handling</h4>\r\n<strong>We specialize in getting your products to you quickly</strong>.\r\nOnce an order is received it is processed within 24 to 36 hours during our business hours Monday-Friday 8:00-5:00 CST. Orders placed on Saturday or Sunday will be shipped on the following business day.\r\n\r\nAdvanced Medical Resources routinely ships by UPS or FedEx. The United States Postal Service may be utilized for very small orders.  Most orders should be received in 2-5 business days after processing.\r\n\r\nThe following holidays will be observed by our office when standard shipping service is not available: Memorial Day, Independence Day, Labor Day, Thanksgiving Day, day after Thanksgiving, Christmas Day, New Year’s Eve, New Years Day.\r\n<h4><strong>Returns and Exchange Policy</strong></h4>\r\n&nbsp;\r\n<p align="center">• Only unopened, unused packages purchased from us and in perfect resale condition\r\nmay be returned.\r\n• A restocking fee of 15% will apply.\r\n• Products special ordered or not routinely carried by Advanced Medical Resources\r\nmay not be returned for credit.\r\n• All returns must be mailed back to us within 30 days of purchase.</p>\r\n<strong>Please use the following procedure</strong>:\r\nCall the office to obtain an RMA number or use our <a href="http://www.admedonline.com/returns.asp"><strong>return form</strong></a>.\r\n<ol>\r\n	<li>pack items carefully</li>\r\n	<li>Call us at (866) 755-2677 to obtain an RMA number or use our return form. This number must be clearly placed outside the box.  Packages received without an RMA number will not be accepted and will be returned to you</li>\r\n	<li>Insure your package for the cost of your items</li>\r\n	<li>Send returns to:\r\nAdvanced Medical Resources\r\n4 Newbern Highway\r\nYorkville, TN 38389</li>\r\n</ol>\r\n&nbsp;\r\n\r\n<strong>Returned products will be inspected.</strong>\r\nOnce your products have been considered to be in perfect resalable condition, your credit card will be credited for the returned items less the restocking fee.  All shipping charges are at the customer’s expense and are not refundable.\r\n\r\n<strong>Returns due to product defect or incorrect products sent</strong>\r\nIf products were sent in error or are defective, Advanced Medical Resources must be contacted within two days of delivery for an adjustment to be made.  We will issue you a Return Merchandise Authorization number to ship the product back to our office, and resend the correct items at no extra cost for shipping and handling.  Please follow these steps:\r\n\r\nTo request a return please use our <a href="http://www.admedonline.com/returns.asp"><strong>return form</strong></a> or call our toll free number (866) 755-2677 with the following information:\r\n<ol>\r\n	<li>Customer name</li>\r\n	<li>Date of purchase</li>\r\n	<li>Original invoice number</li>\r\n	<li>Product item number</li>\r\n	<li>Product name</li>\r\n	<li>Reason for return.</li>\r\n</ol>\r\n&nbsp;\r\n\r\nUpon verification of the above information, our returns department will assign a return authorization number and process a request for a UPS pickup.\r\n\r\n<strong>Returns due to shipping damage\r\n</strong>Damaged boxes should not be accepted upon delivery.  However, if you do accept or receive a damaged box and the contents have been damaged, please use our <a href="http://www.admedonline.com/contact.asp"><strong>contact form</strong></a> or call our toll free number at (866) 755-2677.\r\n<h4>General Policies</h4>\r\n&nbsp;\r\n\r\n<strong>Patients who have Medicare or commercial insurance </strong>should contact Wound Care Resources at (888) 287-9797 to determine if their insurance will cover the cost of wound care supplies.  You may also visit the website at<strong> <a href="http://www.woundcareresources.net/" target="new">www.woundcareresources.net</a></strong>.\r\n\r\n<strong>Product Availability:</strong>\r\nAdvanced Medical Resources cannot be liable for delays caused by a shortage of raw materials, manufacturing difficulties, delivery delays, labor disputes or any other issues beyond our control.\r\n\r\n<strong>Backorders:</strong>\r\nAdvanced Medical works hard to prevent back orders.  However, if a backorder occurs, the shipping cost will be adjusted for the cost of the order actually shipped, and your backorder shipping will be sent to you at a nominal charge.\r\n\r\n<strong>Substitutions:</strong>\r\nBrand name products that have a chemical or biological effect on healing (primary dressings) will not be substituted without contacting the customer by phone or email.\r\n\r\nAll stock dressings that are used to hold other dressings in place (secondary dressings like gauze, gauze sponges, gauze rolls, ABD pads, etc.) have been chosen by Advanced Medical for quality. Substitutions of these types of products will not affect the healing outcome of the wound, and in some rare cases a comparable product with a different brand name may be sent to fill the entire order in a timely manner.\r\n\r\n<strong>Sales tax will be applied in accordance with state and federal laws</strong>.\r\n\r\n<strong>Privacy Policy</strong>\r\nYou may be confident that your personal information will be protected.\r\nNo personal information will be provided or sold to any other marketing organizations.\r\n\r\n<strong>Volume Discounts Available</strong>\r\nPlease call our office for questions regarding volume discounting. AMR routinely offers volume discounts to medical facilities ordering products in larger quantities.  Valid tax IDs and additional information is required.\r\n\r\n<strong>Special orders, contract orders and business to business orders are non-returnable.</strong>\r\n\r\nPlease call our office at <strong>(866) 755-2677</strong> with questions regarding volume discounting, and ask for Jackie Scott.  You may also contact her at<strong> <a href="mailto:jscott@admedonline.com">jscott@admedonline.com</a></strong>.\r\n\r\n</div>', 'Terms and Conditions', '', 'publish', 'open', 'open', '', 'terms-and-conditions', '', '', '2014-12-23 04:16:04', '2014-12-23 04:16:04', '', 0, 'http://admedonline.com/wordpress/?page_id=1068', 0, 'page', '', 0),
